(41, 0, 14, '《2014年》あなたの目標占い！', 'あなたの2014年の目標はどんな目標でしょう？', '07facebook_600.png', 'USER,RESULT1', '<div class="answer">\r\n<p>2014年の目標！</p>\r\n<br>\r\n<p>[RESULT1]</p>\r\n<br>\r\n<p>　　[USER]</p>\r\n</div>', '[@RESULT1@]\r\n【来世まで力を温存する！】\r\n【少し頑張る！】\r\n【無駄な努力はしない！】\r\n【精一杯、怠ける！】\r\n【大胆に攻める！】\r\n【本能のままに生きる！】\r\n【100人切りをやり遂げる！】\r\n【あまり調子に乗らない！】\r\n【衣服なんて軟弱ものは着ない！】\r\n【汚名を返上する！】\r\n【脱！ぼっち！】\r\n【真面目にふざける！】\r\n【スタイリッシュに生きる！】\r\n【高望みしない！】\r\n【何をされても、怒らない！】\r\n【我が道を突き進む！】\r\n【そろそろ自立する！】\r\n【あいつの唇を奪う！】\r\n【少し落ち着く！】\r\n【空気を読む！】\r\n【言い訳をしない！】\r\n【2015年に本気出す！】\r\n【もっと己を晒け出す！】\r\n【世界の頂点に立つ！】\r\n【主に守備力を強化する！】\r\n【主に攻撃力を強化する！】\r\n【主にMPを温存する！】\r\n【常に回復に徹する！】\r\n【友達の度肝を抜く！】\r\n【そろそろ成仏する！】\r\n【その前に【目標】←この漢字の読み方を調べる！】\r\n【拾い食いをやめる！】\r\n【脱！中二病！】\r\n【チョットだけ素直になってみる！】\r\n【もう泣かない！】\r\n【このまま快進撃を続ける！】\r\n【知らない人について行かない！】\r\n【現　状　維　持！】\r\n【欲しい物は全て手に入れる！】\r\n【最後まで諦めない！】\r\n【そろそろ現実と向き合う！】\r\n【極力頑張らない！】\r\n【少し頑張る！】\r\n【あいつらを見返す！】\r\n【本能のままに生きる！】\r\n【ヤリまくる！】\r\n【身を固める！】\r\n【脱！下ネタ！】\r\n【チョット性欲を抑える！】\r\n[/@RESULT1@]', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 28, '<div class="image">\r\n<h1><img src="/uploads/07contents.png" alt="alt" width="100%" /></h1>\r\n<p>あなたの2014年の目標はどんな目標でしょう？</p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #ff0000;">【次へ進む】</span>を押すと結果が見れるよ！</p>\r\n<p>&darr;</p>\r\n<p>&darr;</p>\r\n</div>', 4, 5, '0000-00-00', 1),
(42, 0, 14, 'もしも神様と電話がつながったら？診断 ', 'あなたは神様に「○○にしてください！」とお願いごとをしたようです。', '02facebook_600.png', 'USER,RESULT1,RESULT2', '<div class="answer">\r\n<p>[USER]「もしもし？神様ですか？」<br>\r\n神「そうじゃ」<br>\r\n[USER]「お願いします[RESULT1]にしてください！」<br>\r\n神「ふむ、叶えてやろう」<br>\r\n[USER]「ありがとうございます！オオオッ…」</p>\r\n\r\n<p>[USER]は[RESULT2]になった。</p>\r\n</div>', '[@RESULT1@]\r\n向井理\r\nリア充\r\n高身長\r\n天才\r\nアイドル\r\nお金持ち\r\n神\r\nモテる顔\r\n美声\r\n総理大臣\r\n漢\r\nオンナ\r\n社長\r\n[/@RESULT1@]\r\n[@RESULT2@]\r\n片栗粉\r\nうまい棒\r\n保田圭\r\n剛力彩芽\r\n平泉静\r\nプリキュア\r\nくまモン\r\nふなっしー\r\nひきこもり\r\nゾウリムシ\r\nミジンコ\r\n[/@RESULT2@]', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 116, '<div class="image">\r\n<h1><img src="/uploads/02contents.png" alt="alt" width="100%" /></h1>\r\n<p>あなたは神様に「○○にしてください！」とお願いごとをしたようです。</p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #ff0000;">【次へ進む】</span>を押すと結果が見れるよ！</p>\r\n<p>&darr;</p>\r\n<p>&darr;</p>\r\n</div>', 2, 3, '0000-00-00', 1),
(43, 0, 14, 'あなたを飲み物に例えると？診断', 'あなたの性格を飲み物に例えます。相性の良い飲み物もわかります！', '05facebook_600.png', 'USER,RESULT1,RESULT2', '<div class="answer">\r\n<p>[USER]を飲み物に例えると[RESULT1]</p>\r\n<p>[RESULT2]の人と相性が良い。</p>\r\n</div>', '[@RESULT1@]\r\n「ウォッカ」です。気が強く凛々しい人。いつも勝気に振舞っているが、実はこっそり泣いている。気難しい面も。\r\n「栄養ドリンク」です。いつも元気で行動力溢れる人。個性的でユニークだが、そのせいで人に避けられることも。\r\n「サイダー」です。生真面目な頑張り屋さん。バランスをとるのが上手。でもどこか地味で影が薄く、むっつりスケベ。\r\n「コーヒー」です。冷静沈着。時に厳しいが、好きな人の前では甘えん坊になる。ツンデレ。\r\n「レモネード」です。マイペースで少し天然。人とズレている事が多く、個性的だがある意味ちょっとアホ。でも気にしない。\r\n「カルピス」です。真面目な顔して不真面目。自己管理が苦手。実は凄く寂しがりやでベタベタするのが好き。\r\n「ビール」です。一見普通の人だが、実は変わってる。色んな考えを受け入れられる、柔らかい人でもある。\r\n「泥水」です。汚れ役。心が黒い。自分がすべてで他人はどうでもいい。お金が大好き。人がゴミのようだ。\r\n「ミルク」です。優しく純粋。人の笑顔で幸せになる暖かい人。でも実はちょっとエロい。\r\n「白ワイン」です。繊細で感受性豊か。自分の好きな事はとことん追求する。ちょっと自惚れやすい面もある。\r\n「野菜ジュース」です。健全で純粋。悪いことが大嫌いな正義感のある人。一方で心が狭く、他人を受け入れられなかったり。\r\n「コーラ」です。元気でお調子者。人には好かれやすいが、少し腹黒い一面も。ユーモラスな人。\r\n「日本酒」です。シャイ。控えめな性格だが器が広く、深みもある人。礼儀正しく基本的に真面目。\r\n「メロンソーダ」です。子どもの心を忘れない人。嫌なことはしない。わがまま。でも好きな人には何でもしたくなる。\r\n「緑茶」です。渋くて大人。ちょっと凝り性でオタク的なところがある。自分の意見を持っていて他人に振り回されない。\r\n「むぎ茶」です。活発でサバサバしている。細かいことは気にしない。ある意味適当。楽しいことが好き。\r\n「紅茶」です。ロマンチストで控えめ。色んな事を空想するが行動には起こせない。人見知りで自分の時間を大切にする。\r\n「水」です。嘘が嫌いな正直な人。ブレずにしっかりしている。ただちょっと印象が薄く、空気と化すことも。\r\n「オレンジジュース」です。爽やかな性格。滅多に怒らないが、怒ると怖い。色んな人に好かれる人気者。\r\n「カフェオレ」です。気分屋。気持ちがころころ入れ替わる。素直になれずに損をすることもしばしば。\r\n「赤ワイン」です。情熱的で積極的。新しいことが大好きだが、一方で飽き性でもある。甘やかされるとすぐふにゃふにゃになったり。\r\n[/@RESULT1@]\r\n[@RESULT2@]\r\n「ウォッカ」\r\n「栄養ドリンク」\r\n「サイダー」\r\n「コーヒー」\r\n「レモネード」\r\n「カルピス」\r\n「ビール」\r\n「泥水」\r\n「ミルク」\r\n「白ワイン」\r\n「野菜ジュース」\r\n「コーラ」\r\n「日本酒」\r\n「メロンソーダ」\r\n「緑茶」\r\n「むぎ茶」\r\n「紅茶」\r\n「水」\r\n「オレンジジュース」\r\n「カフェオレ」\r\n「赤ワイン」\r\n[/@RESULT2@]', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 23, '<div class="image">\r\n<h1><img src="/uploads/05contents.png" alt="alt" width="100%" /></h1>\r\n<p>あなたの性格を飲み物に例えます。相性の良い飲み物もわかります！</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #ff0000;">【次へ進む】</span>を押すと結果が見れるよ！</p>\r\n<p>&darr;</p>\r\n<p>&darr;</p>\r\n</div>', 2, 3, '0000-00-00', 1),
(44, 0, 14, 'あなたを人気アニメ／マンガのキャラクターに例えると診断', 'あなたにぴったりなキャラクターを診断します。', '06facebook_600.png', 'USER,RESULT1,RESULT2', '<div class="answer">\r\n<p>[USER]をキャラクターに例えると[RESULT1][RESULT2]の人と相性が良い。</p>\r\n</div>', '[@RESULT1@]\r\n「孫悟空」です。目標を見つけると苦労は厭わない努力家。少し楽観的で天然だが、カッとなると誰も手を付けられない。\r\n「ナウシカ」です。心の広い愛情溢れる性格。たまに感情的にはなるが、他人の気持を考え行動できる人。\r\n「アイアンマン」です。ロマンチストで自信家。ちょっとワガママだがやることはやる。実は寂しがり屋で泣き虫。\r\n「カイジ」です。直感に優れた感性の人。頭の回転が早く、いざという時の決断力がスバ抜けている。だが普段は怠惰で無気力。\r\n「野原しんのすけ」です。人を笑顔にするのが好きな明るい人。ちょっとエッチな面もあり、子供のような純真さも持っている。\r\n「ミッキー」です。何でもこなす器用者。明るい性格で愛される人気者。だが一方でルールに厳しい面をもっている。ﾊﾊｯ。\r\n「江戸川コナン」です。知性溢れる理性的な人。基本的に冷静だが、二面性があり腹黒い面も。\r\n「碇シンジ」です。弱気で控えめな性格。すぐに自暴自棄になってしまうが、分別のある常識人でもある。優しく、素直。\r\n「ブラックジャック」です。一見怖く思われることが多いが、実は内面的で苦悩を抱えている。厳しく優しさを伝えられる人。\r\n「ルパン三世」です。飄々とした掴みどころのない人。欲望に素直で、アグレッシブ。ユニークでエッチ。\r\n「ピカチュウ」です。ﾋﾟｶﾁｭｰ！ﾋﾟｶｧ！ﾋﾟ…ﾋﾟｶｧｰ…？ﾋﾟｶｧ！ﾋﾟｶﾋﾟｶｰ♪ﾋﾟｶﾋﾟｯｶﾁｭｰｯ！！\r\n「空条承太郎」です。クールで渋い。様々な才能を持つ器用な人である一方、感情を表に出せない不器用な性格の人でもある。\r\n「ルフィ」です。情に厚く、自分の信念を強く持っている。少々おバカな面もあるが、人を惹きつける魅力がある。\r\n「加賀香子」です。とにかくストレートに感情を表すお嬢様タイプ。ただし、絶対に浮気をしませんし、あなたを裏切りません。\r\n[/@RESULT1@]\r\n[@RESULT2@]\r\n「孫悟空」\r\n「ナウシカ」\r\n「アイアンマン」\r\n「カイジ」\r\n「野原しんのすけ」\r\n「ミッキー」\r\n「江戸川コナン」\r\n「碇シンジ」\r\n「ブラックジャック」\r\n「ルパン三世」\r\n「ピカチュウ」\r\n「空条承太郎」\r\n「ルフィ」\r\n「加賀香子」\r\n[/@RESULT2@]', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 132, '<div class="image">\r\n<h1><img src="/uploads/06contents.png" alt="alt" width="100%" /></h1>\r\n<p>あなたにぴったりなキャラクターを診断します。</p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #ff0000;">【次へ進む】</span>を押すと結果が見れるよ！</p>\r\n<p>&darr;</p>\r\n<p>&darr;</p>\r\n</div>', 3, 4, '0000-00-00', 1),
(45, 0, 14, 'もしも好きな人に突然『ぎゅーってしていい？』って言われたら？診断', 'ドキドキが止まりません…。', '01facebook_600.png', 'USER,RESULT1', '<div class="answer">\r\n<p>[RESULT1]</p>\r\n</div>', '[@RESULT1@]\r\n好きな人「ぎゅーってしていい？」　[USER]「…」　好きな人「[USER]？」　[USER]「…」　好きな人「ぎゅーじゃなくてちゅーしちゃうよ？」　[USER]「えっ」　好きな人はあなたに顔を近づけてきた…\r\n好きな人「ぎゅーってしていい？」　[USER]「いいけど十秒だけだよ」　好きな人「えっ」　[USER]「約束守れないならさせない」　好きな人は仕方なく命令に従うことにしたようだ…\r\n好きな人「ぎゅーってしていい？」　[USER]「いいぞ！来い！」　好きな人「おう！」　好きな人はあなたを強く抱きしめてきた！\r\n好きな人「ぎゅーってしていい？」　[USER]「いいよ」　好きな人「…」　[USER]「どうしたの」　好きな人「やっぱりちゅーがいい…」　好きな人は照れている…\r\n好きな人「ぎゅーってしていい？」　[USER]「いいよ」　好きな人「誰ですかあなた通報しますよ」　好きな人は懐から素早く携帯を取り出した！\r\n好きな人「ぎゅーってしていい？」　[USER]「うん。ぎゅーっ」　好きな人「えっ」　[USER]「こっちからしたらダメだった？」　好きな人「…」　好きな人は黙って俯いたままもじもじしている…\r\n好きな人「ぎゅーってしていい？」　[USER]「うん」　好きな人「えっ」　[USER]「えっ」　好きな人「誰」\r\n好きな人「ぎゅーってしていい？」　[USER]「うん」　好きな人「そうやって誰にでも許可してんの？」　[USER]「えっ」　好きな人「どうなの？」　好きな人は何故か怒っている…\r\n好きな人「ぎゅーってしていい？」　[USER]「うん」　好きな人「ちゅーもしていい？」　[USER]「うん」　好きな人「エッチもしていい？」　[USER]「うん…えっ」　好きな人はあなたを押し倒してきた！\r\n好きな人「ぎゅーってしていい？」　[USER]「うん」　好きな人「ほんと？」　[USER]「ちゅーもしていいよ」　好きな人「えっ」　好きな人は口元を押さえて真っ赤になっている…\r\n好きな人「ぎゅーってしていい？」　[USER]「うん」　好きな人「よーし。ぎゅーっ」　好きな人は笑いながらあなたの首を絞めてきた！ \r\n好きな人「ぎゅーってしていい？」　[USER]「うん」　好きな人「よし、じゃあさっそく」　好きな人は懐から縄を取り出した…\r\n好きな人「ぎゅーってしていい？」　[USER]「うん」　好きな人「嘘に決まってんだろｗｗｗｗｗ」\r\n好きな人「ぎゅーってしていい？」　[USER]「えっ」　好きな人「ちゅーの方がいい？」　[USER]「う…うん…」　好きな人「了解」　好きな人は笑いながらあなたにキスをしてきた…\r\n好きな人「ぎゅーってしていい？」　[USER]「ぎゅー？ちゅーじゃなくて？」　好きな人「えっ」　[USER]「ちゅーがいいな」　好きな人「わ…わかった…」　好きな人は照れながらもあなたに顔を近づけてきた…\r\n好きな人「ぎゅーってしていい？」　[USER]「ぎゅー？ちゅーじゃなくて？」　好きな人「じゃあちゅーでいいからそっちからしてよ」　[USER]「えっ」　好きな人はにやにやしながらあなたを見つめている…\r\n好きな人「ぎゅーってしていい？」　[USER]「ぎゅーっ」　好きな人「えっ」　[USER]「したかったんでしょ？」　好きな人「いや…そうだけど…あの…」　好きな人は照れている…\r\n好きな人「ぎゅーってしていい？」　[USER]「ぎゅーって何？」　好きな人「えっ」　[USER]「ちゃんと言って」　好きな人「だ…抱きしめさせてください…」　[USER]「よし！」　あなたは好きな人に抱きついた！\r\n好きな人「ぎゅーってしていい？」　[USER]「ぎゅーって何？」　好きな人「えっ」　[USER]「ちゃんと言って」　好きな人「だ…抱きしめさせてください…」　[USER]「断る！」　好きな人はあなたの首を絞めてきた！\r\n好きな人「ぎゅーってしていい？」　[USER]「ここじゃ嫌だ…」　好きな人「ここじゃなかったらいいの？」　[USER]「うん…」　好きな人「そっか」　好きな人は微笑んであなたの手を握ってきた…\r\n好きな人「ぎゅーってしていい？」　[USER]「だめ」　好きな人「えっ」　[USER]「嘘だよ」　好きな人は無言であなたの頬を思いきりつねってきた！\r\n好きな人「ぎゅーってしていい？」　[USER]「だめ」　好きな人「えっ」　好きな人は今にも泣きそうに目を潤ませながらこちらを見ている…\r\n好きな人「ぎゅーってしていい？」　[USER]「だめって言ったら？」　好きな人「無理にでもするよ！」　[USER]「拒否権はないの？」　好きな人「ないよ！」　好きな人は満面の笑みであなたを抱きしめてきた！ \r\n好きな人「ぎゅーってしていい？」　[USER]「ちゅー？」　好きな人「そうじゃなくて、ぎゅー…」　[USER]「ちゅーでしょ？」　好きな人「いや…えっと…」　好きな人は照れている…\r\n好きな人「ぎゅーってしていい？」　[USER]「ちゅーは？」　好きな人「どっちもってこと？」　[USER]「うん」　好きな人「欲張りだね」　好きな人はあなたを抱きしめてキスをしてきた…\r\n好きな人「ぎゅーってしていい？」　[USER]「なんで？」　好きな人「…」　[USER]「言いたくない？」　好きな人「うん…」　[USER]「しょうがないなあ…」　あなたは静かに好きな人を抱きしめた…\r\n好きな人「ぎゅーってしていい？」　[USER]「なんで？」　好きな人「好きだから」　[USER]「何が？」　好きな人「えっと…」　好きな人は照れくさそうに俯いている…\r\n好きな人「ぎゅーってしていい？」　[USER]「なんでしたいの？」　好きな人「えっ」　[USER]「言わなきゃさせてあげないよ」　好きな人はもじもじしている…\r\n好きな人「ぎゅーってしていい？」　[USER]「やだ」　好きな人「そっか、じゃあいいや」　[USER]「えっ」　好きな人「なに？」　[USER]「あ…いや…」　好きな人はにやにやしながらあなたを見つめている…\r\n好きな人「ぎゅーってしていい？」　[USER]「何故そうしたいのか理由を述べよ」　好きな人「[USER]のことが好きだからです」　[USER]「くっ！100点だ！」　あなたと好きな人は熱い抱擁を交わした…\r\n好きな人「ぎゅーってしていい？」　[USER]「何故だ！」　好きな人「貴様のことが好きだからだ！」　[USER]「合格だ！」　あなたは好きな人に向かって大きく手を広げた！\r\n好きな人「ぎゅーってしていい？」　[USER]「貴様、よくそのような台詞を吐けるものだな」　好きな人「愛しているのだから仕方がないだろう」　[USER]「ふん…」　我らは熱い抱擁を交わした…\r\n好きな人「ぎゅーってしていい？」　[USER]「断る」　好きな人「待て。お前に拒否権はない」　[USER]「なんだと」　好きな人「黙って私にぎゅっとされていろ！」　好きな人はあなたを抱きしめてきた！ \r\n[/@RESULT1@]', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 51, '<div class="image">\r\n<h1><img src="/uploads/01contents.png" alt="alt" width="100%" /></h1>\r\n<p>ドキドキが止まりません&hellip;。</p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #ff0000;">【次へ進む】</span>を押すと結果が見れるよ！</p>\r\n<p>&darr;</p>\r\n<p>&darr;</p>\r\n</div>', 3, 4, '0000-00-00', 1),
(46, 0, 14, 'あなたのピュア度を表してみました！診断', '実はあなた…ピュアなんですね。', '03facebook_600.png', 'USER,RESULT1', '<div class="answer">\r\n<p>[USER]のピュア度は</p>\r\n<p>[RESULT1]</p>\r\n</div>', '[@RESULT1@]\r\n【 130％ 】　心が完璧に磨かれている。ホントにとても性格が良いし、他人の失敗を笑うなんて良心が許さない。清廉潔白な聖人ですね。\r\n【 0.00000000000002％ 】　心が汚れ切っている。めっちゃいやらしいし、仲間を裏切ることなら日常茶飯事。腹黒いヤツですね。\r\n【 100％ 】　心に一点の曇りもない。めちゃめちゃ献身的だし、仲間を裏切るなんて絶対にできない。根っからの善人ですね。\r\n【 99.99999999999992％ 】　心は驚きの白さ。めっちゃ性格が良いし、他人の不幸を喜ぶなんてできない。善意の塊みたいな人ですね。\r\n【 90.6％ 】　心がキレイに磨かれている。とても親切だし、公共の場で騒ぐことなど絶対ない。健全な心の持ち主ですね。\r\n【 －500％ 】　心が完全に壊れている。マジで呆れるほど態度が悪いし、人を差別することは無意識のうちにやってる。もはや手遅れですね。\r\n【 99.6％ 】　心がキレイに磨かれている。とても親切だし、ウソをつくことなど絶対ない。健全な心の持ち主ですね。\r\n【 100％ 】　心に一点の曇りもない。めちゃめちゃさわやかだし、他人を挑発するなんて絶対にできない。根っからの善人ですね。\r\n【 －95600％ 】　心は絶望と暗黒の中。マジで徹底して傲慢だし、悪意を持ってルールを無視するようなことを仕掛けてくる。恐ろしい悪魔ですね。\r\n【 100％ 】　心に一点の曇りもない。めちゃめちゃ友達思いだし、悪事を企むなんて絶対にできない。根っからの善人ですね。\r\n【 7660％ 】　心が澄み切っている。マジで驚くほど友達思いだし、自己保身に走るなんて考えたこともない。純真無垢な天使ちゃんですね。\r\n【 －100％ 】　もう心が壊れている。呆れるほどいやらしいし、仲間を裏切ることも自分さえ良ければそれでいい。まさに人間のクズですね。\r\n【 0％ 】　心が汚れでドロドロ。めちゃめちゃ傲慢だし、公共の場で騒ぐのは仕様です。マジで腹黒いヤツですね。\r\n【 80.8％ 】　心が清らか。かなり親切だし、他人の不幸を喜ぶのは大嫌い。クリーンで清潔な人ですね。\r\n 0.000000000000000000009％ 】　心が汚れ切っている。めっちゃ節操がないし、他人を挑発することなら日常茶飯事。腹黒いヤツですね。\r\n【 91.5％ 】　心がキレイに磨かれている。とても思いやりがあるし、八つ当たりすることなど絶対ない。健全な心の持ち主ですね。\r\n【 1550％ 】　心が澄み切っている。マジで驚くほどまじめだし、公共の場で騒ぐなんて考えたこともない。純真無垢な天使ちゃんですね。\r\n[/@RESULT1@]', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 28, '<div class="image">\r\n<h1><img src="/uploads/03contents.png" alt="alt" width="100%" /></h1>\r\n<p>あなたのピュア度を表してみました！診断</p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #ff0000;">【次へ進む】</span>を押すと結果が見れるよ！</p>\r\n<p>&darr;</p>\r\n<p>&darr;</p>\r\n</div>', 5, 6, '0000-00-00', 1),
