(48, 1, 14, '【60秒で泣ける恋話】未送信のメール。', '愛する人を交通事故で亡くしたら、あなたはどうしますか？', 'love_fb600.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/love_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【60秒で泣ける恋話】未送信のメール。</h1>\r\n私が彼と最初に出会ったのは会社の懇談会でした。<br />ふとしたことから一緒に遊ぶようになり、付き合いはじめました。<br /><br />私はもともと打たれ弱い性格だったので、彼にグチってしまうことが 多かったのです。<br />でも、彼はそんな私に嫌な顔一つせずに、優しい言葉をかけてくれたり、<br />励ましてくれていました。<br /><br />彼はグチ一つこぼさず、明るい人だったので、「悩みがないなんていいねー。」<br />なんて言ってしまったりすることもありました。<br /><br />しかし、彼との別れは突然訪れました。彼が交通事故で亡くなったのです。<br /><br /><br />彼のお葬式に行っても、まったく実感が湧きませんでした。<br />お葬式の後、彼の両親から彼の携帯を渡されました。<br /><br />携帯をいじっていると、送信されていない私宛のメールが たくさんあるのに気付きました。<br /><br />そのメールには仕事のグチや悩みごとなどがたくさん書いてありました。<br /><br />その瞬間、私は彼の辛さに気付かなかった自分のくやしさや、無神経な言葉を言った<br />自分への後悔、常に私を気遣っていてくれた彼への感謝で涙が止まりませんでした。<br /><br />あの日からもう1年以上になりますが、その携帯は大切にとってあります。</div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 208, '<div class="textarea">\r\n<h1><img src="/uploads/love_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【60秒で泣ける恋話】未送信のメール。</h1>\r\n<p>&nbsp;私が彼と最初に出会ったのは会社の懇談会でした。<br />ふとしたことから一緒に遊ぶようになり、付き合いはじめました。<br /><br />私はもともと打たれ弱い性格だったので、彼にグチってしまうことが 多かったのです。<br />でも、彼はそんな私に嫌な顔一つせずに、優しい言葉をかけてくれたり、<br />励ましてくれていました。<br /><br />彼はグチ一つこぼさず、明るい人だったので、「悩みがないなんていいねー。」<br />なんて言ってしまったりすることもありました。<br /><br />しかし、彼との別れは突然訪れました。彼が交通事故で亡くなったのです。</p>\r\n<p>彼の遺品には、作りかけのまま未送信の<br />私宛のメールがたくさんありました。<br />その内容は&hellip;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと感動のラストが読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 7, 8, '0000-00-00', 1);
