(49, 1, 14, '泣ける恋愛ショートストーリー【わかれよう。。。。】', '自分が交通事故で歩けなくなりました。あなたは恋人に相談できますか？それともこっそり別れを告げますか？', 'love_fb600.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/love_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>泣ける恋愛ショートストーリー【わかれよう。。。。】</h1>\r\n<p>&nbsp;俺には３年付き合った彼女がいたんだけど、２年前のある日彼女が事故に遭いました。<br />(俺と会う約束をしてて青信号を急いで渡ってたら右折した車にはねられた。)<br /><br />すぐ病院に運ばれた彼女はなんとか一命をとりとめたんだけど、生きてるのが奇跡ってぐらいの大事故で、<br />下半身不随、顔面マヒ、右足切断はのがれられない状態になってしまった。<br /><br />だけど俺、馬鹿なことに彼女が事故にあったなんて全く知らなくて、<br />彼女が事故にあった日も普通に家で彼女を待ってていつまで待ってもこないし<br />電話も繋がらないからイライラしてたり心配したりしてた。<br /><br />彼女の両親に連絡したら「今は家にいて勉強してる」とか言われるし、<br />「俺もう無理なのかな？なにか怒らせたのかな？」とか<br />へこみまくる毎日を過ごしていたある日、彼女からやっと一通のメールが。<br /><br />『わかれよう』<br /><br />見た瞬間「あぁ、やっぱり」って思って涙が止まらなかった。<br />電話をしてもでないし、メール送っても返事はなかった。<br /><br />あれだけ仲よかったのに、こんな終わり方とかどぉなんだよ！<br />と毎日怒りと悲しみで荒れ狂いながら友達と失恋の痛みを癒すために朝まで飲み歩いていた。<br /><br />半年ほどたったある日彼女の妹と偶然近所のコンビニで会った。(彼女とは地元が一緒)<br />俺の姿をみてビックリする妹に俺は笑いかけながら「元気？ミキ(彼女の名前)も元気にしてる？」<br />と聞いたら、妹はうつむいて何も話そうとしませんでした。<br /><br />「どしたん？」言いながら妹の頭を撫でてやると意を決したように<br />「お姉ちゃんのことまだｽｷ？」と聞かれました。<br />「めちゃめちゃ大好きだよ～」って苦笑いした途端妹の目に涙があふれでてきて、<br />「お姉ちゃんもケイタ(俺の名前)のこと大好きなん。ケイタを会わしたいよ」って泣きながら言われました。<br /><br />テンパる俺に妹が涙目で見つめながら<br />「ケイタはどんな姿のお姉ちゃんでも好きですか？」と聞いてきた。<br /><br />そして俺はやっと勘というものが働いた。<br />「ミキになにかあった？」<br />ゆっくり頷く妹をみて俺の目の前は真っ白になった。<br /><br />聞くと半年前、俺と遊ぶ約束したあの日に彼女は事故に遭った。<br />『わかれよう』ってメールは彼女に頼まれて妹が打って送ったという。<br /><br />「お姉ちゃんは今右足ないし、ほとんど喋れないし、オシッコも一人でできないし、字もかけないし、ケイタイも触れない。<br />　でもケイタからのメールや電話がある度に嬉しそうにしたり悲しそうにしたりしてる」と。<br /><br />俺は本当に自分が馬鹿だと思った。<br />悔しくて悔しくて仕方なかったし、なんで第６感が働いて彼女の危機を知れなかったのか、<br />もっと彼女の状態を知ろうとしなかったのか。<br />本当に悔しくて悲しくてその場で号泣してしまった。<br /><br />彼女の妹(あ、言い忘れてたけど彼女の妹は当時小４で、俺と彼女が１９歳でした。)と喫茶店で色々話をした。<br />彼女の今の状態、今でも俺が大好きでよく泣いてること、<br />「こんな状態で生きてても辛いだけ、楽しくない」って何度も自殺未遂を犯したこと。<br /><br />今の彼女の姿をみて俺は普通を装えるのか？<br />不安になりながらも俺は彼女に会う決心をしました。<br /><br />病室に入るとそこは無人でした。<br />「この時間はお姉ちゃんトレーニングの時間だからあと２０分ぐらいしたら帰ってくるよ」<br />妹が時計を見ながら言いました。<br /><br />部屋を見渡すと、ベッドには俺との写真や、二人でUSJに行った時に買ってあげたぬいぐるみが飾られ、<br />カレンダーには俺たちが付き合った７日の所に赤でいびつな形のハートマークが書かれていた。<br />動かしにくい手を動かして書いてくれたんだなぁと思いながら、色々な所に目をやる。<br />部屋にはかすかに彼女の匂いがするような気さえした。<br /><br />椅子に座って妹と話をしながら待つことにした。１分１分が物凄く長く感じる。<br />そして妹が言っていた予定時刻になった途端、<br />ノックと同時に病室の扉が開いて車椅子に乗った彼女と付き添いの看護婦さんが現われた。<br /><br />彼女が俺をみた途端動きが止まる。<br />俺は彼女に会ったら変わり果てた姿をみて泣いたり、ひいてしまったり、<br />普通に接することができないんじゃないかと不安だったけど<br />彼女を見た途端俺は嬉しくて嬉しくて嬉しくて気付いたら彼女を抱き締めていました。<br /><br />抱き締めた彼女は折れそうなくらい細くなっていて、<br />髪の毛からは俺の知ってるシャンプーじゃない匂いがしました。<br />でもすべてが彼女で懐かしくてたまりませんでした。<br /><br />「なんで言ってくれんかったん！」更に力を込めてぎゅー！と抱き締めた。<br />「ミキ・・・」彼女が一声一声をしぼりだすようにして俺の名前を呼んだ。<br /><br />彼女の顔を見ると、涙があふれていて、俺もつられて泣いてしまった。<br />・・・カッコ悪くてごめん。<br />気付いたら看護婦さんも妹も病室にはいなかった。<br />きっと気をきかせてくれたんだろう。<br />彼女の顔をマジマジとみる。<br />口が閉まらなくなってしまったようだが、目元や口元にあるホクロは俺のよく知ってる彼女だった。<br /><br />そして彼女にキスをして、<br />「気付いてやれんくてごめんな、ホンマ大好きやからもう一回付き合ってください」<br />ってまた彼女を抱き締めました。<br /><br />彼女は泣きながら何か言いましたが聞き取れませんでした。<br />俺が聞き返そうとすると彼女は無言で何度も頷いてくれた。<br /><br />「どんな姿のミキでも俺には必要な子だからね、<br />　ホンマに付き合ってくれてありがとう！」<br />って言いながら彼女の涙を何度も拭き取りました。<br />で、俺たちは晴れてまた付き合うことができました。<br />足がない分俺が彼女の足になって支えるし、<br />Ｈはできないけどキスできるし彼女とまたこうして隣同士でいれて幸せです。<br /><br />そしてついこの間、彼女がリハビリを受けてる間に机を開けたら一冊のノートがでてきました。<br /><br />こっそり中をみてみると、どうやら字を書く練習をするためのノートのようで、<br />一冊まるまる使いきっていました。<br />ガタガタの歪みきった字で『１』とか『２』とかいった数字や、<br />『りんご』『あかあお』といった簡単な単語が並んでいました。<br />そしてどんどんとページをめくっていくにつれ、俺の名前をたくさん練習した形跡が。<br />『ケイタに会いたい』<br />『ケイタ大好き』<br />『ケイタつらいよ』<br />『ケイタにあえなくてさみしい』<br />といった文章がたくさんでてきました。<br /><br />離れ離れの間俺のことをこんなにも必要としてくれて想ってくれてたのかと思うと涙がでてきました。<br />本当に彼女に出会えてよかったです！<br />で、今自分を振り替えるためにこの話を打ちながら婚姻届を貰ってきました！<br />今から彼女に渡します！ <br /><br /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;&darr;&darr;&darr;&darr;こちらもオススメ！！！&darr;&darr;&darr;&darr;</p>\r\n<p style="text-align: center;">■その他のおすすめの恋愛ストーリー</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=48">【感動する恋話】未送信のメール。</a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 1114, '<div class="textarea">\r\n<h1><img src="/uploads/love_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>泣ける恋愛ショートストーリー【わかれよう。。。。】</h1>\r\n<p>&nbsp;俺には３年付き合った彼女がいたんだけど、２年前のある日彼女が事故に遭いました。<br />(俺と会う約束をしてて青信号を急いで渡ってたら右折した車にはねられた。)<br /><br />すぐ病院に運ばれた彼女はなんとか一命をとりとめたんだけど、生きてるのが奇跡ってぐらいの大事故で、<br />下半身不随、顔面マヒ、右足切断はのがれられない状態になってしまった。<br /><br />だけど俺、馬鹿なことに彼女が事故にあったなんて全く知らなくて、<br />彼女が事故にあった日も普通に家で彼女を待ってていつまで待ってもこないし<br />電話も繋がらないからイライラしてたり心配したりしてた。<br /><br />彼女の両親に連絡したら「今は家にいて勉強してる」とか言われるし、<br />「俺もう無理なのかな？なにか怒らせたのかな？」とか<br />へこみまくる毎日を過ごしていたある日、彼女からやっと一通のメールが。<br /><br />『わかれよう』<br /><br />見た瞬間「あぁ、やっぱり」って思って涙が止まらなかった。<br />電話をしてもでないし、メール送っても返事はなかった。<br /><br />あれだけ仲よかったのに、こんな終わり方とかどぉなんだよ！<br />と毎日怒りと悲しみで荒れ狂いながら友達と失恋の痛みを癒すために朝まで飲み歩いていた。<br /><br />半年ほどたったある日彼女の妹と偶然近所のコンビニで会った。(彼女とは地元が一緒)<br />俺の姿をみてビックリする妹に俺は笑いかけながら「元気？ミキ(彼女の名前)も元気にしてる？」<br />と聞いたら、妹はうつむいて何も話そうとしませんでした。<br /><br />「どしたん？」言いながら妹の頭を撫でてやると意を決したように<br />「お姉ちゃんのことまだｽｷ？」と聞かれました。<br />「めちゃめちゃ大好きだよ～」って苦笑いした途端妹の目に涙があふれでてきて、<br />「お姉ちゃんもケイタ(俺の名前)のこと大好きなん。ケイタを会わしたいよ」って泣きながら言われました。<br /><br />テンパる俺に妹が涙目で見つめながら<br />「ケイタはどんな姿のお姉ちゃんでも好きですか？」と聞いてきた。<br />いったいどういう意味なのか&hellip;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと感動のラストが読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 2, 3, '0000-00-00', 1),
(50, 0, 14, '★☆30代推奨★☆昔遊んだファミコンカセット予想！', 'あなたが遊んだ事のあるファミコンカセットを勝手に予想します。', '10facebook_600.png', 'USER,RESULT1', '<div class="answer">\r\n<p>[USER]が遊んだファミコンカセットは</p>\r\n<p>[RESULT1]</p>\r\n</div>', '[@RESULT1@]\r\n「マリオブラザーズ」でしょう。カニにイラッと来ませんでしたか？\r\n「アイスクライマー」でしょう。２人プレイ、なつかしいですよね。\r\n「熱血高校ドッジボール部」でしょう。友達と対戦しませんでしたか？\r\n「キン肉マン マッスルタッグマッチ」でしょう。ブロッケンJr強すぎだと思いません？\r\n「ドラゴンクエスト」でしょう。ﾍﾝｼﾞｶﾞﾅｲ ﾀﾀﾞﾉｼｶﾊﾞﾈﾉﾖｳﾀﾞ。\r\n「いっき」でしょう。\r\n「スペランカー」でしょう。懐かしくありませんか？\r\n「ボンバーマン」でしょう。\r\n「高橋名人の冒険島」でしょう。1面でスケボーから岩にぶつかりませんでしたか？\r\n「スーパーマリオブラザーズ」でしょう。最初のクリボーで、死んだりしませんよね？\r\n「パックマン」でしょう。懐かしいですよね。\r\n「バルーンファイト」でしょう。1985年に一番最初に出たファミカセって、知ってました？\r\n「スパルタンX」でしょう。アチョー！！\r\n「ドラゴンボール 神龍の謎」でしょう。パンティーが…。\r\n「迷宮組曲」でしょう。最後までクリアはできなかったでしょう。\r\n「魔界村」でしょう。レッドウォーリアーで何度も死んだでしょう。\r\n「ツインビー」でしょう。ベルパワーアップの音、気持ちよくないですか？\r\n「ドラえもん」でしょう。IIコンマイクでフー！ってやりませんでした？\r\n「ロックマン」でしょう。とても面白かったでしょう。\r\n｢グラディウス｣でしょう。↑↑↓↓←→←→ABって…なんか違う？\r\n[/@RESULT1@]', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 54, '<div class="image">\r\n<h1><img src="/uploads/10contents.png" alt="alt" width="100%" /></h1>\r\n<p>あなたが遊んだ事のあるファミコンカセットを勝手に予想します！</p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #ff0000;">【次へ進む】</span>を押すと結果が見れるよ！</p>\r\n<p>&darr;</p>\r\n<p>&darr;</p>\r\n</div>', 7, 8, '0000-00-00', 1),
(51, 0, 14, '宿題が終わらなかった時の言い訳診断！', '言い訳を考えるだけなら今からでも間に合います！', '08facebook_600.png', 'USER,RESULT1', '<div class="answer">\r\n<p>先生「なんで宿題やってこなかった」</p>\r\n<p>[USER][RESULT1]</p>\r\n</div>', '[@RESULT1@]\r\n「やったんですけど家に忘れちゃって」\r\n「一応、自由研究はやったんですけど、18禁になっちゃって」\r\n「俺は休み中、村を襲うモンスターを狩って狩って狩りまくってたんですよ、そんな俺に対して言う言葉ですか？」\r\n「家が火事で宿題ごと燃えました」\r\n「犬に喰われました」\r\n「現実逃避から帰ってこれなくて」\r\n「今、日本のために自分にできることは何かと考えたら宿題なんてやってる暇ないでしょ！」\r\n「今の日本のことを考えたら、こんなちっぽけなことどうだっていいじゃいですか」\r\n「私がやりたくなるような宿題をださない先生が悪いんですよ」\r\n「私が宿題をやってる間にも世界ではどんどん命が消えていくんですよ。宿題なんかより、もっとやるべきことがあるんじゃないですか」\r\n「私に罰を与えた先生の事をPTAが学校にどう抗議し、先生がどのような処分を受けるのかが楽しみで仕方ないんです」\r\n「私のレベルに合わないからやるだけ時間の無駄だと思いまして」\r\n「私の自由研究は再生紙についてです。何が言いたいかというとプリントやノートから再生紙を作ってしまったので自由研究以外できませんでした」\r\n「私の提出した宿題は正直者にしか見えません」\r\n「私は宿題をやる暇があったら友達と遊びます。だって大人になってからもっと青春を楽しんどけばよかったって後悔したくありませんから」\r\n「紙がなくて困っている国の子どもたちのために送りました」\r\n「自分の胸に聞いてみな。思い当たることがあるはずだぜ」\r\n「失敗が人を成長させるんだよ」\r\n「宿題？何それおいしいの？」\r\n「宿題アレルギーなんです」\r\n「宿題が私にやられることを拒否したんです」\r\n「宿題が風に連れ去られました」\r\n「宿題ごときがこの私の自由な時間を妨害していいはずがない」\r\n「宿題なんかに縛られたくない」\r\n「宿題なんかやらなくたってテストで良い点をとれるってことを証明したくて」\r\n「宿題は私の心にあります」\r\n「宿題よりも大切なものを見つけてしまったからです\r\n「宿題をするのでもう一度夏休みを下さい」\r\n「宿題をするのでもう一度休みを下さい」\r\n「宿題をやらなかった時の先生の反応ってのが私の自由研究のテーマです。だから、今日中にまとめて明日提出します」\r\n「宿題をやらなくたっていいじゃない、人間だもの」\r\n「女遊びで忙しかったので」\r\n「親がやってくれなくて」\r\n「成績に関わる大事な物なので家で厳重に保管しています」\r\n「先生、それ以上はPTAに訴えますよ」\r\n「先生、どうしても分からなかったから放課後2人しかいない教室で手取り足取り教えてください★」\r\n「先生、叱るだけが教育ではないですよね」\r\n「先生、青春ってのは待ってくれないんですよ。私は宿題をやる暇があったら友達と遊びます。」\r\n「先生に御覧になっていただける程クオリティーの高いものができませんでした」\r\n「先生に怒られたくて」\r\n「先生みたいな人間が日本をダメにするんですよ」\r\n「遭難してました」\r\n「大人になってからもっと青春を楽しんどけばよかったって後悔したくないのでクラスのみんなと遊んでました」\r\n「痛い、ゴメンなさい何でもしますからそれだけは…さてと、今のを録音したんですけどこの録音テープ欲しかったら許してくれませんかね」\r\n「怒ってくれて結構ですよ。体罰も歓迎します。ただ、PTAがどう思うかは知りませんけど」\r\n「二次元から抜け出せなくて」\r\n「反抗期ですから」\r\n「夢の中でやりました」\r\n「妄想が忙しくて」\r\n「目の前に餓死しそうなヤギがいたから…」\r\n「両手両足を複雑骨折してて、あ、昨日全快しましたよ」\r\n[/@RESULT1@]', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 5, '<div class="image">\r\n<h1><img src="/uploads/08contents.png" alt="alt" width="100%" /></h1>\r\n<p>言い訳を考えるだけなら今からでも間に合います！</p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #ff0000;">【次へ進む】</span>を押すと結果が見れるよ！</p>\r\n<p>&darr;</p>\r\n<p>&darr;</p>\r\n</div>', 3, 4, '0000-00-00', 1),
(52, 0, 14, 'キスしようをあなた風につたえてみたら？診断！', 'あなたはどんな風に伝えるのでしょうか？', '11facebook_600.png', 'USER,RESULT1', '「キスしよう」を[USER]風に伝えると\r\n[RESULT1]になります。', '[@RESULT1@]\r\n「抱きついて良い…？キスして良い…？」\r\n「キ、キ、キキ…キ、ス…キスし…キスしよ///」\r\n「キスさせろぉぉぉぉぉお！！！」\r\n「欲しいなら、キ、キスしてやってもいいけど？（赤面）」\r\n「（笑顔で唇を付きだしてお尻ふりふり）」\r\n「（無言で唇を突き出す）」\r\n「黙れ小僧！お前にサンが救えるか！！」\r\n「どうしても欲しいって言うんなら仕方ないからキスしてあげてもいいけど？」\r\n「キスしてやろうか？ん？欲しいんでしょ？んん？」\r\n「ちゅうしよ？ちゅうしようよ、ねえちゅうしよ？」\r\n「（目を閉じて頬を赤らめながらじっと待つ）」\r\n「お主と接吻をしとうござる」\r\n「キス、させてください…///」\r\n「キスする？しないの？するでしょ？するよね？キスするでしょ？しないわけないよね？ね？ほらしよう？ね？」\r\n「キスして下さいでしょこのいやしい犬め！！」\r\n「100円あげるからキスさせてよ」\r\n「:( ﾞﾟ''ωﾟ''）:ウウウオオオアアアーーー！！！:( ﾞﾟ''ωﾟ''）:キスゥゥゥゥオオオアアアーーー！！！」\r\n「君の唇、凄く美味しそう…」\r\n「キスさせろオラァ！！！」\r\n「キスさせろよこの野郎！！」\r\n「さあ…キスの時間だよ…」\r\n「わたしの唇を味わうがよい！！」\r\n「バカになるまでキスしよう」\r\n「キスが嫌だというなら消えてもらう（銃を突きつけながら）」\r\n「あー…なんかキス的なアレとかしたいなあ…（ﾁﾗﾁﾗｯ）」\r\n「キース！キース！キース！うぇぇぇえええい！ｗｗｗｗｗｗｗｗｗ」\r\n「キスしたいにゃん☆」\r\n「苦しゅうない、接吻するがよいぞ」\r\n「ちゅー…しよ？///（上目遣い」\r\n「口、塞ぐよ？」\r\n「キスしてください、でしょ？」\r\n「唇に芋けんぴついてるよ☆」\r\n「あなたの唇をください」\r\n「うん、まあキスしようか！な！」\r\n「ふええ…キスしたいよぉ…」\r\n「キスしてくれないと激おこプンプン丸だお！！」\r\n「磯野ー！キスしようぜー！」\r\n「仕方ないからちゅーしてあげますよ…はぁ…」\r\n「あ、今すぐキスしないとしんじゃう病気になっちゃった！どうしよう！助けて！早く！」\r\n「唇と唇、つまりその上唇と下唇あわせて口唇と呼ばれるそれを重ね合わせる一般的にはキスと呼ばれている人間特有の愛情表現を意味する行為をしよう」\r\n「あ！キスしたいわ！」\r\n「キスミープリーズ！！」\r\n「接吻しましょう」\r\n「何かよだれが止まらないからきみの口で止めてくれない？」\r\n「あなたのキスをください」\r\n「キスしよう。それからエッチしよう」\r\n「ほら、唇を差し出しなさい」\r\n「キス、お一ついかがですか？」\r\n「ちゅっちゅしてくだちゃい！」\r\n「今キスするともれなく三万円プレゼント！！」\r\n「キスさせてくれないなら◯ぬ！！（ナイフを自分の喉に突きつけながら）」\r\n「べ、別にあなたとキスしたいなんてまったく思ってないんだからね！！」\r\n「はーい、キスのお時間ですよー」\r\n「唇、温めてあげようか？」\r\n「あー…キスしたいなあ…すっごくちゅーしたいなあ…（ﾁﾗｯ」\r\n「ぶちゅぶちゅしようぜｗｗｗｗｗｗｗｗｗｗ」\r\n「ｷｽｩ…ｵｳｩ…ｷｨｽｩ…ｵｵｵｫ…ｷｨｨｨｽｩｩｩｩ…」\r\n「ねえ…き、キ…キキ…キチュ…ちゅ…ちゅる…ちゅ…ちゅちゅ……何だよ！もういいよ！！」\r\n「お前の唇を貪り食わせてくれ」\r\n「ちゅーしまちょっ♪」\r\n「唇があなたを求めてる」\r\n「お願いします！ちゅーを！ちゅーをさせてください！！（土下座）」\r\n「あ、キスしようか」\r\n「いつキスするの？今でしょ！」\r\n「ﾄﾞｩﾌﾌｗｗｗｗｗせ、拙者接吻がしたいでござるｗｗｗｗｗｺﾎﾟｫｗｗｗｗｗﾌﾞﾌｫｗｗｗｗｗｗｗ」\r\n「舌、絡ませよう…？」\r\n「キスしたいなら、してやってもいいよ？」\r\n「今…俺のキスの雨が、君の唇に降る確率は100％だぜ…」\r\n「ちゅー、しよっか？」\r\n「キスしようよぉ…ねえ…しようよぉ…お願いだよぉ…させてよぉ…ねえ…ほらぁ…」\r\n[/@RESULT1@]', 'publish_actions', 