(53, 1, 14, '60秒で感動シリーズ～詐欺～', 'もしも大金を失ったら、あなたはどうしますか？', 'cry_fb600.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/cry_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【詐欺全文】</h1>\r\nアルゼンチンのプロゴルファー､ロベルト・デ・ビンセンツォは<br />あるトーナメントで優勝し､賞金の小切手を受け取って帰る準備をしていた｡<br /><br />彼が一人で駐車場に向かっていると､一人の女性が彼に話しかけてきた｡<br />彼女は彼の勝利をたたえた後､自分の子供は重い病気にかかって死に掛けているが、<br />お金がないために医者に見せることもできないのだと彼に伝えた。<br />それを聞いて哀れに思ったビンセンツォは<br />｢これが子供のために役立てば良いのだけど｣<br />と言って､獲得したばかりの賞金の小切手を彼女に握らせた｡<br /><br />翌週､彼がカントリークラブで食事をしているとテーブルにゴルフ協会の職員がやって来た｡<br />｢先週､駐車場にいたやつらが､君がトーナメントで勝った後､そこで若い女性に会っていたと言っていたが･･･｣<br />ビンセンツォはうなずいた｡<br />｢実は彼女は詐欺師なんだ｡病気の赤ん坊なんていないんだ｡<br />結婚すらしていないんだよ｡あなたは、だまされたんだ｣<br /><br />｢すると､死に掛けている赤ん坊なんていないのか?｣<br />｢そのとおりだ｣<br /><br />すると､ビンセンツォは笑いながらこう言った｡<br />｢そうか｡そいつは今週で一番の良い知らせだ｣<br /><br /><br /><br />彼の様なユーモアを持つ人になりたいものですね！！</div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;&darr;&darr;&darr;&darr;こちらもオススメ！！！&darr;&darr;&darr;&darr;</p>\r\n<p style="text-align: center;">■その他のおすすめの恋愛ストーリー</p>\r\n<p style="text-align: center;">自分が交通事故で歩けなくなりました。<br />あなたは恋人に相談できますか？<br />それともこっそり別れを告げますか？</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="https://demo-fblikeapi.rhcloud.com/home/question?id=30">泣ける恋愛ストーリー【わかれよう。。。。】</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">突然の彼の死。<br />彼が恋人に送れずに未送信のままになっていた大量のメールの内容とは&hellip;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="https://fb-shindan.rhcloud.com/home/question?id=29">【感動する恋話】未送信のメール。</a></p>\r\n<br />&nbsp;\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">【PR】</p>\r\n<p style="text-align: center;">お話を読んだ後は、動画を見て盛り上がりませんか？<br />2013年話題のアニメやドラマが16日間無料で見放題！</p>\r\n<p style="text-align: center;">あの【半沢直樹】や【進撃の巨人】ももちろん無料</p>\r\n<p style="text-align: center;">登録までたった3分★。</p>\r\n<p style="text-align: center;"><a href="http://h.accesstrade.net/sp/cc?rk=0100fbxv007gng">無料で動画をみる</a></p>\r\n</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 165, '<div class="textarea">\r\n<h1><img src="/uploads/cry_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【前向きになれるお話・詐欺】</h1>\r\n<p>アルゼンチンのプロゴルファー､ロベルト・デ・ビンセンツォは<br />あるトーナメントで優勝し､賞金の小切手を受け取って帰る準備をしていた｡<br /><br />彼が一人で駐車場に向かっていると､一人の女性が彼に話しかけてきた｡<br />彼女は彼の勝利をたたえた後､<br />自分の子供は重い病気にかかって死に掛けているが、<br />お金がないために医者に見せることもできないのだと彼に伝えた。</p>\r\n<p>それを聞いて哀れに思ったビンセンツォは<br />｢これが子供のために役立てば良いのだけど｣<br />と言って､獲得したばかりの賞金の小切手を彼女に握らせた｡<br /><br />翌週､彼がカントリークラブで食事をしていると<br />テーブルにゴルフ協会の職員がやって来た｡<br />｢先週､駐車場にいたやつらが､君がトーナメントで勝った後､<br />そこで若い女性に会っていたと言っていたが･･･｣<br />ビンセンツォはうなずいた｡<br />｢実は｢彼女は詐欺師なんだ｡病気の赤ん坊なんていないんだ｡<br />結婚すらしていないんだよ｡あなたは、だまされたんだ｣<br /><br />この後ビンセンツォはどんな言葉を職員に投げかけたのでしょうか&hellip;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと感動のラストが読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 1, 2, '0000-00-00', 1),
