(57, 1, 14, '60秒で感動シリーズ～阪神大震災～', '愛する人との仲を、見つめなおす機会になればと思います。', 'cry_fb600.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/cry_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【阪神大震災】</h1>\r\n1995年1月16日に戻りたい。<br />当時21の私と彩はその日ちょっとしたことで喧嘩をしてしまった。<br />明らかに私が悪い理由で。<br />普段なら隣同士で寝るのにこの日はひとつの部屋で少し離れて寝た。<br /><br />17日の朝、大きな揺れがあった。あまりに大きな揺れにあわてている間に<br />すごい音と共に屋根などが崩れてきた。<br />運良く私も彩も無事だった。しかしお互いを確認するのは声だけだった。<br />二人の間には大きな瓦礫の壁があった。<br />私は窓の近い側だったので、隣近所の方が瓦礫を少しどけてくれて、<br />自力で出ることができた。<br />私は彩を助けるために近所の方と合わせて4人で瓦礫をどけようと必死だった。<br />彩は、「真っ暗で怖いけど、私は大丈夫だから」と叫んでいた。<br /><br />1時間か2時間か、時計もなく分からなかったが、ある程度作業が進んだ。<br />これなら助かると思った。<br />しかしそのとき周りの人が「隣の家から火の手が上がっている」と言った。<br />隣の家はこちらに傾いていた。<br />危険だと周りは言った。<br />皆、ピッチを上げて作業をした。しかしそのとき、隣の家が崩れてきた。<br />私も周りも、その場から反射的に離れた。そう、見捨ててしまった。<br /><br />どのくらいその場にいたのか分からない。ずっとその場にへたり込んで座っていた。<br /><br />「消防はどうして来てくれなかったんだ」「神はどうしてこのようなことをするのか」<br />「瓦礫をどけはじめたときにもっとうまくやっていれば、助かったんじゃないのか」<br />「見捨ててしまった･････････」「どうして自分も死ななかったのか」<br /><br />こんな言葉が頭をずっとめぐっていた。<br />周りは「しょうがなかったんだ」と言った。気に病むな・・・と、、、。<br />そんなこと、できるはずがないことは周りも分かっていただろう。<br />私はその言葉を聞いてから、ずっと泣いていた。<br />後日、瓦礫の山からともこの骨だけが見つかった。<br /><br />たった1.5メートルの距離の差だった。<br />たった1.5メートルの距離の差が「1番大切な人」を失う距離だった。<br />16日に喧嘩したことが、素直でなかった私が、最も失ってはならない<br />「大切な人」を失う結果にしたのだ。<br /><br />喧嘩をしていなければ、二人とも助かったかもしれない。<br />そうでなかったとしても、彩をひとりにすることはなかった。<br />そして、見捨てることも････。<br /><br />私は1995年1月16日に戻りたい。そして君と一緒にいたい。<br /><br />阪神大震災<br />経験をしていない人にとっては分からないことだと思う。<br />しかしそれはしょうがないことだとも思う。<br />ただ、これから1月17日に阪神大震災の話題が出たときに<br />いまさら・・・、とは言ってほしくない。<br />そういったことがあったことを知っておいてほしい。<br /><br />そして今恋愛をしている人に。<br />あなたは大切な人を手放さないで下さい。<br />今すぐにでも謝れることなら、すぐに謝ってください。<br />後から後悔しても、すべて戻ってこないのですから。&nbsp;</div>\r\n<div class="textarea">\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;&darr;&darr;&darr;&darr;こちらもオススメ！！！&darr;&darr;&darr;&darr;</p>\r\n<p style="text-align: center;">■その他のおすすめのストーリー</p>\r\n<p style="text-align: center;">自分が交通事故で歩けなくなりました。<br />あなたは恋人に相談できますか？<br />それともこっそり別れを告げますか？</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="https://fb-shindan.rhcloud.com/home/question?id=49">泣ける恋愛ストーリー【わかれよう。。。。】</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">突然の彼の死。<br />彼が恋人に送れずに未送信のままになっていた大量のメールの内容とは&hellip;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="https://fb-shindan.rhcloud.com/home/question?id=48">【感動する恋話】未送信のメール。</a></p>\r\n</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 41, '<div class="textarea">\r\n<h1><img src="/uploads/cry_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【阪神大震災】</h1>\r\n1995年1月16日に戻りたい。<br />当時21の私と彩はその日ちょっとしたことで喧嘩をしてしまった。<br />明らかに私が悪い理由で。<br />普段なら隣同士で寝るのにこの日はひとつの部屋で少し離れて寝た。<br /><br />17日の朝、大きな揺れがあった。あまりに大きな揺れにあわてている間に<br />すごい音と共に屋根などが崩れてきた。<br />運良く私も彩も無事だった。しかしお互いを確認するのは声だけだった。<br />二人の間には大きな瓦礫の壁があった。<br />私は窓の近い側だったので、隣近所の方が瓦礫を少しどけてくれて、<br />自力で出ることができた。<br />私は彩を助けるために近所の方と合わせて4人で瓦礫をどけようと必死だった。<br />彩は、「真っ暗で怖いけど、私は大丈夫だから」と叫んでいた。<br /><br />1時間か2時間か、時計もなく分からなかったが、ある程度作業が進んだ。<br />これなら助かると思った。<br />しかしそのとき周りの人が「隣の家から火の手が上がっている」と言った。<br />隣の家はこちらに傾いていた。<br />危険だと周りは言った。<br />皆、ピッチを上げて作業をした。しかしそのとき、隣の家が崩れてきた。<br />私も周りも、その場から反射的に離れた。そう、見捨ててしまった。<br /><br />この後、最悪の結末が&hellip;<br /><br />\r\n<p class="textarea">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すとラストまで読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 1, 2, '0000-00-00', 1),
(58, 0, 14, '「エッチしよう」をあなた風に伝えてみたら？診断', 'あなた風にエッチに誘うとどんな風に誘うのでしょうか？男性向けに作っておりますが、女性が診断しても面白い結果になるかもしれません。※下ネタ注意', '04contentsyou_600.png', 'USER,RESULT1', '「エッチしよう」を[USER]風に伝えると「[RESULT1]」になります。', '[@RESULT1@]\r\nおパコパコいたしましょう\r\n疼いて疼いてしかたないの…お願い…しよう…？\r\n脱ぐこと風の如く、優しく囁くこと林の如し、前戯の手は火の如く、俺のアレは山の如し\r\nしようよ…頼むわ…マジで…しようや…いやマジで…マジでマジ…お願いだって…マジで…\r\nラッセラーラッセラー！ラッセラッセラッセラァ！（腰を前後に振りながら\r\n先っぽ！先っぽだけだから！！\r\nえっちな気分にな～れ☆\r\n（無言で強く抱きしめる）\r\nほら、そこに四つん這いになりなさい\r\n（黙って相手の服を脱がしはじめる）\r\n君の可愛い喘ぎ声を聞かせてベッドで汗まみれになって汁まみれになってびちゃびちゃになろう\r\nズッコンバッコンしようか\r\n全部…めちゃくちゃに…して…///\r\nあぁー！すっげえヤリたーいっ！！\r\n（無言で身体を相手に擦りつけ始める）\r\n[/@RESULT1@]', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 18, '<div class="image">\r\n<h1><img src="/uploads/04contentsuyou.png" alt="alt" width="100%" /></h1>\r\n<p>あなた風にエッチに誘うとどんな風に誘うのでしょうか？<br />男性向けに作っておりますが、女性が診断しても面白い結果になるかもしれません。<br /><span style="color: #ff0000;">※下ネタ注意</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #ff0000;">【次へ進む】</span>を押すと結果が見れるよ！</p>\r\n<p>&darr;</p>\r\n<p>&darr;</p>\r\n</div>', 2, 3, '0000-00-00', 1);
