(59, 1, 14, '【子供はみちゃダメ！！】ちょっと大人のアダルトクイズ。', '入れる前は硬いのに､出すとやわらかくなって主に紙で後始末するもの､なーんだ？', 'adult_fb.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/adult_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【問題】</h1>\r\n入れる前は硬いのに､出すとやわらかくなって<br />主に紙で後始末するもの､なーんだ？<br /><br />\r\n<h1>【答え】</h1>\r\nガム <br /><br /> <br />みんなも分かったかな？<br><br></div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 173, '<div class="textarea">\r\n<h1><img src="/uploads/adult_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【18禁】子供は見ちゃダメ！ちょっと大人のアダルトクイズ第1問！</h1>\r\n<p>煩悩が多い人にはエッチな想像をしてしまうクイズです。<br /><span style="color: #ff0000;">※下ネタ注意</span></p>\r\n<p>【問題】<br /> 入れる前は硬いのに､出すとやわらかくなって<br />主に紙で後始末するもの､なーんだ？</p>\r\n<p><span style="color: #808080;">【ヒント】</span><br /><span style="color: #808080;">口に入れます。</span><br /><span style="color: #808080;">空気を入れると膨らむタイプのものもあるアレ、ですよ！</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと問題の答えが見れるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 2, 3, '0000-00-00', 1),
(60, 1, 14, '【女子は知らないとヤバイ！？】ディアゴ系男子とは？', '知らないと騙されちゃうかも！？女子必見ネタです（笑）。', 'diagokeidanshi-fs8.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/diagokeidanshi-fs8.png" alt="alt" width="100%" /></h1>\r\n<h1><span style="color: #ff0000;">【女子は知らないとヤバイ！？】</span>ディアゴ系男子とは</h1>\r\n<p>20代で結婚を考えている女子や、アラサーアラフォーでそろそろ適齢期というオトナの女性にとって、<br />【次に付き合う男性＝結婚を考える人】という人も多いでしょう。<br /><br />そんなあなたのチェック項目。もちろんいろいろありますよね～！？<br /><br />・真面目に働いていて安定した収入がある人。<br />・とにかく、優しい人。<br />・一緒にいて安らぐ人。<br />・もちろん浮気なんて絶対しない！<br />・嘘つかない。<br />・子供大好き！<br /><br />このベースの項目があってからの、趣味嗜好の相性や体の相性など、<br />いろいろな条件が加わっていくものですよね♪♪<br /><br />でも・・・ちょっと待って！！！<br />その項目チェック、ほんとに○で大丈夫！？<br /><br />そう、世の中にはこの大事な項目チェックを免れる男子が五万といるのです！！<br /><br />その名も・・・・<br /><br />ディアゴ系男子！！！！！！<br /><br />ディアゴ系男子は、頭から足のつま先まで一晩も二晩も寝かせた<br />自家製の"優しさオーラ"でまんべんなく身を包んだ、長身痩身のイケメン男子。<br />その優しさの層は何層にも何層にもなっていて、触り心地はフワフワ。<br /><br />もう～！私そんな可愛くないってば～！<br />照れちゃうよぅ～～！<br /><br />とパンチをしたって薄い穴すらあきません。<br />たいてい何でも許してくれるし、たま～に優しさの2層目ぐらいから<br />"天然おっちょこちょいの層"が見え隠れ。<br /><br />母性本能を持ち合わせる女子にはたまらない隠し味。<br />そう、とにかく第一印象がすっごく魅力的なんです！！！<br /><br />なかなかいい人いないな～と思っている女性にとって、これぞ棚からぼたもち！<br />なんでこの人に彼女がいないの～？？と思うぐらいの男性なのに、<br />彼は雲の上ではなく、手の届くところにいます。<br /><br />ここが落とし穴！<br /><br />初回は980円です。手が届きます。特典もいっぱいついてきます。<br /><br />でも・・・・・・・・<br /><br />初回から連続して購入すると見えてくるその化けの皮・・・・。<br /><br /><br />これがディアゴ系男子！自家製優しさオーラは所詮自家製。<br />大手メーカーが開発していて、万人に対応できる賞味期限のなが～いものとは違うのです！！<br /><br />まとった優しさの層を1枚1枚丁寧にはがしていくとあら不思議！<br /><br />めんどくせぇな～。<br />何言ってるの？<br />1人でいけば？<br />なんでそんなことしないといけないの？<br />結婚？いや～ちょっと早いんじゃないかな～・・・（まだ遊びたいし～・・・）<br />え？そんなこと言ったっけ？<br /><br /><br />( ^)o(^ )えっ・・・こんな人だったっけ・・・？<br /><br /><br />結婚後に気づいては遅いのです！！<br />全国の女性のみなさん！！！ディアゴ系男子にはほんとに気をつけてください！<br />世の中に完璧な人間なんていないもの。<br />短所が最初から目につくぐらいの人がいいんです。<br />だって一生つきあっていかなきゃいけない人ですから。<br />むしろこんな完璧な人、二度と出会えない！なんて思う人はディアゴの可能性大！！！<br /><br />★ここで必見！ディアゴ男子の見分け方★<br /><br />（１）何この人完璧すぎるぅ！という人はまず怪しむ。<br /><br />（２）機会があれば、彼の親と彼のやりとりを見る機会を作る。<br />　　（ギャップがありすぎたらディアゴ系男子の可能性大）<br /><br />（３）昭和5○年生まれの人はまず怪しむ。<br />　　（独自の統計調査による為、何年生まれかは秘密）<br /><br />ベテランM先生に教わったこの見分け方を常に意識し、<br />少しの短所はあるものの、<br />根っから優しくて気の合う素敵な男性をゲットしてくださいね♪♪</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;&darr;&darr;&darr;&darr;こちらもオススメ！！！&darr;&darr;&darr;&darr;</p>\r\n<p style="text-align: center;">■60秒で泣きたいあなたにおすすめの恋愛ストーリー</p>\r\n<p style="text-align: center;"><a href="/home/question?id=48">【感動する恋話】未送信のメール。</a></p>\r\n</div>', 'publish_actions', '1390686887837500', 'https://www.facebook.com/kekkonrecipe/', '結婚レシピ', 89, '<div class="textarea">\r\n<h1><img src="/uploads/diagokeidanshi-fs8.png" alt="alt" width="100%" /></h1>\r\n<h1><span style="color: #ff0000;">【女子は知らないとヤバイ！？】</span>ディアゴ系男子とは？</h1>\r\n初回はDVDが4枚と付録もついて980円！<br />といったキャッチフレーズでお馴染みのディアゴスティーニ。<br /><br />初回のインパクトや、お得感は大大大!!!<br />何故か次回号がすごく楽しみ♪になってしまう雑誌で、<br />CMを見る度にほしくなってしまうあの魅力は一体何！？<br /><br />でもでも、継続して買っていくと<br />その魅力は徐々に減っていってしまったりしますよね。<br /><br />そんなディアゴスティーニを想像させる、<br />巷で話題のディアゴ系男子って一体・・・！？<br /><br />真剣な恋愛を考える女子、次の獲物はあなたかも！？！？<br /><br /><br />&hellip;ってディアゴ系男子って何？？？<br />&nbsp;\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すとディアゴ系男子の解説が読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 4, 5, '0000-00-00', 1),
