(62, 1, 14, '《長編》2chで話題になったゲーセンで出会った彼女の話【1/8】', '最後はハンカチ必須！！長編恋愛ストーリー。', 'love_fb600.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/love_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【1/8】</h1>\r\nLOVの人口的にも、ｹﾞｰｾﾝでなかなか女性ﾌﾟﾚｲﾔｰに出会うことはないから、<br />ちょっと驚きつつも、<br />「まあ別におかしいことはないよな」って思いつつ俺はｹﾞｰﾑを続けていた。<br /><br />自分のｹﾞｰﾑが一段落すると、俺は隣の女の子の方を見てみた。<br />ｷｬｽｹｯﾄ帽？っていうのかな、を深々かぶってて顔はよく見えなかった。<br />俺は「面白い子だなｰ」なんて思った。<br />そして、こういうとこで趣味の合う子とか身近でいたらいいだろうに&hellip;<br />と半ば妄想していた。<br /><br />しかし、彼女は負けると独り言を言い出した。<br />「今のはだめかｰ&hellip;」「う～んなんでだろう」<br />はたから見るとちょっと変な人なんだけど、俺はなんだか彼女のことが気になりだした。<br />どういう気持ちで俺がそうなったのかは分からないが&hellip;<br /><br />俺も最初は「まわりに聞こえるくらい独り言とか&hellip;ちょっとな&hellip;」<br />って思って印象は最悪だった。けどなんか気になった。<br />そうすると彼女は早々とLOVから引き上げてｽｰﾊﾟｰｽﾄﾘｰﾄﾌｧｲﾀｰ４をやりに行ったので<br />俺は気になりついていって彼女の試合を観戦してみる事にした<br /><br />彼女のｽﾍﾟｯｸはすぐ分かるからちょい待ち<br />そうすると、彼女その時使ったｷｬﾗはさくら。<br />そしてなかなかに強い。PP3000くらいはありそう。<br />なんだろ、このへん知らない人は分かり辛いかもしれないけど、<br />普通に俺より遙かに上手かったんだよね。<br />俺は驚いて、「ほぉｰ&hellip;」と思ってじっと対戦する彼女を見つめていた。<br /><br />俺も見ていたせいか、数人の人だかりができて、彼女がｺﾝﾎﾞを決めると<br />「お、おお&hellip;」みたいなしょぼい歓声みたいのがあがるようになってたｗ<br />なんだろ、その時の彼女はすごく輝いて見えていたよ。<br />でも彼女はこのあと予想外の行動をとるんだよね&hellip;<br /><br />さっき俺をﾎﾞｺﾎﾞｺにしたであろう、猛者ﾌﾟﾚｲﾔｰと彼女が当たって、<br />彼女なら勝てるかも&hellip;と思ったけど負けちゃったんだよ。<br />けっこう惜しかったんだけど。<br />俺も「あｰ残念&hellip;」くらいに思って見てたんだけど<br />彼女は顔を真っ赤にして明らかに泣いてたんだよね。<br />声はｹﾞｰｾﾝだから聞こえないけど。<br />俺は唖然とした。<br /><br />彼女はこの時ｷｬｽｹｯﾄ帽をとったんだけど、ｼｮｰﾄﾍｱで顔真っ赤。<br />明らかに泣いた状態で店外の喫煙所とかありそうな方向に出ていったから<br />俺もなぜか無心で追いかけていた。<br />なんで追いかけてしまったのかが謎なんだけど。<br /><br />店の端の割と静かな喫煙所っぽいところに彼女はいた。<br />目を真っ赤にしていた。<br />というか、ｷｬｽｹｯﾄ帽かぶり直してたけど、顔が好みで困った。<br />多分一般的には可愛いって言われないﾀｲﾌﾟだと思うけど、俺はﾄﾞｷっとした。<br />俺は喫煙者だし、煙草を吸うふりをして、彼女に話しかけようと思った。<br />さっきは、惜しかったですね&hellip;。<br /><br />ふてくされてるかと思ったが、そんなことはなかった。<br />にっこり笑うと、<br />「あぁ、見てたんですか、恥ずかしいです。わたしああいうとこだとつい必死になっちゃって&hellip;」<br />と笑いながら話してくれたのには驚いた。<br />恐らく、ｹﾞｰｾﾝにいるって段階で、初対面の会話の壁ってのが数段なくなってるんだと思う。<br />お互いにｹﾞｰﾑ好きだと分かってるし、ここで自然な会話が生まれたのはｹﾞｰｾﾝだったからだと思う。<br /><br />そうすると彼女は面白そうに、<br />「煙草一本くれません？」と言ってきた。<br />俺「え、あ、吸うんですか？」<br />「吸わないけど、なんか見てたら&hellip;なんか」<br />この時点で薄々分かってたんだけど、彼女は天然か変な人かよくﾜｶﾗﾝ人のいずれかだったｗ<br /><br />しかし俺はといえば、大学生活ｻｰｸﾙなし、青春なし、家に帰れば絵かきに身を費やす<br />という生活を送っていたため、女の子と話すこと事態稀も稀で、舞い上がってた。<br />俺「じゃ、吸います？ｗｷｬｽﾀｰってんですけど&hellip;ちょっと甘いかもですｗ」<br />「ありがとございます～！<br />すぅぅ&hellip;ｺﾞﾎ！ｹﾞﾎ！なにこれ苦しい&hellip;」<br />案の定涙目になっていた。<br />よろしくないことではあるが、俺はもうその時、<br />なんなんだこの人すごく面白いし可愛いって気持ちに取り憑かれていた。<br /><br />煙草が初めてってことは&hellip;そんなに悪いかんじの子ではない。<br />まあ見た目からしてそうではあったが。<br />あと、なんか知らないけどやたらと笑う。<br />そこで数分格ｹﾞｰ談義をしていたんだけど、すごく笑うんだ。<br />女の子ってこんなに笑うの？というか笑った女の子ってすごい。<br />そもそもこんな誰とも話せたことのない格ｹﾞｰの話を、<br />今ここで、初対面の女性としているということが一番信じられなかった。<br /><br />なんだかすごい打ち解けてしまって、あの喫煙所で一体何分話したろう。<br />そうなってくると、男としては「連絡先知りたい」<br />という欲望が出てきしまう。<br />２０～３０分話した時くらいだったか<br />趣味の話になってて俺が言ったんだよ。<br />「ちょっとね、ｲﾗｽﾄを描くのが好きで&hellip;」<br />ｹﾞｰｾﾝにいた子だし、こういうことにもちょっとは興味を示してくれるんじゃないか<br />なんて淡い想いもあったわけだが&hellip;<br />「ｲﾗｽﾄ？」<br />笑顔いっぱいだった女の子が急に、すごく暗い顔になった。<br />「ま&hellip;その話はいいよ&hellip;」<br />「それじゃ、また&hellip;ｹﾞｰｾﾝで会えたらいいね&hellip;<br /><br />予想外だった。連絡先どころか、ほぼ喧嘩別れｸﾗｽの雰囲気の悪さで別れてしまった。<br />ｲﾗｽﾄ、ちょっとくらいはﾃﾝｼｮﾝ上って話が膨らむかなと思ったんだけど&hellip;<br />もしかしたら、そういうのが嫌いな人だったのかもしれない、<br />そう思って俺は落胆した。<br />「一体あの子は何だったんだろう&hellip;？」<br />ｷｬｽｹｯﾄ帽が似合ってたのは覚えてる。でもそんな風貌でｹﾞｰｾﾝ来るなんて&hellip;<br />俺はすごい気になった。<br /><br />いかんせん、俺が人間として少しでも甲斐性を見せるにはｲﾗｽﾄしかなかった。<br />だって、それしかしてなかった&hellip;<br />それから数日経って、俺は再びｹﾞｰｾﾝを訪れた。<br />彼女はまた居た。<br />その日はLOVをやっていた。その日はなぜかﾍﾞﾚｰ帽。<br />でもそれも似合っていて、可愛かった。<br />相変わらず不思議な人だなあ&hellip;と思いつつ<br />俺もおもむろに近くでLOVをﾌﾟﾚｲし始めた。<br /><br />この時、様々な疑問が浮かぶ。<br />今日は平日だぞ。<br />俺は講義半日だからいるが。<br />彼女はなんなんだ？<br />大学生？ﾌﾘｰﾀｰ？<br />同い年くらいに見えるけど&hellip;<br />というか名前も知らないし。<br />悶々として、ｹﾞｰﾑに集中できない。<br /><br />LOVの彼女の称号ﾚﾍﾞﾙをﾁﾗ見する。<br />やはり、俺よりやりこんでいる。<br />そして勝率も高い。明らかに俺より上級ﾌﾟﾚｰﾔｰ。<br />そして勝つと、<br />「やったね～！」と声を上げる。<br />相変わらずの奇人っぷりを発揮していらっしゃる。<br /><br />ｹﾞｰﾑが終わったところで、俺は肩を叩いて、ども、と会釈する。<br />「あ、来てたんだね～。ｼﾞｭｰｽ買おうぜ～」<br />などと言い出す。もはやｷｬﾗが分からない。<br />馴れ馴れしいし、<br />本当に素の時は変な人なんだ。なんなんだこの人。<br />ますます気になる。<br /><br />自販機前で、俺「あ&hellip;この前はなんか&hellip;すいませんでした」<br />すると彼女は何が？ときょとんとした顔になった。<br />俺「ほら&hellip;ｲﾗｽﾄとか言ったら&hellip;」<br />彼女「あ～、あのことはね、ちょっと&hellip;」<br />彼女「私もね～描いてたんだよ、ついこないだまでね！」<br />俺「絵を描くの好きなんですか？」俺がﾃﾝｼｮﾝ上げて言うと、<br />にっこり笑って、「好きだったんだよ。今は描いてない。」<br />俺「どうして&hellip;ですか？ってかｱﾅﾀって今日も平日ですけど&hellip;<br />大学生さんとか&hellip;ですか？」<br />彼女「ちょっと違うかな」<br /><br />彼女「わたしは美大だよ、だから大学生だけど、今はなんというか&hellip;」<br />俺「ええ！美大って&hellip;すごいですね&hellip;雲の上の人だ&hellip;」<br />彼女「&hellip;今は思い出を見に来てるというか」<br />俺「はい？」<br />彼女「ここっていい所でしょ」<br />俺「ｹﾞｰｾﾝに&hellip;ですか？思い出？；」<br /><br />彼女は次第に俺が年下だと気付いて、口調は変わっていた。<br />俺「え、そりゃどういう&hellip;」<br />彼女「ま、さ！」<br />いきなり大声を出す。<br />彼女「一回で知りたいこと全部知れるほど、簡単じゃないよ～」<br />といってｹﾞｰﾑにもどろうとする。<br />俺「え、そんな&hellip;また次もｹﾞｰｾﾝに来てくれますよね！？」<br />彼女「くるくる～まだ浸りたいから」<br />彼女の言葉はひっかかることだらけだった。<br />思い出？<br />その時の俺にはまったく理解ができなかった。<br />そして美大生。ますます俺は彼女の虜になてしまった。<br /><br />自分にない何かを持ってる人。<br />よく分からなくて、自分を振り回す人。<br />きっと俺はそういう人に弱かったんだ。<br />もともと大好きで通っていたｹﾞｰｾﾝ、それからは毎日違うときめきと<br />一緒に通うことになる。<br />今日はいるか？明日はいるか？<br />もちろんいつも会えることはなく、会えない日のほうが多かった。<br />もしかしたらもう２度と会えないんじゃないか&hellip;<br />そんな風に思うこともあった。<br /><br />何日か通っていると、彼女は再びｹﾞｰｾﾝに現れた。<br />またﾍﾞﾚｰ帽を被ってたんだけど、いつもと様子が違った。<br />服が作業着っぽいのか、ｲﾝｸやｱｸﾘﾙがついてて、<br />靴にいたっては絵の具だらけに汚れていた。<br />LOVをする手も、絵の具で汚れているようだった。<br /><br />俺はもうときめいちゃって、ﾜｸﾜｸして話しかけた。<br />「こんにちは～」<br />彼女「うん&hellip;」<br />いやにﾃﾝｼｮﾝが低かった。<br />明らかに何かあったかんじではあった。<br />でもまあいつも変な感じではあるんだけど、その日はなんか、落ち込んでいた。<br /><br />ｹﾞｰﾑに負けても独り言言わない。<br />ただ黙ってひたすら&hellip;<br />その横顔が自分とは違うちょっと大人に見えた。<br />俺「一戦終わったら、休憩しませんか？ね。」<br />彼女「そ、そのとおりであるね～」<br />やはり変ではあるが。<br /><br />俺「今日は大学で絵でも描いてきたんですか？」<br />彼女「いや&hellip;大学はもう卒業間近だし、関係ないね～」<br />俺「あ、そういえば美大って&hellip;！どこに就職するんですか？」<br />おれは無邪気な期待で聞いただけだった。<br />彼女「&hellip;&hellip;。」<br /><br />彼女「就職はね&hellip;ちっちゃいﾃﾞｻﾞｲﾝ会社で&hellip;」<br />俺「うわ、ﾃﾞｻﾞｲﾅｰじゃないですか&hellip;！すごいですね！」<br />彼女は笑った。<br />彼女「ありがとう～そんな風に言ってくれるのは君だけだな。」<br />彼女「でもなぁ、もどりたいなあ。君くらいの時に」<br />俺「どうしたんですか？何か夢があったんですか&hellip;？」<br />今思えば、ずけずけと聞きすぎだった。<br />彼女は泣いてしまっていた。<br />彼女「辛いなあ&hellip;君といると。名前なんてんだっけ？」<br />俺「富澤です&hellip;。」（仮名、ｻﾝﾄﾞｳｨｯﾁﾏﾝに似てるので）<br />彼女「そっか、わたしは吹石っていうんだ&hellip;」（吹石一恵に似てるので）<br /><br />彼女「君は絵が好きなの？」<br />俺「好きです&hellip;下手ですがそればっかやってます&hellip;」<br />彼女「あははは、そうなんだ。」<br />そうするとまた泣いてしまって、<br />彼女「ごめんね&hellip;もうｹﾞｰｾﾝにも来れないかも。」<br />そう言って夜の街に飛び出していった。<br /><br />彼女はｹﾞｰｾﾝを出ていった。<br />俺は混乱した。何か悪いこと言ったのか？<br />もう何がなんだか分からなくなってた。<br />無心で追いかけた。<br />「待ってください！どうしたんですか！？\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<br />\r\n<div class="textarea"><a href="/index.php/home/question?id=67">■第２話はコチラ</a></div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;&darr;こちらもオススメ！！！&darr;&darr;&darr;&darr;</p>\r\n<p style="text-align: center;">■その他のおすすめの恋愛ストーリー</p>\r\n<p style="text-align: center;">自分が交通事故で歩けなくなりました。<br />あなたは恋人に相談できますか？<br />それともこっそり別れを告げますか？</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=49">泣ける恋愛ストーリー【わかれよう。。。。】</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">突然の彼の死。<br />彼が恋人に送れずに未送信のままになっていた大量のメールの内容とは&hellip;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=48">【感動する恋話】未送信のメール。</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 330, '<div class="textarea">\r\n<h1><img src="/uploads/love_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【1/8】</h1>\r\n俺、大学生、さえない男<br />たまの休みや講義の空きにｹﾞｰｾﾝに行って格ｹﾞｰをやるのが好きだった<br />そこであった話を、ちょっと書かせて欲しい<br /><br />俺はといえば、大のｹﾞｰｾﾝ好きだった。<br />格ｹﾞｰにｶｰﾄﾞｹﾞｰに音ｹﾞ、割となんでもやってた。<br />というより、そのｹﾞｰｾﾝ独特の雰囲気が大好きだったんだ。<br /><br />俺は趣味といえば絵を描くくらいで、大学でもなんのｻｰｸﾙにも入っていない。<br />だから学部に何人か友人はいれど、基本休みはひとり。<br />だからこそｹﾞｰｾﾝに惚れ込んでた。<br />ｹﾞｰﾑをしてれば顔なじみはできるし、言葉は悪いけど、ｹﾞｰｾﾝに行くと<br />「あ。俺みたいなﾀﾞﾒな人はたくさんいるんだ&hellip;」てきな居心地の良さがあった。<br /><br />基本、ｹﾞｰｾﾝで顔見知り程度の知り合いができるのは珍しいことではない。<br />毎回同じとこに行って同じようなｹﾞｰﾑをやっていれば、顔を覚える。<br />ｹﾞｰｾﾝでできた友達ってのも何人かいた。<br />ｹﾞｰｾﾝってのは多分皆が考えてるよりは健全で、いい場所だと思う。<br /><br />俺はその日も講義が半日だったので、午後から意気揚々といつもどおりｹﾞｰｾﾝに向かったんだ。<br />あのﾜｸﾜｸ感がいい。<br />今日は何すっかなｰなんて迷いつつ俺はｽｰﾊﾟｰｽﾄﾘｰﾄﾌｧｲﾀｰ４を始めた。<br />平日とは言え、たまたま猛者が一人いて負けがこんでｲﾗｲﾗした。<br /><br />その日は、もうｽﾊﾟ４はいっか&hellip;ってなって、ﾌﾞﾚｲﾌﾞﾙｰかLoVをやろうと思った。<br />LoVってのは、ｽｸｴﾆのｱｰｹｰﾄﾞのｶｰﾄﾞｹﾞｰﾑでﾊﾏるとなかなか面白い。<br />でも金がかさむからあまりやらないんだけど、その日はやろうって決めた。<br />俺は筐体に座って、しばらくそのｹﾞｰﾑのﾌﾟﾚｲに興じていた。<br /><br />珍しく勝ちが続いた。そんなに得意なｹﾞｰﾑじゃないんだが。<br />すると、俺の隣の筐体に女の子が座った。<br /><br />\r\n<p>彼の隣に座った女の子はどんな女の子なのでしょうか&hellip;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと気になる続きが読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 3, 4, '0000-00-00', 1),
(63, 1, 14, '【誕生日】2/4日生まれの人だーれだ！！', '2/4生まれの有名人を紹介！知ってる人はいるかな？', 'birth_fb.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/birth_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【誕生日】2/4日生まれの人だーれだ！！</h1>\r\n1553年（天文22年1月22日） - 毛利輝元、戦国大名<br />1677年 - ヨハン・ルートヴィヒ・バッハ、 作曲家<br />1944年 - 黒沢年雄、俳優<br />1953年 - 山下達郎、シンガーソングライター<br />1954年 - 千葉繁、声優、音響監督<br />1957年 - 石破茂、農林水産大臣、防衛大臣、自由民主党衆議院議員<br />1958年 - 時任三郎、俳優<br />1958年 - 東野圭吾、小説家<br />1958年 - 長澤和明、サッカー選手・指導者、長澤まさみの父<br />1958年 - 中西康晴、キーボーディスト、作曲家、編曲家、音楽プロデューサー<br />1964年 - 石原真理子、女優<br />1965年 - 森浩之、元プロ野球選手<br />1965年 - 中島恵利華、プロゴルファー<br />1966年 - 小泉今日子、歌手、女優<br />1967年 - KYO、ミュージシャン<br />1968年 - 佐々木蔵之介、俳優<br />1970年 - 吉原知子、元バレーボール選手<br />1979年 - 山崎静代、お笑い芸人（南海キャンディーズのしずちゃん）<br />1980年 - 桐谷健太、俳優<br />1980年 - 矢吹健太朗、漫画家<br />1990年 - 戸松遥、声優<br />1991年 - 大政絢、女優<br />他、たくさんの皆様、誕生日おめでとうございます！<br />誕生日を知っている有名人は居たかな？<br /><br />今日誕生日の友達が居たら、おめでとうを言ってあげてね！</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 2, '<div class="textarea">\r\n<h1><img src="/uploads/birth_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【誕生日】2/4日生まれの人だーれだ！！</h1>\r\nヒントはあまちゃんに出ていた永遠のアイドルのあの人や<br />クリスマスと言えばこの人！まで多数いらっしゃいます！<br />一人でも分かる人はいるかな？<br />&nbsp;\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと２月４日生まれの有名人がわかるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 2, 2, '0000-00-00', 0),
