age">将来の結婚相手の学歴や年収などの特徴を占います。</div>\r\n<div class="image">占いする時間帯によっても結果が変わります。<br />&nbsp;\r\n<p><span style="color: #ff0000;">【次へ進む】</span>を押すと結果が見れるよ！</p>\r\n<p>&darr;</p>\r\n<p>&darr;</p>\r\n</div>', 3, 4, '0000-00-00', 1),
(65, 1, 14, '60秒で感動シリーズ～母の玉子焼き～', '親孝行の大切さを教えてくれる話です。', 'cry_fb600.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/cry_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【母の玉子焼き】</h1>\r\n母は私の知らない病気だった。<br />お母さんの遺品を整理していたら、日記が出てきた。<br />中を見ると弁当のことばかり書いていた。<br />｢手の震えが止まらず上手く卵が焼けない｣ <br />日記はあの日で終わっていた。<br />後悔で涙がこぼれた。<br /><br />親孝行は亡くなってからではできない。<br /><br />これから母の墓参りに行ってきます。&nbsp;</div>\r\n<div class="textarea">\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;&darr;&darr;&darr;&darr;こちらもオススメ！！！&darr;&darr;&darr;&darr;</p>\r\n<p style="text-align: center;">■その他のおすすめの恋愛ストーリー</p>\r\n<p style="text-align: center;">自分が交通事故で歩けなくなりました。<br />あなたは恋人に相談できますか？<br />それともこっそり別れを告げますか？</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="question?id=49">泣ける恋愛ストーリー【わかれよう。。。。】</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">突然の彼の死。<br />彼が恋人に送れずに未送信のままになっていた大量のメールの内容とは&hellip;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="question?id=48">【感動する恋話】未送信のメール。</a></p>\r\n<br /><br class="textarea" /></div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 108, '<div class="textarea">\r\n<h1><img src="/uploads/cry_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【母の玉子焼き】</h1>\r\n私のお母さんは昔から体が弱くて、それが理由かは分からないんだけど、<br />お母さんの作る弁当はお世辞にも華やかとは言えないほど質素で<br />見映えの悪い物ばかりだった。<br /><br />友達に見られるのが恥ずかしくて、毎日学食でパンを買って、<br />お弁当はゴミ箱へ捨ててたの。<br />ある朝お母さんが嬉しそうに<br />｢今日はふみえの大好きな海老入れといたよ｣と私に言ってきた。<br />私は生返事でそのまま学校へ行き、こっそり中身を確認した。<br />すると確かに海老が入っていたんだけど、<br />殻剥きもめちゃくちゃだし、彩りも悪いし、<br />とても食べられなかった。<br /><br />家に帰るとお母さんは私に｢今日の弁当美味しかった？｣としつこく尋ねてきた。<br />私はその時イライラしてて、<br />いい加減お母さんの弁当に対する鬱憤も溜っていたので<br />｢うるさいな！あんな汚い弁当捨てたよ！もう作らなくていいから｣<br />とついきつく言ってしまった。<br /><br />お母さんは悲しそうに｢気付かなくてごめんね&hellip;｣<br />と言いそれから弁当を作らなくなった。<br />それから半年後、お母さんは死んだ。。。\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと悲しみのラストが読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 4, 5, '0000-00-00', 1),
(66, 0, 14, 'あなたのあるある診断！', 'あなたに潜む4つのあるあるをズバリ言い当てます！当たる確率50%以上！', 'aruaru.png', 'USER,RESULT1,RESULT2,RESULT3,RESULT4', '<div class="answer">\r\n<p>【[USER]】さんのあるある</p>\r\n<p>・[RESULT1]</p>\r\n<p>・[RESULT2]</p>\r\n<p>・[RESULT3]</p>\r\n<p>・[RESULT4]</p>\r\n</div>', '[@RESULT1@]\r\n横断歩道の白い部分を踏んで歩く\r\n校歌斉唱は口パク\r\nひとりの時間がないとしんじゃう\r\n気になる人の声に無意識に反応\r\n遊ぶ直前にダルくなる\r\nお風呂の椅子はお湯をかけてから座る\r\n手につくスナック菓子は箸や楊枝で食べる\r\n夢に出てきた相手が急に気になりだして頭から離れない\r\n感情が態度と顔に出やすい\r\nデート中普段と立つ位置が逆だと超違和感\r\nメールの返信が遅いと不安になって送信メールを確認する\r\n些細な事で不安になる\r\n仲が良すぎる男同士を見るとホモだと勘ぐる\r\n急に冷めてどうでも良くなる\r\n好きになった人をネットで検索する\r\n[/@RESULT1@]\r\n[@RESULT2@]\r\nどこから来るか分からない変な自信がある\r\nカラオケで歌ってる時に店員が入ってくる\r\n誰かに見られてると思って意識して歩く\r\n手で切れない袋は歯で噛み切る\r\n洗顔フォームと歯磨き粉を間違える\r\nアイスのフタの裏をなめる\r\nレンジで温める時、目安よりも少し長めにチンしてしまう\r\nマラソン大会でゆっくり走る宣言をする\r\n気になる相手と仲良くなる妄想して月日が流れていく\r\nやろうと思いながらなかなかやらない\r\nみんなの動きを見て自分の行動を決める\r\n勉強したのに全然してないって言う\r\n結構適当に返事をする\r\n歩道のタイルの模様や色やラインに沿って歩いてしまう\r\n綺麗好きと見られてるけど部屋は汚い\r\n[/@RESULT2@]\r\n[@RESULT3@]\r\n時間や約束は律儀に守る\r\n停止中のエスカレーターが歩きにくい\r\nマークテストで同じ番号が続くと超不安\r\nポテチ食べた後に指を舐める\r\n美容師さんとの会話を考えると少し気が重い\r\nだいたい目を見て話さない\r\n気になる人に素っ気ない態度をとる\r\n友達は好きだけど時々めんどくさくなる\r\nスーパーで弁当や惣菜に値引きシールが貼られるのを待つ\r\n内心傷ついてるが平常心を装う\r\nお菓子を食べてる時これで最後と思いながら結局全部食べる\r\n先のことを考えすぎて具合が悪くなる\r\nドロップでハッカ味が出たら入れ物に戻す\r\nお年寄りや妊婦さんに席を譲るタイミングを逃して気まずい\r\n人をよけようとしたら、同じ方向によけてきまずい\r\n[/@RESULT3@]\r\n[@RESULT4@]\r\n気になる異性が声をかけてくれないかなと勝手に期待をする\r\nシャンプーの詰め替えパックがぬるぬる滑って千切れない\r\nカップラーメンにお湯を入れてる途中でポットが空になる\r\nキャラメルコーンを食べるとピーナッツが大量に残る\r\nメールに絵文字や顔文字が入ってないと何となく寂しい\r\n周りから変態だと思われている\r\nケーキのイチゴがなかなか食べれない\r\nバイキングで色々な種類をよそったものの食べきれずに余る\r\n大雑把なくせに心配性\r\n好きな人と二人っきりになった場面を妄想\r\n気になってる相手にメールを送った直後に後悔する\r\nポッキーやプリッツをリスみたいに食べる\r\nトンガリコーンを指にはめる\r\nマックで悩んだ挙句結局いつものメニューを注文する\r\nトイレットペーパーを三角に折る\r\n[/@RESULT4@]', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 26, '<div class="image">\r\n<h1><img src="/uploads/aruaru.png" alt="alt" width="100%" /></h1>\r\n<p>あなたのあるある診断！！</p>\r\n<p>あなたに潜む4つのあるあるをズバリ言い当てます！当たる確率50%以上！</p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #ff0000;">【次へ進む】</span>を押すと結果が見れるよ！</p>\r\n<p>&darr;</p>\r\n<p>&darr;</p>\r\n</div>', 6, 7, '0000-00-00', 1);
INSERT INTO `questions` (`id`, `app_type`, `app_id`, `title`, `description`, `image`, `scenario`, `contents`, `anwser_result`, `permissions`, `fb_page_id`, `fb_page_url`, `fb_page_title`, `count`, `intro`, `count_today`, `count_month`, `count_day`, `is_publish`) VALUES
(67, 1, 14, '《長編》2chで話題になったゲーセンで出会った彼女の話【2/8】', '最後はハンカチ必須！！長編恋愛ストーリー。', 'love_fb600.png', '', '', '<p><img src="/uploads/love_cont.png" alt="alt" width="100%" /></p>\r\n<div class="textarea">\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【2/8】</h1>\r\n<a href="/index.php/home/question?id=62">■第１話はコチラ</a>\r\n<div class="textarea" style="text-align: left;"><br />駅に向かって、黙って切符を買う。<br /><br />「JRって高いのかな？」<br /><br />などと彼女は言っていた気がする。<br />ﾎｰﾑで電車を待ってた。時間帯もあって、駅はなかなかの雑踏だった。<br />無言で過ごす。さっきまで泣いていたのに、彼女は思ったよりｹﾛｯとしていた。<br />俺はよく分からない展開に動揺して、緊張して、足が震えてたかもしれない。<br />彼女の方を見ると、笑ってVｻｲﾝをしたりしておどける。<br /><br />俺「なんなんですかｿﾚ」<br />彼女「わからんなｗ」<br /><br />この道中も、彼女は決して自分のことを語ろうとはしなかった。<br />俺がひたすら話していた気がする。<br /><br />「美大生なんて本当に憧れる」とか「絵が好きで上手くなりたい」とか<br /><br />俺が終始しゃべっていた。<br />そのたびにﾆｺﾆｺするだけで、それがなんだか可愛く見えた。<br />でもなぜ泣いてしまったのか、そのことには触れられなかった。<br />画材屋に着く。<br />すると彼女は途端にﾃﾝｼｮﾝが上がって、<br />あ～どうしよう張りｷｬﾝ買ってこうかな～あでも筆も&hellip;<br />などと顔をｷﾗｷﾗさせて俺を連れ回して買い物を始めた。<br />俺はﾘﾗｯｸｽしている彼女になら何か聞いても大丈夫だと踏んだ。<br /><br />俺「楽しそうですね。」<br />彼女「ここ来るとやっぱね～ﾃﾝｼｮﾝ上がるよ。」<br />俺「でもこの前、もう絵描いてないって言ってませんでしたっけ&hellip;？」<br />彼女「いや、それはね&hellip;」<br />俺「気を悪くしたらごめんなさい&hellip;でもなにか知りたくて。<br />今日もいきなり泣かれてしまって&hellip;」<br /><br />俺はもう彼女のことで頭が一杯だったから、知りたかった。<br />そして少しでも彼女の力になりたいと思っていた。<br /><br />俺「なんで、いつもｹﾞｰｾﾝに来てるんですか？なにか思い入れが？」<br />彼女「思い出があるんだよ、だから」<br /><br />分からない。<br />もう分からないことだらけだった。<br />一体なんなんだろうこの人は。<br />そもそもただでさえこんな女の子がいつも一人でｹﾞｰｾﾝに<br />来ていること自体不思議で仕方なかった。<br /><br />俺「思い出って&hellip;なんなんですか？」<br />彼女「わたしの絵、見る？」<br /><br />そういえば見たことなかった。<br />俺はそこで彼女のｹｰﾀｲから彼女の絵を見せてもらった。<br />そこにはﾎﾟｯﾌﾟﾝやら音ｹﾞのｷｬﾗｸﾀ、あるいは格ｹﾞｰｷｬﾗｸﾀの絵があった。<br />とても可愛らしい絵柄で、おれは素直にいいなあ、と思った。<br />絵柄的には誰だろう&hellip;chancoさん辺りに近かったと思う。<br /><br />俺「わああ！すごい上手いですね！」<br />彼女は満面の笑みになった。<br />彼女「ありがとう。」<br />彼女「私はただ本当にｱｰｹｰﾄﾞのｹﾞｰﾑが大好きなだけ。」<br /><br />しかしそれでもまだ合点がいかないことだらけだった。<br />なんで泣いていたのかがどうしても気になった。<br /><br />俺「でも、本当に上手いですね。大好きな絵柄です！」<br />俺「やっぱりそっち関係を本当は目指していたんですか？」<br />彼女「ま&hellip;ね」<br />俺「そうなんですか&hellip;でもこれだけ上手かったらきっとまたﾁｬﾝｽありますよ！<br />俺は絶対応援しますよ！」<br />彼女「いや、もうそういうのは描かないって決めたことだから」<br />俺「？　どうしてですか？」<br />彼女「君は若くて、絵が大好きで、きっといい子なんだろうね。」<br />俺「え、はい、あの&hellip;」<br />彼女「ﾀﾞﾒなんだよ、気安くそう優しい事言っちゃ。」<br /><br />いつになく真剣な顔になったので、怖かった。<br />目が真っ赤になっていた。<br /><br />彼女「君はﾀﾞﾒだ&hellip;。ﾀﾞﾒﾀﾞﾒだ。」<br /><br />ﾀﾞﾒﾀﾞﾒって言われたのが妙に覚えている。<br /><br />彼女「じゃあね、今日はここまでで。付き合ってくれてありがとう。」<br /><br />帰り際にｺﾋﾟｯｸﾏﾙﾁﾗｲﾅｰを俺に手渡して、そそくさと去っていった。<br />俺は呆然として、追いかけることもできなかった。<br />何も分からなかった。<br />俺は完全に彼女にすべてを持っていかれてしまった。<br />しばらくﾒｼもろくに食えなくなって、もらったﾏﾙﾁﾗｲﾅｰで<br />落書きとかしてた。<br />寝ても覚めても完全に彼女のことしか思い浮かばなくなっていた。<br />でも連絡先すら知らなかった。<br />もはやｹﾞｰｾﾝに行くということだけが、<br />彼女と俺を繋ぎとめる唯一の方法だった。<br /><br />俺は悶々としながらｹﾞｰｾﾝに通い続けた。<br />あの調子じゃ、次会っても何を話したらいいか分からない。<br />俺がいつものように学校帰りにｹﾞｰｾﾝに行くと、彼女はいた。<br />LOVの筐体に座っている。<br />肩を叩いて、会釈する。<br /><br />彼女「あ、きた～！ねえねえﾛｰｶﾙ対戦しよｰよ！」<br />彼女は会うなりｹﾞｰﾑに誘ってきた。<br /><br />ｹﾞｰｾﾝありがたい。ｹﾞｰﾑを介せば彼女の機嫌も良いみたいだった。<br />ｹﾞｰｾﾝというものが、俺らの仲をつなぎ止めてくれている。<br />そんな風に感じた。<br />ひと通りｹﾞｰﾑをして、喫煙所OR自販機に行って格ｹﾞｰ談義して、<br />楽しかった。<br />楽しくて気が合うからこそ、俺は彼女のことを知りたかった。<br />ｹﾞｰｾﾝにいるうちなら、何か話してくれるかもしれない。<br />俺はそう思っていた。<br />初対面に会った時も、ｹﾞｰｾﾝだからあれだけ意気投合できた。<br />ひととおりｹﾞｰﾑをして、また自販前に来た。<br />ｹﾞｰﾑが心地よく鳴り響いている。<br /><br />俺「あの&hellip;吹石さんはどうして絵を描き始めたんですか？」<br />彼女「わたし？んｰ&hellip;お兄の影響かなぁ」<br /><br />彼女はﾎﾟﾛｯとこぼした。<br />ここで俺は初めて彼女にとってのお兄さんの存在を知った。<br />ｹﾞｰｾﾝという、お互いに好きな場所だから、ついつい気を許して口をついて出たんだろう。<br />彼女はﾊｯとした顔だった。<br /><br />俺「お兄さん&hellip;ですか？」<br />彼女はかぶっていたｷｬｽｹｯﾄ帽を深々とかぶり直した。<br />俺「なんですかｿﾚ&hellip;」<br /><br />彼女は苦笑う。<br /><br />彼女「わたしには兄がいるんだよ&hellip;。小中学生の時はよく一緒にｹﾞｰｾﾝに来たよ。」<br />彼女「だからわたしはｹﾞｰｾﾝが好きになったんだけどね。」<br />俺「お兄さんもｹﾞｰｾﾝ好きだったんですね？」<br />彼女「うんｗ好きなんてもんじゃなかったよ。」<br />彼女「お兄は絵が大好きだったから、みんなにやってもらえるｱｰｹｰﾄﾞｹﾞｰﾑを作りたい<br />って、いつも言ってた。」<br />俺「それはすごいですね&hellip;」<br />彼女「でもね。」<br />彼女「ｳﾁは厳しいから&hellip;お兄は美大に行きたかったんだけど、親に<br />旧帝大以上の大学じゃないとﾀﾞﾒだ、って言われて&hellip;」<br />彼女「東大に行ったの」<br />俺「え、すごいじゃないですか！」<br />彼女「お兄は長男だったから&hellip;父さんたちも必死だったんだろうな&hellip;」<br />俺はなんだかこの話をこのまま聞いていていいのか、いたたまれなくなった。<br />彼女「お兄は大学に行ったら好きなように創作活動できると思ってたんだろうね&hellip;」<br />彼女「大学に入ったら、今度は親に官僚か弁護士になるように勉強しろとこっぴどく言われて&hellip;」<br />俺「弁護士&hellip;司法試験ですか&hellip;」奇しくも俺も法学部だったので反応した。<br />彼女「お兄ね&hellip;司法試験全然ﾀﾞﾒだった。」<br />彼女「時々、絵が描きたいって本音を漏らすこともあった。私だけが女で下の子だから、<br />好きなように美大に行かせてもらえたんだよ。」<br /><br />俺は何も言えずにいた。というか、普段まったく自分のことを話さない彼女が、<br />こんなに話してくれているのに、半ば驚いた。<br /><br />彼女「司法試験に落ち続けるうちに&hellip;お兄はまいっちゃったんだよね。<br />心を病んじゃって、今入院してるんだ&hellip;もう絵を描くどころじゃない。」<br /><br />なんて言ったらいいか分からなかった。いや、なんて言えば良かったの？ｗ<br />彼女はそんな重大なことをあっさり笑って言うもんだから、俺は動揺した。<br /><br />彼女「だから、わたしは&hellip;ｹﾞｰﾑ会社に入ってｹﾞｰﾑを作りたかったんだ。<br />私は好きなことをやって、自由にさせてもらった。だから絶対、夢を叶えようって&hellip;<br />でも、ﾀﾞﾒだったよ。思い出にすがってるようじゃ、ﾀﾞﾒなんだね。」<br />俺「ﾀﾞﾒだったんですか&hellip;」<br />俺「でも、まだまだﾁｬﾝｽはありますよ&hellip;！」<br /><br />彼女は、そうだねとは言わなかった。<br />だた、笑うだけだった。<br />その笑いが、何を意味するのか、まだ俺には分からなかった。<br />その日、会うのは何回目か分からなかったけど、初めて連絡先を交換した。<br />色々合点がいった。<br />なんでｹﾞｰｾﾝにいたかも。<br />最初の印象より、ずっとしっかりした子だった。<br />もちろん意味不明なところもたくさんあったけど、それが可愛かった。<br />美大浪人したらしく、俺より２つ３つ上だったんだけど、背は小さかった。<br />でもその背中がすごく大きく感じた。<br />俺は嬉しくなった。彼女が話してくれた。<br />これからはもっと彼女の力になれるかもしれない。<br />彼女のために、なんでもするくらいの心持ちだった。<br />彼女の抱えてたものは大きくてﾋﾞｯｸﾘしたけど、<br />何より話してくれたことが嬉しかった。<br />すっかり浮かれていた。<br />次はいつ会えるだろう？<br />それから俺はまたしばらくｹﾞｰｾﾝに通い続けた。ひたすら。<br />でもしばらく通っても、彼女はまったくｹﾞｰｾﾝに現れなくなった。<br />ﾒｰﾙは割と返ってきていた。<br />なんだろう？気になった。<br />土日も来ない。まだ仕事も始まっていないはずだった。<br />どうしてｹﾞｰｾﾝ来ないの？とﾒｰﾙで聞いても<br />「近いうちに行こうかな～」という趣旨のﾒｰﾙが返ってくるだけだった。<br />それからまたしばらく経って、俺は若干凹んでいた。勝手に。<br />彼女はもしかしたら彼氏もいたかもしれないし、俺は多分忘れられた&hellip;と。<br />ｹﾞｰｾﾝではいつも楽しくて、ﾒｼを食べることも多かったから、<br />向こうも俺のことを必要としていると思っていた。<br />突然、不思議なﾒｰﾙが来た。<br /><br />「そろそろ、大きな勝負が待っています。勝ってみせるよ。」<br /><br />勝負？なんのことだろう？<br />就職試験？それともｲﾗｽﾄﾚｰﾀｰﾃﾞﾋﾞｭｰ？<br />俺は楽観的に考えていた。<br /><br />「勝負？なにそれ？気になる」的なﾒｰﾙを返した。<br /><br />するととんでもない内容のﾒｰﾙが返ってきた。<br /><br />「今、入院しています。○○病院のどこどこ。良かったら会いにきてね、わたしのﾌｧﾝさん」<br /><br />みたいなﾒｰﾙが来ていた。<br />卒倒しそうになった。<br />驚きと同時に怒りも湧いた。<br />すべてを話してくれたと思ったのに&hellip;どうして黙っていたんだろう。<br />俺は大学をさぼってすぐに会いに行った。必死だった。<br /><br />俺「どうしたの？すごく心配してたんですよ！！」<br />「若年性の卵巣がん。」<br /><br />彼女はﾆｺｯと笑って俺が着くやいなやそう言い放った。<br />俺はことの重大さにすぐ気付いた。<br />俺はばあちゃんを卵巣がんで亡くしてる。<br />進行性のとても早い癌として知られていて、ばあちゃんもものの半年で&hellip;<br />だったのを思い出した。<br />彼女は変わり果てた姿でそこにいた。ﾆｯﾄ帽をかぶって、やせ細っていて&hellip;<br /><br />彼女「本当はねえ。手術終わるまでは黙ってようって思ってたんだ」<br />彼女「でもやっぱり直前になって怖くなっちゃった。」<br /><br />彼女は笑った。<br />笑顔だけは変わらずそこにあったので、なんだか俺のほうが安心して、悲しくなって、<br />涙目になってしまった。<br />しっかりしなくてはいけない。<br />強く、一人で頑張っていたんだろうな&hellip;<br />きっと俺と初めて会った時から、このことで悩んでいた&hellip;<br />そう思うと本当に泣きそうになった。<br /><br />俺「大丈夫です。教えくれてありがとう。これからは、俺も一緒にいますから。」<br />これが俺の精一杯だった。<br />そうすると彼女は安心したのか、途端に涙目になった。<br />彼女「こわいんだよ&hellip;手術&hellip;絵を描けなくなるのも&hellip;ｹﾞｰｾﾝに行けなくなるのも&hellip;<br />何もかも怖いんだよ&hellip;」<br /><br />彼女は何かがぷつんと切れたかのように、大泣きしだした。<br />俺も涙をこらえて、ひたすら<br />「大丈夫、大丈夫&hellip;」としか言えなかった。<br />正直この時俺もﾀﾞﾒだと思った。絶望してた。でも俺が<br />弱音吐いちゃ絶対だめなんだと思って、ふんばったよ。<br />ひととおり励まして、なんとか良い空気に戻った。<br />彼女が、ﾌﾞﾘｼﾞｯﾄ描いてｰ！（ｷﾞﾙﾃｨｷﾞｱという格ｹﾞｰのｷｬﾗ）<br />などと言ってくるので、俺が描いたりして遊んでいた。<br />すると、不思議と和やかになっていった。<br />そのうち、彼女のお母さんが機を見て病室に入ってきた。<br /><br />俺「こんにちは」<br />母「あ、これはこれは&hellip;」<br /><br />おふくろさんは人当たりの良い方だった。<br />俺は昔から大人（特におばちゃん）とは何故か打ち解けるのが得意だったので、<br />すぐにお母さんとも懇意になれた。<br />しかし俺と彼女の関係性があまりに曖昧だったので、そこはなんとも言及しづらかった。<br />母さんは勝手に彼氏だと思っていたようだが。<br />そして俺は手術までの間通い続けた。<br />すべてを捨てる覚悟だった。<br />大学も全部ｻﾎﾞった。<br />手術前日。行っていいのか迷ったが俺は行こうと決めた。<br />父親も、母親もいた。<br />お父さんは、話に聞いていたよりは温和そうな人だった。<br /><br />「こんにちは&hellip;」<br /><br />すると、母さんに手招きされて、待合に呼ばれた。<br />俺は母さんとは電話連絡もして買い出しにも行くくらい、実は懇意になっていた。<br /><br />母「富澤くんには聞いておいて欲しいの。」<br />俺「はい&hellip;」<br /><br />正直俺は手術の趣旨も、彼女の癌の状態もほぼほぼ知らなかったから、<br />何か聞きたいとは思っていた。<br /><br />お母さんは俺に言った。<br /><br />母「手術しても&hellip;余命は１年くらいだろうって、言われてるの&hellip;」</div>\r\n<div class="textarea" style="text-align: left;"><br /><br />続きは明日の22時に公開します！！</div>\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<br />\r\n<div class="textarea"><a href="/index.php/home/question?id=62">■第１話はコチラ<br /><a href="/index.php/home/question?id=69">■第３話はコチラ</a></div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;&darr;こちらもオススメ！！！&darr;&darr;&darr;&darr;</p>\r\n<p style="text-align: center;">■その他のおすすめの恋愛ストーリー</p>\r\n<p style="text-align: center;">自分が交通事故で歩けなくなりました。<br />あなたは恋人に相談できますか？<br />それともこっそり別れを告げますか？</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=49">泣ける恋愛ストーリー【わかれよう。。。。】</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">突然の彼の死。<br />彼が恋人に送れずに未送信のままになっていた大量のメールの内容とは&hellip;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=48">【感動する恋話】未送信のメール。</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 184, '<div class="textarea">\r\n<h1><img src="/uploads/love_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【2/8】</h1>\r\n<p><a href="/index.php/home/question?id=62">■第１話はコチラ</a></p>\r\n<div class="textarea" style="text-align: left;">彼女はｹﾞｰｾﾝを出ていった。<br />俺は混乱した。何か悪いこと言ったのか？<br />もう何がなんだか分からなくなってた。<br />無心で追いかけた。<br />「待ってください！どうしたんですか！？」<br /><br />彼女は立ち止まって黙った。<br />俺はどうしようか困った。<br />なんて声をかけたらいいか分からなかった。<br />目の前で、ﾍﾞﾚｰ帽を被って手や服を絵の具で汚した女の子が泣いている。<br />なんてﾍﾝﾃｺな状況なんだろう。<br />瞬間、俺はこんな事を口にした。<br />「そ、そうだ&hellip;これから画材屋さんにでも行きませんか？」<br /><br />なんでこんなことを言ったのか分からないが、<br />何か状況を変えようと思ってとっさに出た一言だった。<br />彼女「え&hellip;？ほんとに？」<br />俺「はい、行きましょう、近場でどこか&hellip;」<br />彼女の反応は思ったよりよかった。<br />そして幾分ﾉﾘ気であった。<br />彼女「じゃあさ、近くにあるから行こう。ちょっと電車のるけど。」 <br />\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと気になる続きが読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 1, 2, '0000-00-00', 1),
(68, 1, 14, '今すぐ使える10回言ってクイズ！～ハンド編～', '「手」と10回言った後の質問と答えはこちら！', 'quiz_fb.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/qui_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【今すぐ使える10回言ってクイズ！～ハンド編～】</h1>\r\n手って10回言ってみて！<br />&darr;<br />01.手<br />02.手<br />03.手<br />04.手<br />05.手<br />06.手<br />07.手<br />08.手<br />09.手<br />10.手<br />\r\n<p><strong><span style="color: #ff0000;">Q.顔の真ん中に、２つあるのは？</span></strong></p>\r\n<p>目！</p>\r\n<p>・</p>\r\n<p>・</p>\r\n<p>・</p>\r\n<p>ではなく、<strong><span style="color: #ff0000;">鼻の穴</span></strong>です！</p>\r\n<p>友達に出して楽しんでみてね！！</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;&darr;&darr;&darr;&darr;こちらもオススメ！！！&darr;&darr;&darr;&darr;</p>\r\n<p style="text-align: center;">■その他の10回言ってクイズ</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=55">【今すぐ使える10回言ってクイズ！】～東海道編～</a></p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=54">【今すぐ使える10回言ってクイズ！】～キャンパス編～</a></p>\r\n</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 114, '<div class="textarea">\r\n<h1><img src="/uploads/qui_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【今すぐ使える10回言ってクイズ！～ハンド編～】</h1>\r\n手って10回言ってみて！<br />&darr;<br />01.手<br />02.手<br />03.手<br />04.手<br />05.手<br />06.手<br />07.手<br />08.手<br />09.手<br />10.手 <br /><br />○の○○○に2つあるのは？ <br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと問題の質問と答えが読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 2, 3, '0000-00-00', 1),
(69, 1, 14, '《長編》2chで話題になったゲーセンで出会った彼女の話【3/8】', '最後はハンカチ必須！！長編恋愛ストーリー。', 'love_fb600.png', '', '', '<p><img src="/uploads/love_cont.png" alt="alt" width="100%" /></p>\r\n<div class="textarea">\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【3/8】</h1>\r\n<a href="/index.php/home/question?id=62">■第１話はコチラ</a><a href="/index.php/home/question?id=67"><br />■第２話はコチラ</a>\r\n<div class="textarea" style="text-align: left;"><br />それは多分彼女の大きな不安だったんだろう。<br />これを、口に出して聞くことが出来なかったんだろう。<br />俺は泣きそうになった。<br /><br />俺「何いってんの？」<br />俺「俺は吹石さんといる時が、一番楽しいよ」<br /><br />俺はﾊｯｷﾘ伝えた。絶対に変な不安を持ってほしくなかった。<br /><br />彼女「よかった。ありがとう。」<br /><br />彼女は小さく笑った。<br />俺は彼女の頭を撫でたけど、ﾍﾀﾚだからそれしかできなかった。<br />頭を撫でると彼女は笑って「わんわん！」と言った。<br />本当に、こういうとこがあるから俺は惹かれてしまったんだろう。<br /><br />散歩から帰ると、病室に一人の女の子の姿があった。<br />どうやら、彼女の高校時代の友人らしかった。<br /><br />彼女「てて子&hellip;」（名前は仮名です。ＬＯＶの彼女のお気入りの使い魔から）<br />友人「心配してたよ&hellip;」<br />俺「こんにちは」<br /><br />俺は空気を読んで席を外そうとした。すると、<br /><br />彼女「いていいよ&hellip;」<br /><br />彼女がそういうので病室に残ることにした。<br />彼女たちは懐かしい話に話を咲かせていた。<br />でも終始、彼女が病気の話に触れることはなかった。<br />そして３０分くらいしたらだろうか、友人さんはお見舞いをおいて去っていった。<br />見たところ、癌のことすら知らななそうだし、彼女の病気について知らなそうだった。<br /><br />俺「友達には、病気のこと話してないの？」<br />彼女「うん、てて子だけだよ。それに癌とか知らない。すぐ治ると思ってる。」<br />俺「誰にも言わなくていいの？」<br /><br />きっと俺が同じ状況になったら多くの友人に言ってしまう。<br /><br />彼女「心配かけたくないじゃん。普通、みんなﾋﾞｯｸﾘしちゃうよ。<br />本当に少しの人が分かってくれてれば、それいいんだから」<br /><br />彼女はとても優しい口調で言った。<br />その少しの人に、俺が入っていたのは、嬉しくもあり、<br />なんとも言えない気持ちだった。<br />この子はもし俺がいなかったら、誰にも言わず、家族だけに頼って、<br />そう思うとなんだか辛くなった。<br />それからの日々は割と穏やかだった。<br />彼女は病院から離れられなかったが、俺は大学をできるだけ抜け出し<br />なんとか毎日でも彼女に会いに行った。<br />花が好きだったから、けっこうな頻度で花を買っていった。<br />彼女のお気に入りの花はﾄﾙｺｷﾞｷｮｳという花だった。<br />俺が偶然花屋さんで見つけて買っていった花を、彼女はとても気に入ってくれた。<br />青と白の色合いが綺麗な花だった。<br />でも毎回なるべく違う花を買っていった。<br />そして病室で二人で「花擬人化ごっこ」<br />をして持っていった花を女の子の絵にして遊んでいた。<br />よく笑った。花を持って行くと彼女は決まって<br />満面の笑みになって喜んでくれた。<br /><br />彼女「今日はどうしよっかなｰ」<br /><br />なんて言ってふたりで花を見て絵で遊んで、<br />本当に彼女が病気だってこと忘れるくらいに楽しかった。<br />でもいつもいつも調子がいいわけじゃなく、<br />日によっては行っても起き上がることすら辛い日もあって、<br />そうすると俺はふっと病気のことを思い出して途端に辛くなった。<br />そんな日も俺はお母さんに言って、持っていった花だけは<br />花瓶に入れるようにしていた。<br />ある日、いつものように病室に向かうと、<br />やたらﾃﾝｼｮﾝの高い彼女がいた。<br /><br />彼女「ねえねえ、聞いてよ聞いてよ！」<br />俺「あらら、元気だね。どうしたの？」<br />彼女「外泊許可がもらえたよ！五日間！」<br />俺「本当に！？」<br />彼女「嬉しいなあ。２日間はおうちに帰るけど、わたし三日間は富澤といるよ！」<br />俺「本当に！」<br />彼女「ﾃﾞｰﾄ行きたい！ﾃﾞｰﾄ！」<br />俺「いいね、いこういこう。」<br />彼女「ｹﾞｰｾﾝ行こうよ、ｹﾞｰｾﾝ！」<br /><br />こんなに元気で明るい彼女を見るのは久しぶりだったので、<br />俺はすごく嬉しかった。<br />どうにか彼女をたくさん楽しませてあげたい、そういう風に思った。<br />二人で、三日間何をするか考えふけった。<br />彼女はｹﾞｰｾﾝに行きたくて、俺と普通のﾃﾞｰﾄが一度してみたかったのだという。<br />そして、俺の生まれ育った街が見たいということで、俺の実家に来たいということ。<br />この二つだった。<br />彼女は多くを望まなかったし、贅沢も言わなかった。<br />何か欲しいものとかないの？<br />と聞いても、「ただ一緒にいたい」と言うだけだった。<br />もしかしたら、最初で最後のﾃﾞｰﾄになるかもしれない。<br />俺は覚悟していた。<br />この、外に出られる、普通に過ごせる三日間で彼女を最高に笑わせたいと思った。<br />俺は色々考えた。ﾌﾟﾚｾﾞﾝﾄを買うために、貯金を下ろした。<br />何を買うか、迷ったが、COACHの帽子をあげることにした。<br />彼女はCOACHが好きで（と言っても財布しか使っていなかった）、<br />きっと帽子なら喜んでくれると踏んだ。<br />当日まで、ﾄﾞｷﾄﾞｷとした。何をどうすりゃいいのか。<br />彼女にﾃﾞｰﾄ初日でやりたいことを聞いた。<br /><br />彼女「ｹﾞｰｾﾝに行って、そのへんﾌﾗﾌﾗするｰ」<br />俺「え、そんなんでいいん？」<br />彼女「特別にどっか行くより、そっちの方が普通のﾃﾞｰﾄっぽくていいじゃん」<br />彼女「学校帰りに一緒に帰るくらいの日常さで、いいんだよ」<br /><br />彼女はにこにこしてそう言う。<br />彼女が望むのなら、俺もあまり気張りすぎないようにしようと思った。<br />その日が迫るごとにあたふたした。<br />実家に、女の子連れてくよって電話した。病気のことは伏せた。<br />前日に、意気揚々とCOACHに帽子を買いにいったが、あいにく売っていなかった。<br />彼女が一番好きなﾌﾞﾗﾝﾄﾞはCOACHだった。COACHで帽子が欲しかったのに&hellip;<br /><br />俺「あの&hellip;帽子が欲しいんですが&hellip;COACHのﾆｯﾄ帽、被ってる人見たことあるんです」<br />店員「もうしわけございません&hellip;それはこちらの店頭では&hellip;」<br /><br />あきらめられなかった。<br />俺は店内を見ていると、ﾊｰﾄの可愛いﾈｯｸﾚｽを見つけた。３万くらいした。<br />帽子を買うつもりでそんなに金は使うつもりではなかった。<br />でも俺はそのﾈｯｸﾚｽを買った。<br />しかし、この選択は正解だった。<br />いよいよその日になる。<br />俺はﾘｭｯｸにﾌﾟﾚｾﾞﾝﾄを忍ばせて、いつ渡すか決めかねていた。<br />お父さんとお母さんに挨拶した。<br />お父さんは優しそうに笑っていた。<br /><br />「よろしく、頼むね。」<br />俺「はい、彼女のことは、任せてください。」<br />彼女「じゃｰね、いってくる！」<br /><br />俺もﾆﾔﾆﾔしていたけど、彼女も始終にこにこしていた。<br />楽しい、忘れられない三日間が始まる。<br />正直不安もいっぱいだった。<br />突然体調が変わったら？彼女に何かあったら？<br />でも彼女は俺のこと信頼して、全てを俺に預けてくれたんだろう。<br />もしもの時のために病院の番号もﾒﾓったし、お父さんとお母さんの番号も分かってる。<br />きっと、どうにかなる。とにかく彼女といられる時間を大事にしようと思った。<br /><br />彼女「電車のろ！電車電車！」<br />俺「え、ﾀｸｼｰとかでもいいんだよ？」<br />彼女「そんなんｾﾚﾌﾞなﾃﾞｰﾄないよｗ」<br />俺「まあこの時間なら人も少ないしね。電車に乗ろうか。」<br />駅に着く。彼女は大声を出す。<br />彼女「わわ、電車だよ電車！いいなあ懐かしいなあ！」<br />俺「なんだかいいね、こういうの。すごい不思議な感じ、至って普通なのにｗ」<br /><br />ずっと、病室でしか会えなかったものだから、色々と新鮮に映った。<br />電車に乗っただけで、なんだかとても嬉しかった。<br />電車ではしゃぐ彼女はどこかﾍﾝﾃｺだったけど、<br />どう見ても普通の女の子にしか見えなかった。<br />この小さい体に、色んなものを抱えてると思うと、悔しかった。<br />電車内には同じような年齢の女性もたくさんいて、それを見てると複雑な気持ちになった。<br /><br />俺「どこいこっか？」<br />彼女「あ、決めてないのｰ？もうしっかりしてよｰ」<br />俺「ええ、ﾉｰﾌﾟﾗﾝでいいって言ってなかった？」<br />彼女「嘘でしたｰ！言ってみたかっただけこういう事ｗ」<br />彼女は笑いながら言った。<br />彼女は電車の中でも突拍子もないことを言い出す。<br />彼女「ねえねえ、ｹﾝｶしよ！」<br />俺「え、は？」<br />彼女「もう、ふざけないでよ！」<br />俺「どゆことｗｗｗ」<br />彼女「失礼しましたｗ」<br /><br />ｹﾝｶをするはずがすぐ漫才みたいになってしまって、二人で笑い転げた。<br />俺は彼女が何を求めているのか、なんとなく分かっていた。<br />花言葉が気になるけど、続けますｗ<br />彼女は自由だった。そう、彼女はこういう人だったんだよ。<br />俺は凄く安心していた。<br />けっこう電車に乗って、とりあえず新宿で降りた。<br /><br />彼女「あ、そだ。ｹﾞｰｾﾝでも行かない？」<br />俺「それ最初から決めてたんじゃんｗｗ」<br />彼女「ま、そうなんだけどｗｗ」<br /><br />彼女のﾜｰﾙﾄﾞになりつつあった。<br />俺はすごく懐かしい気持ちになった。<br />会ったばかりの頃を、思い出すようだった。<br />ｹﾞｰｾﾝに着くやいなや、彼女はﾃﾝｼｮﾝだだ上がり。<br /><br />彼女「大きい！すごい！この雰囲気懐かしい！」<br />俺「初めてだけど、すごいなｰ。格ｹﾞｰとかも猛者がいそうだ。」<br />彼女「ﾃﾞｯｷ組んだんだよﾃﾞｯｷ！まずLOVね！」<br /><br />もう大はしゃぎの彼女を見ていると、こっちも楽しくて仕方がなかった。<br />俺たちはまあ、ｱｹｹﾞｰｵﾀだから、ここに会話の内容書いてもあれかもしれないけどｗ<br /><br />彼女「わだﾘﾊﾞﾃﾞｯｷ作ったんだｰ！ｹﾞｰﾄ閉じちゃうよｹﾞｰﾄ！」<br />俺「いや、させない！俺のﾑｰﾌﾞでそんなものは&hellip;」<br /><br />ま、分かる人だけ分かってくださいｗ<br />こんなこと言い合いながら、それは楽しくﾌﾟﾚｲしていたわけです。<br />そのあとはひと通り色々まわる。<br />彼女がﾎﾟｯﾌﾟﾝやりたいと言えばやり、太鼓叩きたいと言えば、叩き。<br />そのあと二人で格ｹﾞｰ武者修業と名づけ、すいていたので<br />勝てない相手にｺﾝﾋﾞを組んで挑み続けたりｗ<br />友達とやったら盛り上がった試しのないQMAというｹﾞｰﾑでも、<br />二人でﾊｲﾀｯﾁしながら嘘のように盛り上がったり。<br />とりあえず、俺達にとってｹﾞｰｾﾝというのはこの上なく楽しいｽﾎﾟｯﾄだった。<br />そんなことをしているうちにあっという間にお昼を回っていた。<br /><br />俺「そろそろ引き上げようかｰ」<br />彼女「すごい楽しかったｰ！」<br /><br />彼女は本当に満足しているようだったので、俺は安心した。<br />かくいう俺も本当に楽しかった。<br /><br />俺「お昼どうしたい？」<br />彼女「ﾏｯｸがいいなぁｰ」<br />俺「え、そんなもんでいいの？」<br />彼女「わたし携帯のｸｰﾎﾟﾝあるからねｰ！」<br /><br />続きは明日の22時に公開します！！</div>\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<br />\r\n<div class="textarea"><a href="/index.php/home/question?id=67">■第２話はコチラ</a><br /><a href="/index.php/home/question?id=70">■第４話はコチラ</a></div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;&darr;こちらもオススメ！！！&darr;&darr;&darr;&darr;</p>\r\n<p style="text-align: center;">■その他のおすすめの恋愛ストーリー</p>\r\n<p style="text-align: center;">自分が交通事故で歩けなくなりました。<br />あなたは恋人に相談できますか？<br />それともこっそり別れを告げますか？</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=49">泣ける恋愛ストーリー【わかれよう。。。。】</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">突然の彼の死。<br />彼が恋人に送れずに未送信のままになっていた大量のメールの内容とは&hellip;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=48">【感動する恋話】未送信のメール。</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 196, '<div class="textarea">\r\n<p><img src="/uploads/love_cont.png" alt="alt" width="100%" /></p>\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【3/8】</h1>\r\n<a href="/index.php/home/question?id=62">■第１話はコチラ</a><a href="/index.php/home/question?id=67"><br />■第２話はコチラ</a>\r\n<div class="textarea" style="text-align: left;"><br />動揺した。思っていたよりも、ずっとずっと、残っていた時間はなかった。<br />母「君は&hellip;それを覚悟しておいてね。それで、このことをあの子に伝えるか<br />わたしたちは悩んでるの&hellip;」<br />人生２０年そこらしか生きて来なかった俺には、もうどうしたらいいのか分からなかった。<br />母「君は、最後まできっとあの子のそばにいてあげてね。<br />あの子、あなたがいない時もあなたのことばかり話すのよ」<br />みたいなことを言っていたと思う。<br />最後までってなんだ？もういなくなること確定なのか？<br />混乱した。<br />大学生の小僧には、あまりに色々重すぎて、どうしたらいいか分からなかった。<br /><br />手術は滞り無く無事終わった。<br />しばらくは麻酔やらなんやらのせいで、熱も続き、<br />彼女も起き上がるのは難しいということで俺は病院に行くことを控えた。<br />俺はしばらくﾌﾜﾌﾜした気持ちになっていた。<br />全部夢なんじゃないかとも思っていた。<br /><br />手術が終わって数日して、俺は彼女に会いに行った。<br />彼女は寝ていた。<br />目覚めると俺を見て、ﾌﾗﾌﾗと体を起こす。<br />俺「あ、起きないほうが&hellip;」<br />彼女「いいの、今日は調子いいんだ&hellip;」<br />笑みにも力がない。<br />俺「手術、頑張ったね。」<br />彼女「ありがとう。」<br />彼女の笑顔には本当に力がなくなっていた。<br /><br />俺「何か、欲しいものは&hellip;？」<br />彼女「一緒にｹﾞｰｾﾝ行きたい」<br />俺「それは&hellip;もうちょっとしたらにしようか。」<br />彼女「ｹﾞｰﾑしたいね。」<br />そんなこと言われたら、悲しくなるだけだった。<br /><br />彼女「病院の中散歩したいなあ。」<br />俺「それなら」<br />俺は看護婦さんとお母さんに聞いて了承を得て、車椅子をひいてちょっと外まで行くことにした。<br />俺「喉かわかない？辛くない？」<br />彼女「そんな大丈夫だよｗよそよそしいのやめてｗ」<br />彼女「あ、でも欲しいもんあるぜ～」<br />俺「え、なになに？」<br />彼女「ｽｹｯﾁﾌﾞｯｸが欲しいな」<br />俺「あ、なるほど。それならｸﾛｯｷｰ帳なら俺今持ってる。」<br />彼女「ほんと？やった、それなら絵描きたいな。」<br /><br />ﾗｳﾝｼﾞみたいなところで、おれは彼女にｸﾛｯｷｰ帳を差し出した。<br />車椅子に座る彼女の体を支えつつ、ﾍﾟﾝとｸﾛｯｷｰ帳を渡した。<br />彼女はゆっくりと絵を描き始めた。<br />そこには、彼女が好きなｱｰｹｰﾄﾞｹﾞｰﾑのｷｬﾗｸﾀたちと、なにやら<br />ﾒｯｾｰｼﾞ描かれていた。<br />そっとそれを恥ずかしそうに俺に渡す。<br /><br />すると突然彼女が言った。<br />「迷惑かけてごめんなさい。こんな病人と一緒にいて楽しい？」<br />\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと気になる続きが読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>\r\n</div>', 1, 2, '0000-00-00', 1);
INSERT INTO `questions` (`id`, `app_type`, `app_id`, `title`, `description`, `image`, `scenario`, `contents`, `anwser_result`, `permissions`, `fb_page_id`, `fb_page_url`, `fb_page_title`, `count`, `intro`, `count_today`, `count_month`, `count_day`, `is_publish`) VALUES
(70, 1, 14, '《長編》2chで話題になったゲーセンで出会った彼女の話【4/8】', '最後はハンカチ必須！！長編恋愛ストーリー。', 'love_fb_600.png', '', '', '<p><img src="/uploads/love_cont.png" alt="alt" width="100%" /></p>\r\n<div class="textarea">\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【4/8】</h1>\r\n<a href="/index.php/home/question?id=62">■第１話はコチラ</a><a href="/index.php/home/question?id=69"><br />■第３話はコチラ</a>\r\n<div class="textarea" style="text-align: left;"><br />俺「え、どうして？」<br /><br />普段、彼女の前では絶対煙草を吸うことはなかった。というか不可能だった。<br />その時は喫煙席に座っていた。<br /><br />俺「くさいよ？」<br />彼女「いいの」<br /><br />言われるままに一服した。<br />彼女は黙って眺めていた。<br />案の定、<br /><br />彼女「ごほっ、くっせｰね。」<br />俺「だから言ったじゃｰんｗ」<br /><br />彼女はそう言ったものの、にこにこしているだけだった。<br />俺も、なんだか照れくさくなりながら、一服。<br />そうしていると、俺の携帯にﾒｰﾙが来た。<br />妹からだった。<br />俺には一つ年下の妹がいる。<br />内容の趣旨としては、<br /><br />「兄貴今日女の子連れてくるんだって？期待しとるわｗ」<br /><br />みたいな感じだった。<br />おちょくっていやがる。基本仲悪くもなく、<br />実家に帰れば一緒にｹﾞｰﾑしたりもするし、なにぶん<br />妹自体も少しｵﾀｸなので、気が合う兄妹ではある。<br /><br />俺「午後からどうしよっか。電車の時間までは、けっこうあるんだよね。」<br />彼女「買い物行きたい！本屋さん行こ！」<br />俺「え？本屋さんでいいの？」<br />彼女「間違いない」（長井秀和のﾏﾈ）<br />俺「なっつｗｗｗ」<br /><br />彼女のこのあたりはもはや言うまでにもあらずだったけど、<br />彼女はよく芸人のﾏﾈをしては笑っていた。<br />まあ入院生活も長いわけだし、きっと欲しい本とかもいっぱいあるんだろう。<br />そして書店に赴く。<br /><br />彼女「ひれｰっ！」<br />俺「俺も初めて来たけど大きいね&hellip;」<br /><br />彼女はｺﾐｯｸｺｰﾅｰに駆け出す。<br />そしてずｰっと俺の手を引っ張って、<br /><br />「これ、〇〇さんの本、すごく好きなんだ～<br />あ、〇〇さんの漫画、これは作画綺麗で&hellip;」<br /><br />という風に喋り疲れるんじゃないかって思うくらい話す。<br /><br />俺「大抵本屋とか一人で来るけど、一緒に来ると<br />好きな本のこととか話せて楽しいね。」<br /><br />俺自身、正直にそう思った。<br />俺も普段から本屋巡りとかが好きで、好きな絵柄の作家さんとか<br />見つけたりするのが好きだった。<br />でも一人だどこか寂しい部分もあった。<br />それを彼女と共有するのは楽しかった。<br /><br />彼女「でしょｰじつはこういうとこに二人で来てみたかったんだよね&hellip;」<br /><br />彼女は照れくさそうに言った。<br />彼女がどうして普通のﾃﾞｰﾄがよかったのか<br />なんとなく分かったような気がした。<br />俺たちは、笑うときもそうだけど、お互い語りだすと止まらない。<br />格ｹﾞｰ談義をするときもそうなんだけど、どのﾌﾟﾚｲﾔｰが強いかとか、<br />そういうことを夢中になって語る。<br />彼女は、俺のｵｽｽﾒの本を教えて欲しいというので、俺も彼女に負けじと語った。<br />言っても言っても、「他は？」「全部知りたい」<br />と言ってきかないのでｷﾘがなかった。<br /><br />彼女「富澤ｵｽｽﾒの本、全部読みたいな&hellip;」<br />俺「よし、今度持って行ってあげるね。」<br />彼女「そんなｰ悪いよｰ」<br />俺「ほんとは？」<br />彼女「待ってました&hellip;ｗ」<br /><br />彼女は苦笑いと共に本音を漏らした。<br />すいませんちょっとだけ休憩します<br />平井堅ってﾚｽがあったのでyoutube見に行ったら自爆してしまいました<br />すいませんすぐ復帰します<br />電車までひとしきり時間があったので俺はその後<br />ﾌﾟﾗﾈﾀﾘｳﾑ行く？とかどっか美術館行く？とか聞いた。<br />けど彼女の答えは違った。<br /><br />彼女「１時間だけｶﾗｵｹに行きたい」<br />俺「ああいいねｰそれ。座ってると負担もすくないもんね。」<br /><br />ｶﾗｵｹに行くと、どんな感じになるんだろうと思ったけど、<br />彼女のﾚﾊﾟｰﾄﾘｰは実に豊富だった。<br />お互い真剣に歌うというよりふざけてばかりだった。<br />二人してﾃﾆﾐｭを空耳で歌ったり、盛り上がる曲で合いの手を<br />入れあったりして、はしゃぎ倒した。<br />彼女は疲れちゃうんじゃないかって、心配になるくらいだった。<br />楽しい時間なんてあっという間なもんで、電車の時間が迫った。<br />ｶﾗｵｹでｸｰﾎﾟﾝみたいなものをもらった。<br />ﾏｯｸでもｸｰﾎﾟﾝみたいのをもらった。<br />そういうものをもらう度、俺は<br />「次があるのかな&hellip;」と一人で思った。<br />電車、特急列車。<br />俺の地元にむかう電車だった。<br />俺の地元までは特急で２時間くらいだった。<br /><br />彼女「わｰなんか旅って気がしてきました！」<br />俺「楽しいよねｰ」<br /><br />彼女はそそくさと売店に向かった。<br />そしてじゃがりこを買ってきてﾄﾞﾔ顔で俺に見せつける。<br /><br />彼女「旅っつったらこれでしょ！」<br />俺「車内販売もあるんだけどねぇ」<br />彼女「ﾏｼﾞか！」<br /><br />特急に乗る。<br />最初こそ彼女は特急ってすげえ駅すっとばすよね！<br />とか言って元気だったんだけど、そのうち疲れちゃったのか、<br />しばらくするとすっかり眠ってしまった。<br />俺は、しばらく静かな時間を過ごすことになる。<br />よこの彼女を見ると、色々と、思うものがあった。<br />少し油断すると、こんな日がずっと続くと錯覚してしまう。<br />この三日間が終わった先にはどんなことが待っているのか&hellip;<br />考えたくなくても、嫌でも脳裏をよぎった。<br />ここで、俺は本当に泣きそうになる。<br />そして彼女に分からないように泣いてしまった。<br />特急の指定席で、一人で号泣した。<br />どうしてだったか分からないけど、すごく悲しかった。<br />こんなんではいけない。俺は、思いついた。今だ、と。<br />寝ている彼女の首に、気付かれないように、ﾌﾟﾚｾﾞﾝﾄのﾈｯｸﾚｽを巻こうと思った。<br />窓によりかかっていたので、すきまがあってた。<br />起こしてしまうかﾊﾗﾊﾗしつつも、どうにかこうにか彼女にﾈｯｸﾚｽを<br />つけることができた。<br />ﾋﾞｯｸﾘするかな。俺は不安と期待でﾄﾞｷﾄﾞｷした。<br />駅に着くまで彼女は熟睡していた。<br />ここまで上手くいくと思わなかったけど、しかしよく寝ていた。疲れたんだろう。<br />駅に着くｱﾅｳﾝｽが流れる。<br /><br />俺「さ、着いたよ。起きて起きて。」<br />彼女「え、あ&hellip;」<br /><br />寝ぼけている彼女の手を引いて、俺は彼女を誘導した。<br />ﾎｰﾑに降りると辺りは暗くなり始めていて、宵の口と言ったところだった。<br />彼女は降りると、う～んと伸びをして「よく寝た」とつぶやいた。<br />俺はﾄﾞｷﾄﾞｷだった。<br /><br />彼女「わ！なにこれ&hellip;ﾈｯｸﾚｽ？富澤？」<br />俺は「魔法だよ、きっと」と言うつもりだった。でも、<br />俺「誰かのいたずらか&hellip;？」<br /><br />意味が分からないｗ<br />かっこいいこと言おうとしたのに、彼女にこっちを見られると恥ずかしくなって<br />ついついおかしなことを言ってしまう。<br /><br />彼女「えｰｗｗ富澤でしょｰｗこれ可愛いなｰ。」<br />俺「うん&hellip;ﾌﾟﾚｾﾞﾝﾄだよ。すっごい似合ってる。」<br /><br />本当に似合ってた。自分の選んだﾈｯｸﾚｽをつけている姿が、<br />とっても、微笑ましかった。<br />瞬間、彼女は俺に抱きついてきた。<br />俺はﾋﾞｯｸﾘして心臓飛び出るかと思った。<br /><br />俺「ぅお&hellip;！」ﾋﾞｯｸﾘして、変な言葉が出る。<br />彼女「ありがとう。絶対絶対、大事にするよ。」<br /><br />勇気を絞って、俺も抱きしめた。<br />思えば、人生で始めて女の子を抱きしめた瞬間だったと思う。<br />とっても暖かくて、大事なものだって気がした。<br />高校時代毎日使っていた見慣れた駅のﾎｰﾑの真ん中で、<br />俺は確かに人の温かみを感じた。<br />人なんてほとんどいなくて、駅のﾎｰﾑには俺と彼女だけだった。<br />向いのﾎｰﾑに高校生がいたが。<br />しばらくその状態で、彼女がいきなり<br /><br />「充電完了だｰ！」<br /><br />と大声をあげるものだから、ぱっと手を離した。<br />改札をくぐる、なんだか照れくさくなっちゃって俺はぎこちない。<br />でも彼女はそんなのおかまいなしで、<br />「ほらら～らら～らら～♪」（聖剣LOMのﾄﾞﾐﾅの曲）などと鼻歌を歌う始末。<br />ご機嫌だったんだろう。彼女は普段からよく歌う子だった。<br />それ、聖剣だね！なんていつものように俺もつっこめず、<br />駅を抜けるとそこには迎えが待っていた。<br />迎えに来ていたのは、妹だった。<br />車で迎えにきてくれた。<br />「なんでｱｲﾂなんだよ&hellip;」<br />と思ったが、結果母親が来てもあまり変わらないので同じだった。<br />俺は彼女の荷物をずっと代わりに持っていたので、積みこむ。<br /><br />俺「ごくろｰさん」<br />妹「いえいえ」<br />彼女「こんにちは、わざわざありがとうございます。」<br />妹「こんにちはｰ」<br />妹は明らかにﾆﾔﾆﾔしていた。<br />妹「可愛いなｰ。同級生ｰ？」<br />俺「お前よりずっと年上だから」<br />彼女「いえ、全然気にせず接してくださいねｗ」<br />妹「こんな兄だけどよろしくお願いしますねｰ」<br /><br />車内は女社会と化していたが、非常に和やかなﾑｰﾄﾞで、<br />妹と彼女も気が合いそうな感じで俺は安心した。<br />車で坂をのぼる。<br />俺の実家はちょっと坂の上にある。<br />店がまったくないわけでもなく、いい感じの田舎だ。<br />家につくと、待ち構えていたように母さんが出てくる。<br /><br />「いらっしゃい！遠くからお疲れ様」<br />彼女「いえいえ、よろしくお願いします。」<br /><br />彼女は、こういうところで礼儀正しくて、当然のことながら少し驚いた。<br />気のせいか、母さんも妹も、よそよそしくて、落ち着かない感じだった。<br />無理もない。ﾀﾞﾒ息子が急にこんな女の子を連れてきたら、<br />面食らうってもんだろう。<br />母さんと妹はまだ晩飯の準備中だったらしく、<br />彼女は手伝いたい、と言った。<br />俺は疲れてるんだから無理しないで、と言ったが、<br />どうしてもと言ってきかなかった。<br /><br />俺「母さんｴﾌﾟﾛﾝあったっけ？」<br />母「あれがあったわよｱﾝﾀのが」<br /><br />彼女は俺が高校の家庭科で使っていたｴﾌﾟﾛﾝを身にまとった。<br />「どうかな？ｗ」<br />恥ずかしそうにｴﾌﾟﾛﾝを着て彼女は言う。<br /><br />俺「いいねｰ最高だよ。」<br /><br />その様子を見て母さんと妹が俺の方を見て不自然にﾆﾔﾆﾔする。<br />俺は「ほっとけ!!」と心の中で連呼した。<br />彼女も台所についてできることを一生懸命手伝っていた。<br />うちの家族に混ざって、楽しそうだった。<br />俺はそれを横目に見つつ勝手口の裏口で一服していた。<br />俺も手伝おうとはしたが、ｱﾝﾀ失敗するから、と妹に阻止された。<br /><br />続きは明日の22時に公開します！！</div>\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<br />\r\n<div class="textarea"><a href="/index.php/home/question?id=69">■第３話はコチラ</a><br /><a href="/index.php/home/question?id=71">■第５話はコチラ</a></div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;&darr;こちらもオススメ！！！&darr;&darr;&darr;&darr;</p>\r\n<p style="text-align: center;">■その他のおすすめの恋愛ストーリー</p>\r\n<p style="text-align: center;">自分が交通事故で歩けなくなりました。<br />あなたは恋人に相談できますか？<br />それともこっそり別れを告げますか？</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=49">泣ける恋愛ストーリー【わかれよう。。。。】</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">突然の彼の死。<br />彼が恋人に送れずに未送信のままになっていた大量のメールの内容とは&hellip;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=48">【感動する恋話】未送信のメール。</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 151, '<div class="textarea">\r\n<h1><img src="/uploads/love_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【4/8】</h1>\r\n<p><a href="/index.php/home/question?id=62">■第１話はコチラ</a><br /><a href="/index.php/home/question?id=69">■第３話はコチラ</a><br /><br />彼女は本当になんてことない日常の時間を<br />過ごしたいってのはもう分かっていた。<br /><br />彼女「わたしはねｰ、てりやきかなｗ懐かしいな～」<br /><br />ｶｳﾝﾀｰで楽しそうに選ぶ。<br /><br />俺「じゃあ俺はﾍﾞｰｺﾝﾚﾀｽでｗｗ」<br />彼女「ｼｪｲｸ飲もうよｼｪｲｸ！」<br /><br />はしゃいでる彼女を見るのは楽しかった。<br />何をしていても、本当に楽しそうにしていた。<br />席に着く。一息つく。<br /><br />彼女「ﾏｯｸこんなに美味しかったかなあｗ」<br />俺「久々に食うと美味いんだよねえ」<br />彼女「わたしはﾎﾟﾃﾄを欲しているよ」<br />俺「あるよ？」<br />彼女「ちがうよ、ほら」<br /><br />彼女は口を開けて促す。正直、ｱﾎである。<br />そして、俺が口にﾎﾟﾃﾄを入れてあげると、食べながら<br /><br />「１０点～！」<br /><br />などと意味の分からない事を言い出す。<br />俺もこれをやらされるﾊﾒになって、二人してﾏｯｸでｱﾎなことをしていたｗ<br />でも、楽しかった。<br />今思えば、俺は彼女のこういうところに惹かれていた。<br />一緒にいると、なんでも面白く思えて、笑いが絶えない。<br />時々本当にあほらしいことを言っては、笑顔になる。<br />それがすごく心地良かった。<br /><br />ﾏｯｸでの俺達は年甲斐もなくはしゃいでいた。<br />まわりに高校生やら大学生も多くいたと思うけど<br />その子ら以上に大笑いしていた。<br /><br />すると突然彼女が言った。<br />彼女「ねえ、煙草吸ってｲｲよ」&hellip;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと気になる続きが読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 1, 2, '0000-00-00', 1),
(71, 1, 14, '《長編》2chで話題になったゲーセンで出会った彼女の話【5/8】', '最後はハンカチ必須！！長編恋愛ストーリー。', 'love_fb_600.png', '', '', '<p><img src="/uploads/love_cont.png" alt="alt" width="100%" /></p>\r\n<div class="textarea">\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【5/8】</h1>\r\n<a href="/index.php/home/question?id=62">■第１話はコチラ</a><a href="/index.php/home/question?id=70"><br />■第４話はコチラ</a>\r\n<div class="textarea" style="text-align: left;"><br />彼女は、俺のﾍﾞｯﾄﾞに寝かせてあげた。疲れてるだろうし、明日もあるし、<br />なにより体調を崩さないかすごく心配だったので、俺たちは早めに寝ることにした。<br />俺は毛布をしいて、床で寝ることにした。明日も、ある。明後日も。<br />明後日も、終わったら、その次は&hellip;？<br />夜になると途端に辛くなる。<br />部屋で二人になると彼女に言われた。<br /><br />彼女「今日はすごく楽しかった。本当楽しかった。」<br /><br />かみしめるように言う。<br />彼女と日常を共にしていると、あの病室に帰ることが途端におぞましく思えた。<br />でも、彼女はもっと、ずっと、帰りたくないんだろう。<br />俺は彼女に「楽しかったよ。今日は疲れたし、早く寝よう。」<br />とだけ言ってから、ずっと考え込んでいた。<br />母と妹に、病気のことを言ってないのが辛かった。<br />正直、俺も誰かに相談したくてしょうがなかった。<br />彼女も寝て、妹たちも部屋にいるのを確認してから、俺は勝手口に一服しに行った。<br />電話をかける決心をした。<br />親父に電話をかけた。<br />俺はもう、誰かに話さないとどうしょうもなく辛くなっていた。<br /><br />親父「おう、どうしたｰ？」<br />俺「遅くにすまん、実は&hellip;」<br /><br />俺は、彼女のこと、彼女の病気のこと、今すごく不安なこと、<br />すべてを親父に赤裸々に離した。<br />男同士で、話したかった。聞いて欲しかった。<br />親父は多くは語らなかった。そして、俺に言った。<br /><br />「絶対、最後までそばにいてあげろよ。つらいと思う。<br />でもお前が弱音吐いちゃだめだろ。<br />いつだってそばにいてあげろ、男と男の約束だ。」<br /><br />親父は古風で、頑固な人間だった。<br />そんな親父の言葉は、俺の胸に強く響いた。<br />絶対に最後まで一緒にいよう。何が待ってるか、分からないけど。<br />青臭い小僧の俺が一人でずっと抱えていたことが、<br />親父に話したことで、とても軽くなった気がした。<br />俺は親父に話して、すっきりした。<br />部屋にもどると、さっきまでの不安が嘘のように、ｽﾑｰｽﾞに眠りに落ちた。<br />気付くと、窓から明かりがさしていた。<br />実家の俺の部屋は一つの窓にｶｰﾃﾝがなく、朝日は入り放題なのである。<br />起きると、彼女は俺の机で何かをしているようだった。<br />俺は寝ぼけていて、状況を読み込めず、目覚めて彼女がいること自体に驚いた。<br />朝飯を食べて、いざ出かけよう、となる。<br />前々から話していたが、彼女はとりあえず俺の育った町や場所を見て回りたいのだという。<br />俺は本当に楽しいのだろうか、と若干の不安があったが、<br />彼女がやっぱりどうしても、というのでそうすることにした。<br /><br />彼女「今日は一日動きまわるねｰ！」<br />俺「無理しちゃﾀﾞﾒだかんね。」<br /><br />俺はさっそく車のｷｰを握って車をだそうとした。<br />すると彼女は珍しくぐずった。<br />俺はよく分からなくて、車乗らないの？と聞く。<br /><br />彼女「自転車、あるよね&hellip;？自転車乗りたい」<br />俺「あ、そうなんだ。でも２台あったっけなｰ？」<br />彼女「そうじゃなくて。二人乗り&hellip;しようよ。」<br />俺「え？」<br />彼女「ずっとしてみたかったんだ&hellip;二人乗り」<br />俺「だめだよ、あぶないし、体に負担かかって疲れちゃうよ&hellip;」<br />彼女「わたし一度も二人乗りってしたことないんだよ&hellip;」<br /><br />そう言われると、弱い。<br />かくいう俺も人生で一度も二人乗りをしたことがなかった。<br />だから怖い、ということもあったのだが。<br /><br />俺「分かったよ。じゃあすぐ近くの俺の小学校まで、だけね。」<br />彼女「やったｰ！じゃあｸﾞﾛｰﾌﾞ持ってこうよ！」<br />笑顔になってはしゃぎだすのを見ていると、仕方ないかって思えた。<br />彼女は「どう座るんだ？」ってつぶやきながら荷台にちょこんと座って笑った。<br />俺「それでいいんじゃないかなｗ<br /><br />よし、じゃあ俺が乗るから一回降りて」<br /><br />彼女「やったｰ！」<br /><br />荷台に乗せて気付いたが、彼女は嘘のように軽かった。<br />家を出て、ろくに車も通らない農道のような坂道を下っていく。<br />彼女は、とてもごきげんだった。<br />彼女は歌い出した。<br /><br />「かｰみｰさｰまｰ！ひとつきいてくれよｰ！」<br /><br />それは彼女が好きだった藍坊主のﾃｰﾙﾗﾝﾌﾟだった。<br />俺も楽しくなって、一緒に歌う。<br /><br />「かｰぜｰきるｰ！あしをｰぼくにくれよｰ！」<br /><br />はたから見たら馬鹿丸出しなんだけど、<br />もう、どうでも良かった。<br />彼女はごきげんだった。色んな歌を俺に歌ってみせてくれた。<br />彼女は歌い終わると、<br /><br />彼女「こら、拍手しろ！」<br />俺「どうやってすんだよｗｗ」<br /><br />このやりとりを数回に渡って繰り返したｗ<br />そんなこんなで、近所の俺の母校の小学校に着いた。<br />土曜だったので、がらんとしていた。<br />少年野球のﾁｰﾑが、練習している以外、校庭もほかに人はいない。<br /><br />俺「懐かしいなあ～。ここでよく、野球したんだｰ」<br />彼女「そうなんだｰ。すごい広いね&hellip;」<br /><br />無駄に校庭だけは広い小学校だった。<br />彼女は少女のごとく駈け出した。<br />思いっきり走りだしたもんだから、印象的だった。<br />あまり息上がるのもよくないのにね&hellip;。<br /><br />彼女「こっちに来て！」<br />彼女「これ、うんていだよ、なつかしｰｗ」<br /><br />彼女は無邪気に色んな遊具で遊びはじめた。<br />彼女は滑り台の階段を上がって、俺が登ると滑り降りた。<br /><br />彼女「無限ﾙｰﾌﾟだ！」<br />俺「そうなの？ｗ」<br /><br />こんな調子だった。<br />俺たちは何故か滑り台の無限ﾙｰﾌﾟがﾂﾎﾞに入ってしまい、<br />いい年してしばらくそこで笑いながら滑り台に興じた。<br /><br />俺「いつまで経っても捕まらないｗｗ」<br />彼女「はやく追いついてｗｗ」<br /><br />こんな繰り返しだった。<br />しばらくすると冷静になって二人して、<br /><br />「え、これ何が面白かったの？」的な感じになった。<br /><br />遠くから少年野球の声が聞こえる。<br /><br />彼女「ねえ、あの少年野球にいたの？」<br />俺「うん、懐かしい。もうずっと前のことだけどね。」<br /><br />彼女はしばらくぼｰっと駆けまわる少年たちを見つめていた。<br /><br />彼女「ｷｬｯﾁﾎﾞｰﾙしよう。」<br />俺「大丈夫？無理しないでね。」<br /><br />彼女はまた歌い出す。<br /><br />「べｰすぼｰるのおとが鳴ったｰ、だれもぎゃらりｰいないぐらうんどｰってね。」<br />俺「何それ？」<br />彼女「知らないの？」<br /><br />彼女は音楽の造詣も深くて、たまに俺の知らない曲も歌う。<br />そうするとちょっとぐずるんだけど、そういう時は決まって<br />すぐｉＰｏｄとかで教えてくれる。<br />その曲はﾌｼﾞﾌｧﾌﾞﾘｯｸのﾍﾞｰｽﾎﾞｰﾙは終わらないだった。<br />「ﾌｼﾞﾌｧﾌﾞﾘｯｸか&hellip;」<br />その日はその曲にﾋﾟｯﾀﾘだった。<br />晴れ渡っていて、広いｸﾞﾗﾝﾄﾞに二人だけ。<br />俺はその曲に則って、「あとで炭酸飲料を買いに行こう。」<br />というと、彼女はやたら喜んだ。<br />「いくよ！」<br />俺がﾎﾞｰﾙを投げると、彼女はしっかりｷｬｯﾁ。<br />そしてｲｲ感じに返してくる。運動神経がよかったのか、<br />昔からあまり運動が得意でない俺はちょっとだけうらやましくもあり、楽しくなった。<br />ひとしきり小学校で遊ぶと、俺は彼女を連れて小学校の近くの駄菓子屋に行った。<br />正直、まだあるか不安だったけど、小学生の時はよく入り浸っていた。<br /><br />彼女「すごい&hellip;こういうのって本当にあるんだね。」<br />俺「ま、田舎だからね&hellip;ｗ」<br /><br />駄菓子屋のおばちゃんには可愛がってもらった。<br /><br />おばちゃん「はい、いらっしゃい。」<br />俺「こんにちは、富澤ですｰ」<br />おばちゃん「あら、富澤くん&hellip;久しぶりだねえ&hellip;」<br /><br />彼女も笑って、<br />「こんにちは」と言った。<br />３人でしばらく談笑した。<br />おばちゃんは、<br />「この前〇〇君来てさ&hellip;とか、〇〇先生がね&hellip;」<br />と懐かしい話をたくさんしてくるため、俺は楽しかった。<br />店を出る。<br />彼女は退屈だったかな、って思うと彼女は買った駄菓子を抱えながら<br /><br />彼女「すごいね&hellip;すごいね。あったかい。こういうの本当にあるんだ。」<br /><br />とすごく喜んでいた。<br /><br />彼女「富沢のこともっと知れた気がして嬉しいんだｰ<br />これが田舎かｰふるさとかｰ」<br /><br />彼女は高揚して何度も言っていた。<br />俺がいつも飲んでいたって教えてあげたﾁｪﾘｵを嬉しそうに飲んでいた。<br />そのあとは、彼女を連れて歩いて、疲れたら休んで、での繰り返しで<br />そこら一帯、俺にゆかりのある場所をめぐった。<br />路端の小川を指して、「中学の時この場所によく自転車をつっこんで走って、<br />水上自転車大会って<br />言って遊んだんだよ。」とか、<br />「このお宮にいつも初詣にきたんだ」とか、<br />「中学の通学路はここで、片想いの子が彼氏と歩いてるの見てｼｮｯｸ受けたんだｰ」とか。<br />それは、まったく中身のないしょｰもないﾂｱｰだった。<br />でも彼女は、「わｰすげｰ！」「こんな感じ？」<br />とか一つ一つ本当に生き生きとﾘｱｸｼｮﾝをとった。<br />小学校からさほど遠くない母校の中学校まで来て、彼女は突拍子も無いことを言い出す。<br /><br />彼女「毎日、ここの中学校に通ってたんだね&hellip;」<br />俺「そうなるね。いやｰなつかしいｗｗ」<br /><br />彼女は正門からの道を指した。<br /><br />彼女「で、ここを帰ったと&hellip;」<br />俺「うん、そうだね。」<br />彼女「わたしたち今から中学生ね、同級生の。ひゃｰどうしよう。」<br />俺「ええｰ！？」<br /><br />その日は時間が経つのも早く、時分はそろそろ夕方にさしかかろうと<br />している頃だった。<br /><br />彼女「あ、富澤くんだ&hellip;！ねえねえ、良かったら一緒に帰ろ？」<br />俺「そのﾉﾘ続けんのｰ？」<br /><br />急にこっ恥ずかしくなった。<br />彼女はこうなるとひかない。<br /><br />俺「吹石じゃん&hellip;ま、いいよ。帰ろうか？」<br />彼女「やったｰ！」<br /><br />彼女が手を差し出して手をつなぐ。<br />それまで幾度と手を繋いだことはあったけど、この時ばかりはなんていうか<br />すごく恥ずかしかった。<br />ちなみに、自転車は小学校に置いてあった。<br />普段爛漫な彼女が、この時は中学生になっていたのか、<br />急に無口になりだすもんだから、俺は焦った。<br />空も夕焼けに近づいて、俺は手に変な汗をかきそうだった。<br />俺たちには珍しく、話す言葉が浮かばなかった。<br />よく分からないけど、なんだかすごく初々しい気持ちになっていた。<br />彼女がそういう風にしていたからなのか、なんかいつもの調子とは違っていた。<br />どうせ自転車取りに行かなきゃ行けないから絶対行くのに、彼女は意味ありげに<br /><br />「ねえ、ちょっと小学校寄り道してこっか。」と言った。<br /><br />小学校につくと、彼女は疲れちゃったのか、校舎と校庭をつなぐ階段に腰掛けて<br />「ふう」と息を大きくはいた。<br />おれは気になって、「待ってて」と言ってすぐに自販で飲み物を買ってきて<br />彼女に手渡した。<br /><br />彼女「ごめんね、いつもいつも迷惑かけちゃって&hellip;」<br />俺「何言ってんのさｰｗおいしそうに飲んで笑顔を見せてくれたらいいんだよｗ」<br /><br />そう言うと、彼女はにっこり笑って、立ち上がった。<br />校舎の脇の犬走りにあったじょうろを持ちだして、水をくみ始めた。<br /><br />俺「？何すんのｰ？」<br /><br />彼女は、もう誰もいなくなった校庭に、じょうろで何やら描き始めた。<br />何をしているんだろう？<br />「ありがとう」<br />そこにはこんな文字が浮かび上がった。<br />俺はﾊｯとした。<br />急いで彼女のもとに駆け寄った。<br />そうすると彼女の方から抱きついてきた。<br />彼女は泣いていた。<br /><br />彼女「ずっと&hellip;これからもずっとずっと&hellip;一緒にいてくれますか？」<br /><br />彼女の言葉が脳内をこだました。<br /><br />俺「ずｰっと一緒にいるよ。ずっとね。」<br /><br />俺は深く抱きしめた。<br />彼女が泣き止むまで、頭をを撫でながら、<br />彼女は泣きながらも「うぇ&hellip;わんわん&hellip;」とおどけて見せた。<br />俺は、心が傷んだ。<br />俺はこの子にこれから何をしてやれるんだろう？<br />一緒にいて、共に歩く、それしかないと分かりながら。<br />彼女は半泣きのまま、背負っていた小さなﾘｭｯｸから、何やら取り出そうとした。<br /><br /><br />彼女が取り出そうとしたものは。。。。。。。。。<br /><br />続きは明日の22時に公開します！！</div>\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<br />\r\n<div class="textarea"><a href="/index.php/home/question?id=62">■第１話はコチラ</a><br /><a href="/index.php/home/question?id=70">■第４話はコチラ</a></div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;&darr;こちらもオススメ！！！&darr;&darr;&darr;&darr;</p>\r\n<p style="text-align: center;">■その他のおすすめの恋愛ストーリー</p>\r\n<p style="text-align: center;">自分が交通事故で歩けなくなりました。<br />あなたは恋人に相談できますか？<br />それともこっそり別れを告げますか？</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=49">泣ける恋愛ストーリー【わかれよう。。。。】</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">突然の彼の死。<br />彼が恋人に送れずに未送信のままになっていた大量のメールの内容とは&hellip;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=48">【感動する恋話】未送信のメール。</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 207, '<div class="textarea">\r\n<h1><img src="/uploads/love_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【5/8】</h1>\r\n<p><a href="/index.php/home/question?id=62">■第１話はコチラ</a><br /><a href="/index.php/home/question?id=70">■第４話はコチラ</a><br /><br />その日は、ｶﾚｰだった。<br />ｳﾁのｶﾚｰはﾚﾄﾙﾄは使わず、ｽﾊﾟｲｽとかも使って、<br />無意味に凝っているものだった。<br />みんなで食卓に着く。<br />俺は若干の気まずさを隠しきれなかったｗ<br /><br />彼女「こんなに本格的なｶﾚｰ、おうちで作れちゃうんですね～」<br />母「まｰこだわりだすとｷﾘがないのよね」<br /><br />母さんは鼻高々だった。<br /><br />彼女「おいしい！美味ですよこれ！」<br /><br />彼女が笑ってそういうとみな口々においしいと言い出した。<br />俺「うん、やっぱりおいしいね。」<br />妹「たしかに美味、だねｗ」<br /><br />ご飯が進みだすと、妹と母さんが動き出す。<br /><br />母さんは、「うちの息子の何がよかったの～？」<br /><br />とか笑いながら聞き出すし、<br />妹は妹で、彼女がｵﾀ気質であることを知ると、<br />途端に自分の好きな漫画とかの話を振りだす。<br />彼女は彼女で、「わたし一発芸とかできるんです」とか<br />ﾜｹの分からないことを言い出すし、そうするとうちの妹も悪ﾉﾘしだすし、<br />色々とてんやわんやなんだけど、楽しかったよ。<br />初めて食卓を共にしたのに。<br />そのあとも、妹が「今日は面白いﾃﾚﾋﾞやってないから」と<br />言い出してｱﾒﾄｰｸのDVDを見だしたりした。<br />妹は終始馬鹿笑いしていて、<br />彼女も「正気ですか！？」とかｹﾝｺﾊﾞのものまねを始めだして、<br />母さんがなんか果物食べる？と聞けば<br />彼女は味をしめて「正気ですか！？」と返したり、<br />いや、楽しかったんだよ。本当に。<br />夜も更けて、そろそろ寝る体制に入る。<br /><br />これから、彼女との"夜"が始まる。。。。</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと気になる続きが読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 2, 3, '0000-00-00', 1);
INSERT INTO `questions` (`id`, `app_type`, `app_id`, `title`, `description`, `image`, `scenario`, `contents`, `anwser_result`, `permissions`, `fb_page_id`, `fb_page_url`, `fb_page_title`, `count`, `intro`, `count_today`, `count_month`, `count_day`, `is_publish`) VALUES
(72, 1, 14, '《長編》2chで話題になったゲーセンで出会った彼女の話【6/8】', '最後はハンカチ必須！！長編恋愛ストーリー。', 'love_fb_600.png', '', '', '<p><img src="/uploads/love_cont.png" alt="alt" width="100%" /></p>\r\n<div class="textarea">\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【6/8】</h1>\r\n<a href="/index.php/home/question?id=62">■第１話はコチラ</a><a href="/index.php/home/question?id=71"><br />■第５話はコチラ</a>\r\n<div class="textarea" style="text-align: left;"><br />帰り道は、二人で大合唱だった。<br />夕闇、宵の口はﾃﾝｼｮﾝが高揚する。<br />「ほｰしｰになれたらいいなｰ！」<br />歌い合うと、あまりのひどさに二人で爆笑した。<br />彼女の魅力と言ったら、俺の知らないことをいっぱい知ってて、<br />俺にできないことがいっぱいできて、一緒にいるとどんなものを見せてくれるか分からない<br />そういうところにあった。<br />この帰り道でも俺の前で急にﾀｯﾌﾟﾀﾞﾝｽを披露して<br />「こういうｽﾃｯﾌﾟがあってねｰ」と突然言い出したり、<br />空のｸﾞﾗﾃﾞｰｼｮﾝを見ては、こういう色合いの空を油絵で表現するときは<br />まずどんな色をおいてｰ、と色々嬉しそうに語ってくれた。<br />そのすべてを面白く感じさせてしまうのも、本当に彼女だからこそだった。<br />いつも早くのぼりきりたい坂道が、彼女といると永遠に続けとさえ思った。<br />振り返ると、空はとっぷり暮れていて、月があった。<br />彼女は「三日月さんが逆さになってしまった！」と叫んだ。<br /><br />俺「今日も、楽しかったねｰ」<br />彼女「うん、昨日もだけど、すっごいすっごい楽しいよ。」<br /><br />そういって道を進んで行って、とうとう我が家に着く。<br />これで、今日も終わってしまう。<br />楽しい時間なんて、すぐに終わってしまう。<br />家に着くと、昨日とは変わって母さん一人が<br />夕飯の支度をしていた。<br /><br />俺「ただいま」<br />彼女「お邪魔します」<br />母「はいおかえりｰ」<br /><br />歌いすぎた俺たちは些か声が枯れ気味だった。<br />妹は、俺たちが帰ってくるなり部屋からとびだしてきた。<br /><br />妹「お二方帰ってまいりましたか！ｱﾂｱﾂなことで！」<br />彼女「ただいま帰りました！留守のあいだ異常はなかったか？」<br />妹「異常なしですｗｗ」<br /><br />この二人、もうすっかり気が合うようだった。<br />すると妹は「見せたいもんがあるんです」と彼女だけを部屋に連れてった。<br />俺はなんのことか察しがついた。<br />妹は服飾の専門でよく自作で衣装を作ってたから、それを見せたいんだろう。<br />俺に見せたって仕方ないし、同年代の女の子に見てほしいんだろう。<br />夕飯の時、彼女は興奮していた。<br /><br />彼女「妹さんすごいですね！可愛い衣装たくさん作ってて&hellip;わたしは服飾は専攻してないけどとても感激でした！」<br /><br />妹は終始ﾄﾞﾔ顔だった。<br />妹と彼女は本当に気が合うようで、それだけで彼女を実家に連れてきて良かったなあって思えた。<br />母さんは母さんで、<br />「うちの子になっちゃいなよ、娘増えたほうが嬉しいわぁ、富澤とﾁｪﾝｼﾞで」<br />とか言い出すし、まあ男俺一人だから大変だったけど、それはそれで楽しかった。<br />晩御飯も一段落して部屋に戻ると、彼女は俺に聞いてきた。<br /><br />彼女「今日は富澤の育った場所見れて楽しかったなぁ」<br />俺「いいとこだったでしょｰ」<br />彼女「ねえねえ、わたしが育った場所も見てみたい？」<br /><br />それは意外な一言だった。今まで決して過去を語ろうとしなかった彼女だから、<br />俺はｹﾞｰｾﾝで会う以前のことはあまり聞こうともしていなかった。<br /><br />俺「正直、すごく見に行きたい。」<br />彼女「じゃ、さ。明日は朝早く向こう戻って、色々巡ってみよう。行ったり来たりの渡り鳥だね～！」<br /><br />彼女は手を広げて羽ばたくような仕草をしてみせる。<br />そういうことになった。<br />さすがに強行日程すぎないか？と思いつつ俺は彼女に早く寝て休むように促した。<br />俺たちは無駄に早起きした。<br />日曜だったので母さんも妹もまだ起きてはいなかった。<br />すると彼女は、「ｱｲｱﾝｼｪﾌの出番だｰ！」などと言い出し、<br />俺は「きたれ、ｱｲｱﾝｼｪﾌ！」というｺﾝﾄを朝からやらされた。<br />彼女はふざけながらも朝ごはんを作る、といって張り切り、<br />二人で一緒に朝ごはんを作った。<br />ﾍﾞｰｺﾝを焼いてｽｸﾗﾝﾌﾞﾙｴｯｸﾞを作って、<br />野菜を切るくらいのことだったが、俺は楽しくて仕方なかった。<br />一緒に住んでいたり、夫婦の人は、ずっとこういう日が続くのか<br />いいなぁ、と俺は思っていた。<br />二人でﾊﾞｶ笑いしながら騒がしくご飯を作っていたから、<br />妹も母さんも起きてきた。<br />今日は俺たち二人で作る、と言い張って<br />妹はﾃﾚﾋﾞの前、母さんは洗濯を始めた。<br />ああ、普通の生活だなってしみじみ思った。<br />朝ごはんを食べながら俺は不肖にも<br />「これは彼女の手料理&hellip;」と思いながら食べていた。<br />朝ごはんを食べたらすぐ家を出る旨を母さんと妹に伝えると<br />「さみしいねｰ」「もっといればいいじゃないｰ」と言われた。<br />そうしたいのは山々だよ、と俺は悔しかった。<br />もっと時間があればもっとゆっくりしていた。<br />この時ばかりは彼女と俺もただただ顔を見合わせるしかなかった。<br />荷物をまとめて、家を出る。<br />妹が車を出してくれた。<br />車に乗って、坂をくだる。妹が、「また来てくださいねｰ」と言うと<br />彼女がぼそっと「また来れるかな&hellip;」<br />と言ったのが心を突いた。<br />何もかも、次があるのか分からない。<br />彼女自身も、その不安と悔しさと戦っていたのかもしれない。<br />また、特急列車に乗る。２時間ほどの旅。<br />そこから在来線で１時間ほど。<br />それほど長い旅ではないのだが、特急を降りた辺りで彼女の様子がおかしかったことには気付いた。<br />口数が減っていたのだ。<br />彼女は、自分から弱音を言うことは無い人だから、俺は嫌な予感がしていた。<br />在来線になると人が多くて座れなくなる。<br />俺は、途中駅で彼女を下ろした。彼女は「なんで？」という顔をしていたが、<br />とりあえずﾍﾞﾝﾁに座らせた。<br /><br />俺「ねえ、大丈夫？様子が変だよ。無理してない？」<br />彼女「どうして？平気だよ？」<br />俺「いい？一番大切なのは何よりも体なんだよ？少しでも何かあったら言って」<br /><br />彼女は悔しそうに言った。<br /><br />彼女「あのね&hellip;少しだけ吐き気がするの&hellip;でも本当に少し。でも言ったら絶対心配かけちゃうと思って&hellip;」<br /><br />俺はやられた、と思った。大袈裟かもしれないが一気に血の気の引いた俺は、<br />「歩ける？」と聞きつつも彼女を揺らさないように強引におんぶして、改札をぬけた。<br />彼女は必死で「大丈夫だよ！電車に乗ろ！」と言っていたが、<br />俺は電車は座れないし人も多いからもうﾀﾞﾒだ、と思っていた<br />彼女を傷つけたらだめ、少しでも無理させたらﾀﾞﾒ、そう決めていた俺は必死だった。<br />もし何かあったら全てｵﾚのせいだ、そう思っていた。<br />駅を降りて、必死でﾀｸｼｰを止める。<br />さすがの彼女も諦めて、<br />「ごめんね&hellip;ごめんね&hellip;」と繰り返していた。<br />俺は必死だった。<br />俺「急いで、〇〇方面に向かってください！」彼女の自宅だった。<br />この時、ﾀｸｼｰの運転手がすごく良い人だったのが印象的だった。<br />彼女のことを車酔いか酒酔いをした人だと思っていたのか、<br />水飲む？といってﾍﾟｯﾄﾎﾞﾄﾙくれたり、<br />近道しますよ、といって渋滞の抜け道をしてくれたり。<br />初老の白髪のじいちゃんだったのだが、動転して入ってきた俺をなだめ、<br />落ち着かせてくれた。終始Jﾘｰｸﾞの話をしていて、お若い方だった。<br />彼女はﾀｸｼｰの中で涙目だった。俺はずっと肩を抱いていた。<br />窓を開けて車で走っているｳﾁに、彼女の口数も増えてきて俺は安心していた。<br />彼女の家につく頃には、彼女にはだいぶ笑顔がもどってきていた。<br />俺は胸をなでおろした。<br />彼女はﾌﾗﾌﾗ歩き出した。<br /><br />俺「こら、そんなに焦って歩いちゃﾀﾞﾒだよ」<br />彼女「ここが、我が家です！でもどうせ呼ぶつもりだったから」<br /><br />と笑って玄関先に立ってみせた。<br />俺は彼女の父さんと母さんに事情を話した。逐一電話報告もしていたが、<br />叱られることも重々覚悟の上だった。<br />しかし、ここまで一緒に来てくれてありがとう、と言われた。<br />とても、申し訳ないことをしてしまった気持ちになった。<br />大事をとって、彼女は少し横になって休ませることにした。<br />「富澤とわたしの母校に行くのｰ！」と言ってきかなかったが、<br />一番大事なのは体調だ。決まってる。<br />みんなで説得して、なんとか彼女を寝かせた。<br />そのかわりに俺は彼女が目覚めるまで家にいて欲しいと言われ、家にいることになった。<br />しばらく彼女が部屋で寝ているのを見守っていたが、居間におりて<br />彼女のお父さんとお母さんと話した。<br />空気は重かった。あまり話すことも見当たらないんだ&hellip;<br />とりあえず俺は、今日はすいません、と真剣に謝った。<br /><br />母「気にしないでね。」<br />父「君はいつもいつも、娘の病室にやってきてくれるね。君が来てくれるから、あの子はいつも本当に楽しくやっていられる。謝りたいのは、ろくに何もできないこっちだよ。」<br /><br />俺は、黙っていた。何を言っていいかまったく思いつかなかった。<br /><br />母「あの子、本当にいつもいつも富澤君のこと話してくれるのよ。富澤くん、私にもよくﾏﾒに連絡くれるでしょ。本当にありがとうね」<br /><br />真面目な話はこれくらいだった。そのあとは、それを忘れたいかのように<br />ﾃﾚﾋﾞを見ながら、他愛もない世間話をしていたと思う。<br />しばらくすると彼女が起きてきて、<br />俺を部屋に手招きした。<br />「もう、すっかり良くなったから。部屋で話そ」と言われた。<br /><br />彼女「今日はごめんね&hellip;。行きたいところたくさんあったのに&hellip;」<br />俺「それは仕方ないよ。でも吹石がなんともなくて本当に良かった。<br />それだけで俺は嬉しいよ。<br />辛い時は、辛いって言わなきゃだめだからね？」<br /><br />そうすると彼女は揚々と歌い出した。<br />「愛とはあなたのためだととかいったらｰ！うたがわれるけどｰがんばっちゃうもんねｰ！！」<br />そう歌ってにっこり笑った。それはｲｴﾓﾝのlove love showだった。<br /><br />俺「頑張っちゃうんだｗ」<br />彼女「うん、頑張る。」<br />彼女「だからさ、今日は聞いて欲しいんだ。」<br />彼女「今日はわたしの育った場所まわれなかったから、私の昔話をしますｰぱちぱち」<br />俺「きかせてもらおうじゃないか」俺も若干の悪ﾉﾘをしていた。<br />彼女「結論から言ってわたし中学行けてないです」<br /><br />そう言って彼女は苦笑いをこぼした。<br />俺は驚いたけど、「なにかあったんだ？」と優しく尋ねた。<br />俺は、彼女の話に耳を傾けることにした。<br /><br />彼女「わたし、中学の時体弱かったんだｰだからね、しょっちゅう学校休んでたんだｰ。」<br />彼女「本当にね、すぐ体壊しちゃうから。でもさ、あまりに頻繁に学校休んでるうちに、ういちゃってさｰ」<br /><br />彼女は笑いながら話しているけど、辛そうだった。<br /><br />彼女「学校行くとさｰ。誰もまわりにいなくなってて&hellip;昼ぐらいから行くと、給食泥棒とか言われちゃってさｗ」<br /><br />俺は黙って彼女の目を見続けた。<br /><br />彼女「いじめられてたとか、あんまり言いたくないんだけどさ。ある日行ったらわたしの机ごとなくなってたんだｰ。それで、あれ？学校くるんだ？とか言わちゃって。」<br />彼女「それから中学には行けなくなっちゃった。」<br />彼女「その頃なんだなｰ。友達もいなくてさｰ。お兄と一緒にｹﾞｰｾﾝ行くのだけが本当に楽しかったよ。ｱｹｹﾞｰの人とのつながりとか、楽しさの共有とか、わたしは肌で感じた。」<br /><br />俺はぐっと涙をこらえていた。<br /><br />彼女「そこでね、本当に色んな人に会えたんだよ。」<br />彼女「わたしね、高校からは私立に行ったんだけど」<br />彼女「てて子、覚えてる？あの子とも本当に偶然ｹﾞｰｾﾝで会ったの」<br /><br /><br />続きは明日の22時に公開します！！</div>\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<br />\r\n<div class="textarea"><a href="/index.php/home/question?id=62">■第１話はコチラ</a><br /><a href="/index.php/home/question?id=71">■第５話はコチラ</a></div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;&darr;こちらもオススメ！！！&darr;&darr;&darr;&darr;</p>\r\n<p style="text-align: center;">■その他のおすすめの恋愛ストーリー</p>\r\n<p style="text-align: center;">自分が交通事故で歩けなくなりました。<br />あなたは恋人に相談できますか？<br />それともこっそり別れを告げますか？</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=49">泣ける恋愛ストーリー【わかれよう。。。。】</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">突然の彼の死。<br />彼が恋人に送れずに未送信のままになっていた大量のメールの内容とは&hellip;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=48">【感動する恋話】未送信のメール。</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 26, '<div class="textarea">\r\n<h1><img src="/uploads/love_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【6/8】</h1>\r\n<p><a href="/index.php/home/question?id=62">■第１話はコチラ</a><br /><a href="/index.php/home/question?id=71">■第５話はコチラ</a><br /><br />彼女は、ﾘｭｯｸから色紙をとりだした。<br />そこには、俺があげたCOACHのﾃﾞｻﾞｲﾝのﾈｯｸﾚｽをして笑っている女の子が描かれていた。<br />そしてわきに、「富澤へ。いつもいつもありがとう。」という文字と日付が書かれていた。<br /><br />彼女「それね、私が考えたｵﾘｼﾞﾅﾙｷｬﾗなんだ。<br />ﾈｯｸﾚｽ、すごい嬉しかったから。お礼にね、描いたの。ありがとう。」<br /><br />そういって涙目で笑って俺に色紙を渡した。<br />朝、机で何かしていたのはそういうことだったのか。<br />俺は、本当に嬉しかった。<br />今までもらった中で、これほど嬉しいものはないと言っても過言ではないくらいだった。<br />俺は、涙をこらえて、「ありがとう」と言った。<br />渾身の、心からのありがとうだった。<br />その絵は暖かくて、彼女自身のようにも思えた。<br />彼女の頭を撫でると、彼女は楽しそうに「わんわん！」と言った。<br />なんだかそれがとってもおかしくて、さっきまで泣いていたのに<br />二人して大笑いした。<br />もう楽しくなって、叫びながら校庭を二人で走りまわった。<br />もう辺りもすっかり夕焼けになっていて、徐々に暗くなりだしていた。<br />帰り道は上り坂だったので、俺が自転車をひいて、二人で歩いて帰った。<br />一番星が見え出していた。<br />彼女は「一番星！」と言うと、また歌い出した。<br />「さようならｰあえなくなｰるけどｰさみしくなｰんかｰないよｰ！」</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと気になる続きが読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 1, 2, '0000-00-00', 1),
(73, 1, 14, '《長編》2chで話題になったゲーセンで出会った彼女の話【7/8】', '最後はハンカチ必須！！長編恋愛ストーリー。', 'love_fb_600.png', '', '', '<p><img src="/uploads/love_cont.png" alt="alt" width="100%" /></p>\r\n<div class="textarea">\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【7/8】</h1>\r\n<a href="/index.php/home/question?id=62">■第１話はコチラ</a><a href="/index.php/home/question?id=72"><br />■第６話はコチラ</a>\r\n<div class="textarea" style="text-align: left;"><br />彼女「ありゃりゃ、わたしそんな泣くほど感動するほど凄いこと言ったか&hellip;？」<br /><br />と彼女は動揺した。<br />俺「絶対叶えようね、その夢&hellip;」って言いながら俺は泣いてた。<br />そうすると彼女もぼろぼろ泣き出して、<br />二人してわんわん泣いてしまった。<br />泣きながら抱き合った。<br />この時ばかりは俺も運命という言葉を信じた。<br />あの日、たまたまｹﾞｰｾﾝに行って、偶然彼女を見つけて、<br />柄にも無く、自分から話しかけた。<br />あの日、まっすぐ家に帰っていたらどうなっていた？<br />俺はこの時彼女を一生守ろうと心に決めた。<br />これからどんなことが待っていようと、決心した。<br />それと同時に俺の中で、彼女にしてあげたいことが一つ増えた。<br />俺はその日は彼女が切望するので、彼女宅に泊まることにした。<br />彼女のお父さんと一杯やった。<br />彼女がﾋﾞｰﾙをついでくれて、なんだか新婚にでもなった気分だった。<br />そのあと、なんとなく居間のｿﾌｧで寝ることにした。<br />彼女といられる日常の時間が、少しでも多く続いて欲しかった。<br />その次の日も、結局俺は彼女宅にいることになったんだけど、<br />彼女はお父さんとお母さんと買い物に行くようで、<br />ついていったけど俺はなるべく家族水入らずを邪魔しないように徹していた。<br />荷物持ちとかしつつ、会話を聞く役目に徹していた。<br />俺はもう、十分彼女との日常を満喫した。<br />お父さんとお母さんだって、娘と過ごしたいに決まってる。<br />俺は流石に、空気を読んで最終日までいるのは避けた。<br />４日目の夜に、家に帰ることにした。<br />彼女とお母さんが作ってくれた晩御飯を食べて、俺は彼女宅を出ることにした。<br />彼女は、５日目の夜に病院に帰るという。<br />俺は、その次の朝に会いに行く約束をした。<br /><br />俺「じゃあ、家族団らんを楽しんでね。」<br />彼女「もっといてもいいのに。」<br />俺「いや、明日で最後だし、お父さんとお母さんも俺がいたら色々やりづらいこともあるでしょ。」<br />彼女「次に会うのは、また病室だね。」<br /><br />俺は黙った。<br />彼女「絶対、会いに来てね。待ってるから。」<br /><br />彼女とずっと一緒にいて、離れると、とんでもないほどの虚無感に襲われた。<br />あれ、俺の日常って、こんなに何もなかったか？<br />と思うほどに電車の中でも、家に帰ってからも無気力になり、何もかも手につかなくなった。<br />無理もなかった。今まで不可能だった、彼女と普通の日常を送る、<br />ということが俺にとって楽しすぎて、本当に心地良かったからだ。<br />色々思い描いた。彼女が完治して、もう一度普通の生活をして、<br />一生、平凡に暮らしていくのを想像した。<br />彼女が病院に戻った朝、俺は一目散に駆けつけた。<br />早く、会いたかった。<br />俺は花を持っていった。<br />彼女の好きなﾄﾙｺｷｷｮｳ。<br />病院にもどってすぐ花ってのもどうかと思ったが、少しでも彼女の気が紛れるなら、と思った。<br />病室に着くと、彼女に「ようこそ」と言われた。<br /><br />彼女「なんでだろう、やっぱり変に落ち着くねｗ」<br /><br />また、籠の中に戻されてしまったような気しか、俺にはしなかった。<br />それからの日々は割と穏やかに進んでいったと思う。<br />でも、俺は残された時間が迫ってきているのを感じていた。<br />病室で彼女に会えない時間が、苦しくて仕方なくなってた。<br />頻繁に病院に泊まるようになった。<br />いつのまにか、大学はまったく行かなくなっていた。<br />彼女が病院にもどってからしばらくすると、俺の誕生日が近づいていた。<br />そして、その約一ヶ月後に、彼女の誕生日だった。<br />俺は自分の誕生日の日にも、いつもと変わらず病室に向かった。<br />彼女にはちょろっと教えていたが、前日にも何も言われなかったし、<br />きっと忘れているだろうな、と思ってた。<br />病室に着くと、彼女がﾆﾔﾆﾔしていた。<br />その日はいつもよりだいぶ元気そうで、俺は驚いた。<br />彼女のお母さんが冷蔵庫からｹｰｷの箱を取り出して、<br />小さなｼｮｰﾄｹｰｷを３つ取り出す。彼女は「おめでとう！」と言った。<br />俺が「ありがとうｰ」とﾋﾞｯｸﾘして言うと彼女はそのまま歌い出した。<br />「きょうはとくべつなよるさｰ！すてきなｰゆめをみれたらなｰ！」<br />それはﾌｼﾞﾌｧﾌﾞﾘｯｸのbirthdayだった。<br />歌ってこちらを見て笑った。<br />ありがとう、と言って頭を撫でると、彼女は「わんわん」と小さく言った。<br />お母さんがいるから恥ずかしかったのだろうか。<br />俺は、彼女と会ってから少しでも彼女の片鱗を感じたくて、<br />彼女が良いと言った音楽や本は、家にいる時に狂ったようにﾁｪｯｸしていたから、<br />その曲もﾌｼﾞのそれだと、すぐ気付いた。<br />彼女「ﾌﾟﾚｾﾞﾝﾄがあるのです」<br />そう言って彼女は俺にﾏﾌﾗｰを渡した。<br />彼女「それ、わたしの使ってたﾏﾌﾗｰなんだ。これから寒くなるでしょ？<br />ここに来てもらうのに、風邪ひいたりとか心配だし&hellip;」<br /><br />俺「うわｰありがとう！」<br />彼女「あとね&hellip;」<br /><br />お母さんが何やら包みから取り出す。それは格ｹﾞｰのｱｹｺﾝだった。<br /><br />彼女「これでもっと練習してねｗ」<br /><br />俺は思わず吹き出してしまった。<br />素敵な誕生日だった。<br />病院にいながら、病気と闘いながら、どれだけ俺のことを思ってくれていたんだろう。<br />彼女の笑顔を見ながら、俺は決心した。<br />その日の後、俺は彼女が元気な日にそっけなく聞いた。<br /><br />「やっぱり、ｳｪﾃﾞｨﾝｸﾞﾄﾞﾚｽとかって、女の子は憧れるの？」<br />彼女「それは憧れるよｰ！真っ白だしね。なんで？着せてくれるの？ｗ」<br />俺「いや&hellip;ｗなんとなく聞いただけ」<br /><br />彼女の誕生日まで、あと少しだった。<br />俺は、すぐさま実家に帰って妹に相談した。<br />ｳｪﾃﾞｨﾝｸﾞﾄﾞﾚｽのような衣装が作りたい、と妹に相談した。<br />妹は不審そうにしていた。<br />けど、ﾜｹを話せることもなく、大学のｻｰｸﾙで必要なんだとかそれっぽい<br />理由をつけて、どうにかこうにか生地選びや作り方まで、一から聞いた。<br />何かできるなら、もう今しかない、そう思って必死になっていた。<br />悠長なことは言っていられなかった。本当に必死だった。<br />結果、不器用な俺には歯が立たず、かなり妹の力を借りて、<br />純白なﾄﾞﾚｽを作ったのだった。<br />それでも俺は妹と一緒に生地を買いに行ったり、生地を切ったり、<br />一緒にどういうﾃﾞｻﾞｲﾝにしたいか草案を考えた。<br />二週間くらい、作るのに時間がかかってしまった。<br />俺はその間も、実家と彼女の病院を行き来したりしていた。<br />その出来は、決していいものではなかった。でも、白いﾄﾞﾚｽの形にはなっていた。<br />ｳｪﾃﾞｨﾝｸﾞﾄﾞﾚｽと言えば、そう見えないこともない。<br />手伝ってくれた妹には、本当に頭があがらない。<br />俺はこれを着た彼女の姿を想像して、ついつい口がにやけてしまった。<br />ﾄﾞﾚｽが出来上がったのは、彼女の誕生日の二日前の事だった。<br />ﾄﾞﾚｽ作りは間に合った。<br />完成したときは嬉しくて本当に泣きそうになった。<br />俺は、それを宅配便で送るつもりでいたが、もう時間も迫っていたので<br />大きな紙袋にいれて、自力で、向こうの自分の家まで持っていくことにした。<br />このときは本当に寝不足続きで、目薬とﾌﾘｽｸが手放せなかった。<br />彼女の誕生日の日がやってきた。<br />まず、彼女の調子がよければいいが。行っても寝ている時が増えていたのだ。<br />そして俺は重大なことに気づく。<br />「俺、自分のﾀｷｼｰﾄﾞとかねえじゃん&hellip;」<br />俺は仕方なく、ｽｰﾂで行くことにした。ちょっと洒落たﾈｸﾀｲをすればいいだろう。<br />俺は、紙袋にﾄﾞﾚｽと想いを込めて、家を飛び出した。<br />そして、この日は俺にとって忘れられない日となる。<br />俺は途中でいい感じの花束を買っていった。<br />ﾌﾞｰｹのつもりだった。<br />気分は新郎。楽しい気分で一杯だった。<br />病室に着く。彼女は、起きていた！<br />俺は心のなかで「やった」と思うと、彼女に向かって<br />「誕生日おめでとう！！」と言って花束を渡した。<br />彼女は一度「わっ」と言うと笑顔で<br />「嬉しいｰ！ありがとう～！」と言った。<br />笑顔が返ってくるのが嬉しくて、嬉しくて、もう仕方なかった。<br /><br />彼女「ｽｰﾂなんて気合い入ってるねｰｗ」<br />俺「ちっちっちっ。今日はこれだけじゃないんですよ」<br /><br />正直緊張で胸がやばかった。<br />俺は紙袋から、想いを詰めたﾄﾞﾚｽを取り出す。<br />「じゃｰん！」<br /><br />彼女「え！え！何これ！！ｳｪﾃﾞｨﾝｸﾞﾄﾞﾚｽ！？」<br />彼女は途端に興奮して目をｷﾗｷﾗと輝かせた。<br />彼女「え、え、え、どうしたのこれ！？」<br />俺「俺が作ったんだｰｗ」<br /><br />俺は照れながら、誇らしげに答えた。<br /><br />俺「着てみる？」<br />彼女「うんうん、着る着る！！」<br /><br />少し、大変だった。お母さんとか看護婦さんを呼んで、<br />どうにか彼女が着替えられる体勢にした。<br />その後、<br /><br />彼女「着替えるから待っててね。」<br />といわれてｶｰﾃﾝが閉じられた。新婦のお色直しを待つ、新郎のような気分だった。<br />彼女「できたよｰ！」<br /><br />ｶｰﾃﾝが開いたその向こうには、<br />俺の作ったちょっぴり不格好な純白のﾄﾞﾚｽを着て、はにかむ彼女がいた。<br />「似合ってるでしょｰ？」<br />と彼女は笑いながら俺に尋ねた。<br />俺は、この日見たこの光景を一生忘れることはない。<br />彼女は、ただただ、綺麗だった。<br />嫌なことも辛いことも、何もかもがふっとんだ。<br />俺は彼女の手をとった。<br />そうすると、彼女は歌い出した。<br />「ばたふらいｰきょうはｰいままｰでｰの」<br />「どんなｰときよｰりすばらしいｰ！」<br />木村ｶｴﾗのbutterflyだった。その歌は、彼女が歌い出すと<br />近くにいた看護婦さんまで歌い出した。<br />４人部屋だったんだけど、病室の人たちは笑って手拍子をしていた。<br />俺は彼女に向かって言った。<br /><br />俺「一生にそばにいるね。」<br />彼女は「わたしも。」<br /><br />と小さく頷いた。<br />そういう流れだったのか、恥ずかしくて仕方なかったけど、<br />俺たちはお母さんやら患者さん、看護婦さんたちの前で<br />小さくｷｽをした。唇が触れ合うくらいの、優しいものだった。<br />そして何より、これが彼女との初めてのｷｽだった。<br />自然と拍手みたいのが起きてしまって、とても恥ずかしかった。<br />俺たちはお互いに見あって、笑いあった。<br />ｷｽしたらそれがおかしくて、ふたりで笑いが止まらなかった。」<br /><br /></div>\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<br />\r\n<div class="textarea"><a href="/index.php/home/question?id=62">■第１話はコチラ</a><br /><a href="/index.php/home/question?id=72">■第６話はコチラ</a></div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;&darr;こちらもオススメ！！！&darr;&darr;&darr;&darr;</p>\r\n<p style="text-align: center;">■その他のおすすめの恋愛ストーリー</p>\r\n<p style="text-align: center;">自分が交通事故で歩けなくなりました。<br />あなたは恋人に相談できますか？<br />それともこっそり別れを告げますか？</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=49">泣ける恋愛ストーリー【わかれよう。。。。】</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">突然の彼の死。<br />彼が恋人に送れずに未送信のままになっていた大量のメールの内容とは&hellip;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=48">【感動する恋話】未送信のメール。</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 31, '<div class="textarea">\r\n<h1><img src="/uploads/love_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【7/8】</h1>\r\n<p><a href="/index.php/home/question?id=62">■第１話はコチラ</a><br /><a href="/index.php/home/question?id=72">■第６話はコチラ</a><br /><br />彼女「中学の時ｹﾞｰｾﾝで出くわしてね、当時って、まだそんなに若い女の子とかｹﾞｰｾﾝにほとんどいなかったの。だからお互いに気になって話したら意気投合して」<br /><br />俺は話しいることが信じられなかった。彼女にとってｹﾞｰｾﾝという存在が<br />ここまで大きいなんて、にわかには信じられなかった。<br /><br />彼女「そしたらてて子は中高一貫の私立に通ってる子で、少し遠いけど私はその高校に行こうって決心した。」<br />彼女「当時はね、うちの近くにもｹﾞｰｾﾝがあったんだ。っていうか、今よりずっとずっとあった。今は少なくなったよ。」<br />彼女「わたしはそこが好きだった。店長さんも優しくて、常連さんもたくさんいた。たまにﾔﾝｷｰとかもいたけど、大して気にならなかった。てて子もね、うちの近くに住んでたんだ。」<br />俺「今、そのｹﾞｰｾﾝは&hellip;？」<br />彼女「ないよ。潰れちゃった。」<br /><br />彼女は苦笑いした。<br /><br />彼女「それからは、高校は女子高だったけどとても楽しかったよ。」<br />彼女「いつもわたしがばかなこと言ってたけどｗ」<br /><br />彼女の持ち前の明るさやｱﾎなところはそこに由来するのかなあと思った。<br /><br />彼女「だからね、わたしこんなにｹﾞｰｾﾝが好きなんだｰ。なんて言ったらいいか分からないけど。」<br /><br />彼女は笑いながら話す。<br />今まで彼女がどうしてここまでｹﾞｰｾﾝに入れ込むのか不思議に思うこともあった。<br />それが解けた気がした。<br /><br />彼女「わたしね、ｹﾞｰｾﾝがあったから楽しい高校に行って過ごすことができたし、夢を持つことが出来て、美大に進学したんだよ。大袈裟かな？ｗ」<br />俺「そんなことないよ。すごいと思う。ｹﾞｰｾﾝっていいとこだしねぇ。」<br />彼女「富澤もいたしなあｗ」<br /><br />彼女は凄く照れくさそうに、ぽろっとそんなことをこぼした。<br />彼女は夢を語りだした。<br /><br />彼女「ｹﾞｰｾﾝ減らないでほしい。どんどん減ってる。わたし、いろんな人が楽しめるｱｰｹｰﾄﾞｹﾞｰﾑを作るのが夢だった。」<br /><br />それを語る彼女は、いつにも増して真剣そのものだった。<br />凛とした視線で、かっこいいとさえ思った。<br />彼女「ｹﾞｰｾﾝでしか味わえないﾄﾞｷﾄﾞｷがあるんだよ。富澤はどんな時にそう思う？」「わたしはね」<br /><br />彼女はまっすぐだった。まっすぐすぎて、胸が痛くなるくらいだった。<br />普段ｱﾎなことをけっこう言うくせに、まっすぐで、ひたむきで&hellip;<br />夢を語る彼女に憧れた。<br />俺は最初こそ笑って聞いていたが、<br />だんだんくったく無く夢を語る彼女を見ているのが辛くなった。<br />夢があって、それを追いかけてるってだけで人は眩しく見える。<br />でも、彼女が置かれている状況を思い出すと、俺はもうﾀﾞﾒだった。<br />俺は夢を語る彼女の前で泣いてしまった。<br />「すごい&hellip;すごいよ&hellip;」と言ってﾎﾞﾛﾎﾞﾛ泣いてしまった。<br />彼女の前で、泣いてしまった。</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと気になる続きが読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 1, 2, '0000-00-00', 1);
INSERT INTO `questions` (`id`, `app_type`, `app_id`, `title`, `description`, `image`, `scenario`, `contents`, `anwser_result`, `permissions`, `fb_page_id`, `fb_page_url`, `fb_page_title`, `count`, `intro`, `count_today`, `count_month`, `count_day`, `is_publish`) VALUES
(74, 1, 14, '《長編》2chで話題になったゲーセンで出会った彼女の話【8/8】', '最後はハンカチ必須！！長編恋愛ストーリー。', 'love_fb600.png', '', '', '<p><img src="/uploads/love_cont.png" alt="alt" width="100%" /></p>\r\n<div class="textarea">\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【8/8】</h1>\r\n<a href="/index.php/home/question?id=62">■第１話はコチラ</a><a href="/index.php/home/question?id=73"><br />■第７話はコチラ</a>\r\n<div class="textarea" style="text-align: left;"><br />彼彼女「この病院には七不思議があるんだよ。」<br />俺「へえ～何それ？」<br /><br />それは彼女が勝手に考えたﾍﾝﾃｺなものだった。<br />実に下らない内容で、俺は一緒になって笑った。<br /><br />俺「７つ目は？」<br />彼女「わたしが入院してることかなｰ」<br />俺はそれを言われて言葉を失った。<br />彼女「はやく、元気になりたいなｰ」<br /><br />それが彼女が珍しく弱音を吐いた瞬間だった。<br /><br />俺「すぐによくなるよ、必ずね。」<br /><br />俺だって、すごく不安だったけど、信じるしかなかった。<br />１２月になって、ｸﾘｽﾏｽが近くなったあたりから、彼女の様子は徐々に変わり始める。<br />現実が、音を立てて彼女と俺に牙をむき始めた。<br />彼女は辛そうにしていることが増え、行っても一日話せないことが増えた。<br />ｸﾘｽﾏｽｲﾌﾞもｸﾘｽﾏｽも行った。<br />ｸﾘｽﾏｽは、まだなんとか調子がよくて、少しは話すことができた。<br />正念場だった。俺はｽﾄﾚｽ性の胃炎に何回かなった。<br />年が明けた。<br />これほど世間の「あけおめ」ﾑｰﾄﾞが恨めしかったことはない。<br />浮かれている人々が、すごく憎たらしく感じた。<br />この頃から、俺は彼女の両親とも連絡をより密にとるようにした。<br />そろそろ、いつ何が起こるか分からない状態、にまで来ていた。<br />そう、いざそういう状態になってからは、状況はみるみるうちに進展していった。<br />昨日までの状態が、次の日になれば嘘みたいになっていることも、ありうる。<br />俺はこの頃から、彼女との話せる時間を本当に、本当に、大切にした。<br />弱った彼女を見るのは辛かった。けど、優しく、笑顔で、話しかけた。<br />俺は今までも、楽しかった日のことは決して忘れないように日記にしたためていたが、<br />この頃から彼女の写真や映像もより積極的に撮るようにしていた。<br />刻一刻と、命の火が燃えていく気がした。<br />俺は、今、自分が何をしているのか分からなくて、<br />どうしようもなく辛くなるときもあったが、病室に行って彼女の顔を見て<br />どうにか耐えていた。<br />彼女の両親との協力は、不可欠だった。<br />しばらくすると、彼女はとうとう個室に移った。<br />病室に座る。<br />俺と、彼女だけ。<br />俺は優しく語りかける。<br />「今日は寒いね。」<br />「最近ｽﾊﾟ４強くなったんだ俺ｰ」<br />「今度画材屋行こうと思うんだけど、何か欲しい？」<br />「俺はね、水彩色鉛筆がしたくて&hellip;」<br />返事が返ってこない日のほうが多かった。<br />たまに、すごくゆっくりだけど、答えてきたり、<br />自分から話そうとすることもあった。<br />彼女の両親と、俺で、彼女を見守る。<br />彼女は俺に言った。<br /><br />彼女「富澤&hellip;いるの&hellip;？」<br />俺「いるよ！俺はここにいるよ！」<br /><br />彼女は少し笑みをこぼしてみせた。<br /><br />彼女「あのね&hellip;。少しだけね&hellip;言いたいの&hellip;。」<br />俺「ゆっくりでいいんだよ、俺は、ずっと、ずっと、そばにいるんだから。」<br />彼女「いつもね&hellip;一緒に&hellip;いてくれた&hellip;人&hellip;」<br />俺「うん、うん。」<br /><br />俺は半泣きだった。<br />彼女の両親も、泣き出していた。<br /><br />彼女「富澤は&hellip;わたしの&hellip;大切な人&hellip;」<br />俺「うん、俺も、吹石が大切だよ&hellip;」<br />彼女「わたしが&hellip;いなくなっても&hellip;富澤はきっと&hellip;しあわせに&hellip;なってね&hellip;」<br />俺「違うんだよ！！吹石も一緒に幸せになるんだよ、ずっと一緒なんだから！」<br /><br />彼女は少し笑みを含んで、<br /><br />彼女「こんなわたしを&hellip;大切に想ってくれて&hellip;ありがとう&hellip;ありがと&hellip;」<br />俺「うん、うん。」<br />彼女「わたしは&hellip;だいじょうぶ&hellip;たのしかった&hellip;」<br /><br />彼女はゆっくりだけど、確かに、俺にそう伝えると、<br />そのあとお母さんやお父さんに懸命に、話していた。<br />俺は、泣きすぎた。<br />その日だけで一年分くらいの量の涙を流したかもしれない。<br />それから二日後、彼女は俺と両親に見守られながらこの世を去った。<br />享年２４歳。<br />最後は安らかに、眠りに落ちるようだった。<br />俺はしばらく式やその他の彼女に関わることの整理で、忙しくなり、気が張った。<br />目の前で進行していく数々の出来事が、俺の脳をただただ通過していくだけだった。<br />彼女がいなくなったこと、続けざまに起こる法要、<br />俺は、ただ呆然としていた。<br />心にぽっかり、穴が開いた。<br />彼女のお墓の前に言った時、俺があまりに号泣しすぎて<br />周りにも奇異な眼差しで見られた。<br />気づいていた人は大勢いると思うけど、<br />俺と彼女は最初から最後まで「好き」という言葉を互いに<br />口にすることがなかった。なぜなのか俺にも未だに不思議なんだけど、<br />そんなこと口にしなくてもお互いが大切に想ってるって分かってたし、<br />一緒にいて共に過ごしてること自体がそういうことなんだから、<br />口にしなかったんだと思う。<br />言おうと思ったこともなかった。<br />誰かが磁石が惹きあうみたいって言ってくれたけど、それがすごくしっくりきた。<br />みなさん、ここまで付き合ってくれて、本当にありがとう。<br />ここまで書くのは、正直本当に辛かったけど、みんなの支えがあったおかげで、<br />途中で折れずに最後まで書けました。<br />今は乗り越えたとは言えませんが、整理はつきました。<br />最後に、花言葉でしめた方がいいのでしょうか？<br />複数あるようですが、<br />彼女が大好きだったﾄﾙｺｷｷｮｳの花言葉は、<br />「永遠の愛」です。<br />彼女のことはこれからも、ずっと想い続けます。<br />みんなここまでありがとう。<br />本当に、ありがとう。<br />彼女が亡くなった直後は一ヶ月近くまともにﾒｼ食べれませんでした。<br />でも今は割と穏やかに、普通に過ごしています。<br />ｹﾞｰｾﾝにも行っているよ。<br />やっぱり、あそこは楽しい。<br />みんなも、もっとｹﾞｰｾﾝに行ってｹﾞｰｾﾝを盛り上げてくれるといいな。<br />それでは、本当にありがとう。<br />またいつか、今度はｹﾞｰｾﾝとかで会えたらいいね。<br /><br /><br />+++++終わり+++++<br /><br /></div>\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<div class="textarea" style="text-align: left;">&nbsp;</div>\r\n<br />\r\n<div class="textarea"><a href="/index.php/home/question?id=62">■第１話はコチラ</a><br /><a href="/index.php/home/question?id=73">■第７話はコチラ</a></div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;&darr;こちらもオススメ！！！&darr;&darr;&darr;&darr;</p>\r\n<p style="text-align: center;">■その他のおすすめの恋愛ストーリー</p>\r\n<p style="text-align: center;">自分が交通事故で歩けなくなりました。<br />あなたは恋人に相談できますか？<br />それともこっそり別れを告げますか？</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=49">泣ける恋愛ストーリー【わかれよう。。。。】</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">突然の彼の死。<br />彼が恋人に送れずに未送信のままになっていた大量のメールの内容とは&hellip;</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=48">【感動する恋話】未送信のメール。</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 25, '<div class="textarea">\r\n<h1><img src="/uploads/love_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>2chで話題になったゲーセンで出会った彼女の話【8/8】</h1>\r\n<p><a href="/index.php/home/question?id=62">■第１話はコチラ</a><br /><a href="/index.php/home/question?id=73">■第７話はコチラ</a><br /><br />その日は幸せのど真ん中にいた。<br />しばらく、ｽｰﾂとﾄﾞﾚｽのままで二人で話した。<br />不思議な気分で、一生このままならいいのに、と願わずにいられなかった。<br />彼女はすごく喜んでくれた。<br />「ありがとう、すごく幸せ」と言ってつけている俺のあげたﾈｯｸﾚｽを握っていた。<br />「こんな日にはAnthemが似合う」と一人でﾌｼﾞﾌｧﾌﾞﾘｯｸのそれを口ずさんでいた。<br />しばらくするとお母さんが来て、<br />「写真撮るね。」と言って写真を撮った。<br />「何も言わなくても、幸せそうな顔してるねｗ」<br />そう言われたのが印象的だった。<br />俺にとって、彼女といられる日はいつも特別だったけど、<br />この日はそれ以上に特別だった。<br />楽しくて、時が止まれと思った。<br />この日が過ぎたあとも、しばらくは穏やかな日が続いた。<br />俺たちはいつも病室で一緒にいたけど、いてもいても足りないくらいだった。<br />普通だったら毎日毎日顔合わせてたら少しは退屈になったりするんだろうけど、<br />俺たちはどんなに話しても笑いが絶えなかった。<br />どうしてだろう、話しても話しても、もっと一緒にいたい、<br />そういう想いが募るだけだった。</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと感動のラストが読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 1, 2, '0000-00-00', 1),
(75, 1, 14, '【恐怖シリーズ】－誘拐－', '怖いのが苦手な人は続きを見ないでください。。。', 'horror_fb_600.png', '', '', '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【 解説 】</h1>\r\n<br />犯人は、語り手自身であり、2重人格者。<br /><br />語り手以外は「子供の頃に誘拐された」という共通点が有り、<br /><br />皆、子供の頃に誘拐して、ずっと自分の部屋に閉じ込めている。<br /><br />子供が震えて話せなかったのは、まだ誘拐されたばかりで、<br /><br />犯人である語り手におびえていたから</div>\r\n</div><br /><br />', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 227, '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【 誘拐 】</h1>\r\n<br />最近、近くで子供を誘拐する事件が続いていて、<br /><br />テレビでも頻繁にそのニュースをやっている。<br /><br /><br />「物騒な世の中だな・・・」<br /><br /><br />そう思いながら、<br /><br />子供の誘拐事件と聞いていたので、<br /><br />自分には関係がないと、特に警戒もせず、<br /><br />今日は暑いので、窓を開けたまま寝てしまった。<br /><br /><br /><br />朝、起きると、見知らぬ部屋にいて、<br /><br />何と、周りには誘拐された子どもたちがいる。<br /><br /><br /><br />「オレも寝てる間に誘拐されたのか・・・」<br /><br /><br />油断した自分への後悔の念と、恐怖で頭がパニックになりそうだったが、<br /><br />状況を把握しようと、一度冷静に周りをみてみることにした。<br /><br /><br />とても広い部屋で、冷蔵庫等、一通りの設備もあり、<br /><br />よく見ると、子供だけでなく、大人もいる。<br /><br /><br /><br />子どもたちに話しかけてみても、震えてばかりで、<br /><br />拉致があかないので、大人の方に声をかけてみた。<br /><br /><br /><br />「あなたはいつ、誘拐されたんですか？」<br /><br />「20年前です。5歳の頃に誘拐されました」<br /><br /><br />他の人にも声をかけてみた。<br /><br />「40年前です。7歳の頃に誘拐されました」<br /><br /><br />なんと、、、40年もここにいるのか。。。<br /><br /><br />このまま、一生出れないのではないかと、<br /><br />オレは恐怖に震えた。<br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&nbsp;あなたにはこの意味が分かりますか？<br />意味が分かると、背筋が凍ります&hellip;<br /><br />【次へ進む】を押すと続きが読めますが、<br />怖いのが苦手な人は読まないで下さい&hellip;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n</div>\r\n</div>\r\n<p><br /><br /></p>', 1, 2, '0000-00-00', 1),
(76, 1, 14, '【衝撃画像】ゴールデンボンバーのダルビッシュはガチでイケメンだった！', 'ガチでイケメンすぎてびっくりします…。', 'Doramu-timeline-fs8.png', '', '', '<div class="textarea" style="text-align: center;"> <h1><img src="/uploads/o0765102412165596087.jpg" alt="alt" width="100%" /></h1> <h1><img src="/uploads/o0683102412223932583.jpg" alt="alt" width="100%" /></h1> <span style="color: #c0c0c0;">参照元：ameblo.jp/doramu-kenji/</span></div> <h1>★☆イケメンすぎてビックリしますね！★☆ </h1>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 393, '<div class="textarea">\r\n<h1><img src="/uploads/doramu-fs8.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/Doramu-timeline-fs8.png" alt="alt" width="100%" /></h1>\r\n<h1>【衝撃画像】ゴールデンボンバーのダルビッシュはガチでイケメンだった！</h1>\r\n<br /><span style="color: #c0c0c0;">参照元：ameblo.jp/doramu-kenji/</span><br /> <br />人気バンド、ゴールデンボンバーのDramu(暫定)で<br />歌舞伎の様なメイクにひょうきんなキャラクターで人気の<br />樽美酒研二(ダルビッシュケンジ)さん。<br /><br />彼が白塗りのメイクをとるとめちゃくちゃカッコイイと評判なんです。<br /><br />「まるでGacktみたい」<br />「超イケメン！」<br />「白塗りがもったいなすぎる&hellip;」<br /><br />と、賞賛の声でもちきり！<br /><br />彼が白塗りを取った素顔はどんな顔なのでしょうか！？<br />&nbsp;\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すとモザイク無しの画像が見れるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 1, 2, '0000-00-00', 1),
(77, 1, 14, 'クイズ【その顔が見て見たい～美女コレクションその01～】', '写真の美女を当ててみよう！', '01_shinozaki_ai.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/01_quiz_sonokaoga_02.jpg" alt="alt" width="100%" /></h1>\r\n<h1 style="text-align: center;">★☆正解は、篠崎愛さんです！！★☆</h1> </div>\r\n</div>\r\n\r\n', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 220, '<div class="textarea">\r\n<h1><img src="/uploads/title.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/01_quiz_sonokaoga_01.jpg" alt="alt" width="100%" /></h1>\r\n<h1>クイズ【その顔が見て見たい～美女コレクションその01～】</h1>\r\n<br />東京都出身でムッチリボディに童顔が人気の彼女！<br /><br />グラビア界では絶大な人気を誇る彼女。<br />誰だかわかりますか？<br /><br />ファンの間では<br /><br />「ぽちゃでもカワイイと言うのは彼女の事だけを指す。」<br />「全然太ってないし、むしろ細い。」<br />「彼女にしたい！！」<br /><br />など、その人気はうなぎ登り！！<br /><br />そんな彼女は誰でしょうか？？<br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;">【次へ進む】</span>を押すと彼女の写真が全部見れるよ！！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 2, 3, '0000-00-00', 1),
