(85, 1, 14, '【悲報】きゃりーぱみゅぱみゅ新曲のパクリ騒動･･･', 'パクリを超えた“確信犯的コピペ”との噂が…。', 'kyari-share.png', '', '', '<div class="textarea">\r\n<h1><iframe width="100%" height="100%" src="//www.youtube.com/embed/EHa5KhuKASo" frameborder="0" allowfullscreen></iframe></h1>\r\n<br /><h1 style="text-align: center;">いかがですか？？</h1>\r\n</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 306, '<div class="textarea">\r\n<h1><img src="/uploads/kyari-top.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/kyari-top02.png" alt="alt" width="100%" /></h1>\r\n<h1>【悲報】きゃりーぱみゅぱみゅ新曲のパクリ騒動･･･</h1>\r\n<br /><span style="color: #c0c0c0;">参照元：hayabusa3.2ch.net</span><br /><br />奇抜な衣装とメイク。かわいらしい歌声でテレビ、雑誌、CMに<br />大人気のきゃりーぱみゅぱみゅさん。<br /><br />そんな彼女の2014年2月26日に発売された<br />新曲「ゆめのはじまりんりん」がGAOさんのサヨナラに<br />酷似していると盗作疑惑が出ています。<br /><br /><br />ネットユーザからは<br /><br />・これは完全にアウト<br />・どっちもそれぞれ良い曲。もうそれでいいじゃん。<br />・きゃりーさんがアウトではなく&Prime;作曲家&Prime;がアウトの間違えですね<br /><br />などなど、様々な声が飛び交っています。<br /><br />みなさんはどう思いますか？<br /><br /><br />衝撃の比較動画はこちら。<br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;">【次へ進む】</span>を押すと衝撃の動画がみれるよ！！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 2, 3, '0000-00-00', 1),
