(90, 1, 14, '【発想の転換】わかるとスッキリ！10秒クイズ！-Part01-', '考え方を変えれば10秒かからずに解けます。', 'nazonazo_fb.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/nazonazo_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>■回答<br />40円<br /><br />■解説<br />10円と70円は、100円で買った時にもらえるおつりの金額。<br />その為、30円のものが2つだと、おつりは40円。</h1>\r\n<br /><br /><br /><br /></div>\r\n<p style="text-align: center;">■その他のおすすめのクイズ</p>\r\n<p style="text-align: center;">&darr;&darr;&darr;</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=83">\r\n【アナログ思考じゃ100%解けない】足し算クイズ。</a></p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=86">【今すぐ使える】10回言ってクイズ！～刀編～</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 817, '<div class="textarea">\r\n<h1><img src="/uploads/nazonazo_cont.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/otsuri_02.png" alt="alt" width="100%" /></h1>\r\n<br /><br /> <span style="color: #c0c0c0;">【ヒント】</span><br /><span style="color: #c0c0c0;">70円と10円は、もらう金額の事だよ！</span><br class="text_exposed_show" /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと問題の答えがわかるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 2, 2, '0000-00-00', 1),
(91, 1, 14, '【胸キュン注意】マフラー。', '思わず顔が赤くなる恋話｜まさかの展開に胸キュンです。', 'love_fb_600.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/love_cont.png" alt="alt" width="100%" /></h1>\r\nそっか、フラれて渡せなかったのか&hellip;。<br />そう思ってつい、<br />「うわぁ、受け取ってもらえなかったのか」<br />って彼女に言っちゃったんだ&hellip;。<br /><br />そしたら「いまから渡すの」って言ってこっちに差し出した。<br /><br />「好きなのはアンタだよ、いい加減気づいてよ(*/o＼*)。」<br /><br />「マジで！？」<br /><br />俺、いままで生きてきた中で、一番顔が真っ赤になってる気がするorz。<br /><br />とりあえず返事はOK。<br />ありがたく頂戴して、手をつないで帰った。<br />マフラーは暖かいけど彼女の手はそれよりも暖かい気がする。<br /><br />ずっと、仲良しでいようね。<br /><br />\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">■その他のおすすめの恋愛ストーリー</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=48">【感動する恋話】未送信のメール。</a></p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=49">泣ける恋愛ショートストーリー【わかれよう。。。。】</a></p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=62">《長編》2chで話題になったゲーセンで出会った彼女の話</a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 122, '<div class="textarea">\r\n<h1><img src="/uploads/love_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【胸キュン注意】マフラー。</h1>\r\n<p>女友達に頼まれてプレゼントを買うのに付き合う事に。<br />なんだか、最近いい感じになってる人がいて告白しようと<br />思ってるんだけど、ついでにプレゼントもあげたいらしい。<br /><br />「おいおい、振られたらどうすんだよ、うまくいくことは決定かよ。羨ましいなぁ」<br /><br />と思いつつも手袋を勧めてみた、時期的に寒いし、雪降るし、<br />ちょうど良いと思ったし、俺がもらったら嬉しいし。<br /><br />女友達も納得し、どれが良いか選ぶ段階になったんだけど<br />もう必死に選んでるんだな、これがｗ<br />お前がそんなに迷ってんの初めて見るぞって思ったぐらい。<br /><br />そのときふと思いついて<br /><br />「手つなぐんなら手袋ないほうがいいかもねー」<br /><br />って言ってみた。ニヤニヤしながら。<br />正直羨ましかったからね。<br /><br />そしたら、<br />「あっ！そっかぁ、じゃあ・・・・マフラーにする！」<br />って結局マフラーを買って帰った。<br /><br />で数日後、そいつに会って<br />「手つなげた？」って聞いたら、<br />なにも言わないでうつむいちゃった<br />そしてかばんから見たことある包みが！<br /><br />そっか、フラれて渡せなかったのか&hellip;。<br />そう思ってつい、<br />「うわぁ、受け取ってもらえなかったのか」<br />って彼女に言っちゃったんだ&hellip;。<br /><br /><br />このあと、胸キュンのラストが！！</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;<span style="color: #ff0000;">【次へ進む】</span>を押すと気になる続きが読めるよ！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 4, 5, '0000-00-00', 1),
(92, 1, 14, '【画像】 板野友美のプリクラ「目でかすぎ！」', 'プリクラによって、より強調されていると思われる目が…', 'itano-share.png', '', '', '<div class="textarea" style="text-align: center;">\r\n<h1><img src="/uploads/itano-top02.png" alt="alt" width="100%" /></h1>\r\n<span style="color: #c0c0c0;">参照元：twitter.com/tomo_coco73</span></div>\r\n<h1>★☆いかがですか！？★☆</h1>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">■その他のオススメ！！</p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=90">【恐怖シリーズ】－俺にも彼女ができました－</a></p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=91">【胸キュン注意】恋愛ショートストーリー～マフラー～</a></p>\r\n<p style="text-align: center;"><a href="/index.php/home/question?id=76">【衝撃】ゴールデンボンバーのダルビッシュの白塗りじゃない素顔</a></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 896, '<div class="textarea">\r\n<h1><img src="/uploads/itano-top.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/itano-top03.png" alt="alt" width="100%" /></h1>\r\n<h1>【画像】 板野友美のプリクラ「目でかすぎ！」</h1>\r\n<br />元AKB48メンバーで歌手の板野友美さん（22）が、AKB48の永尾まりやさん（19）と食事に行ったことを明かしている。<br /><br />永尾さんは「友さんとご飯にいったよ　プリクラー！もちろんCandy magic」として、板野とともに撮影したプリクラを公開。<br />Candy magicとはカラーコンタクトレンズのことで、2人とも目元がより際立つ表情だ。<br /><br />この写真には、<br /><br />「えー可愛い！」<br />「なんじゃこの可愛さ」<br /><br />という声がある一方で、<br /><br />「ともちん目でかすぎ」<br />「なんだこれ、こわい」<br /><br />と、プリクラによって、より強調されていると思われる目に驚いた人もいるようです。<br /><br />モザイクなしの画像はこちら。<br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;">【次へ進む】</span>を押すとモザイクなしの画像がみれるよ！！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 2, 3, '0000-00-00', 1),
