(96, 1, 14, '【恐怖­】­怖­い­話­シ­リ­ー­ズ­～井戸～', 'ある日、泣き声がしゃくに障ったので妹を殺した。死体は井戸に捨てた。次の日見に行くと死体は消えていた。。。', 'horror_fb_600.png', '', '', '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【 解説 】</h1>\r\n<br />母親が違う場所に捨てに行っていた。。<br /><br /></div>\r\n</div><br /><br />', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 1550, '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【恐怖シリーズ】－井戸－</h1>\r\n<br />ある日、泣き声がしゃくに障ったので妹を首を絞めて殺した。<br />死体は井戸に捨てた。次の日見に行くと死体は消えていた。<br /><br />5年後、些細なけんかで友達を包丁で殺した。<br />死体は井戸に捨てた。次の日見に行くと死体は消えていた<br /><br />10年後、酔った勢いで孕ませてしまった女をバットで殴って殺した。<br />死体は井戸に捨てた。次の日見に行くと死体は消えていた<br /><br />15年後、嫌な上司を薬を盛って殺した。<br />死体は井戸に捨てた。次の日見に行くと死体は消えていた<br /><br />20年後、介護が必要になった母が邪魔なので風呂に沈めて殺した。<br />死体は井戸に捨てた。<br />次の日見に行くと死体は消えずそのままだった。<br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&nbsp;あなたにはこの意味が分かりますか？<br />意味が分かると、背筋が凍ります&hellip;<br /><br />【次へ進む】を押すと続きが読めますが、<br />怖いのが苦手な人は読まないで下さい&hellip;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n</div>\r\n</div>\r\n<p><br /><br /></p>', 2, 3, '0000-00-00', 1),
(97, 1, 14, '【恐怖】怖い話シリーズ～画像編｜高校球児～', '【恐怖】画像を見ると心臓が止まりそうになります…。', 'shinrei02_01.png', '', '', '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/shinrei02_03.png" alt="alt" width="100%" /></h1>\r\n<h1>【背番号14番の選手の左太ももに…】</h1>\r\n<br /></div>\r\n</div><br /><br />', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 2748, '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/shinrei02_02.png" alt="alt" width="100%" /></h1>\r\n<h1>【恐怖】怖い話シリーズ～画像編｜高校球児～</h1>\r\n<br /><br /><br />－－－－－－－－－－－－－－－－－－－－<br /><br />高校球児の暑い夏、感動の勝利。<br />ところが、そこに写っていた一枚の写真には、<br />恐ろしいものが写っていたのでした&hellip;&hellip;。<br /><br />－－－－－－－－－－－－－－－－－－－－<br /><br /><br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&nbsp;<br /><br />【次へ進む】を押すとモザイクなしの画像がみれますが、<br />怖いのが苦手な人はくれぐれも閲覧しないで下さい&hellip;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n</div>\r\n</div>\r\n<p><br /><br /></p>', 6, 6, '0000-00-00', 1),
(98, 1, 14, '【恐怖­シリーズ＆クイズ】­～父と母～', '【難問】今回は謎解きです。謎が解けると恐ろしい事実に気づきます…。', 'horror_fb_600.png', '', '', '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/gensosyuuki.png" alt="alt" width="100%" /></h1>\r\n<h1>【 解説 】</h1>\r\n<br />カレンダーの日付は<br />元素の周期番号と族番号をあらわしています。<br />上の画像を元にカレンダーの日付と照らし合わせると。。。<br />Ti Ti Ni Au Na Hg Mo Ra Re Ta(Atの逆) Ni Ge Te<br />『父に会うな、水銀盛られた、逃げて…』<br />となります。<br /><br />5年振りに父の料理を食べた私はどうなってしまうのでしょうね…。<br /><br /></div>\r\n</div><br /><br />', 'publish_actions,read_stream', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 2654, '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【恐怖シリーズ＆クイズ】－父と母－</h1>\r\n<br />私は５年ぶりに実家に帰ってきた。<br />この家にいると、亡くなった母を思い出す。<br /><br />母は認知症だった。<br />身の回りの世話をつきっきりでしていた父を<br />困らせてばかりいた姿が目に浮かぶ。<br /><br />そして今は亡き母の書斎に入った時、私は初めて違和感を覚えた。<br />母にプレゼントしたカレンダーが見つからない。<br /><br />何の気無しにテーブルを漁ると、<br />ハサミでバラバラにされた幾つかの<br />カレンダーの切れ端が順序良く並んでいる事に気が付いた。<br /><br />母はどんなにボケていても、<br />私のプレゼントは大切にしてくれていたのにと&hellip;<br />私はショックを受けた。<br /><br />私は感傷とともに並べられた日付を整理した。<br /><br />・4/4<br />・4/4<br />・4/10<br />・6/11<br />・3/1<br />・6/12<br />・5/6<br />・7/2<br />・6/7<br />・6/17<br />・4/10<br />・4/14<br />・5/16<br /><br />私は一枚だけ向きが逆になっている6/17に気づき、<br />他の日付と同じ向きに変えていると、<br />一階の父が私を呼んだ。<br /><br />今日から五年振りの父の手料理が食べられる。<br />感傷を胸に押し込み、私は母の書斎を後にした&hellip;。<br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&nbsp;あなたにはこの意味が分かりますか？<br />意味が分かると、背筋が凍ります&hellip;<br /><br />【次へ進む】を押すと続きが読めますが、<br />怖いのが苦手な人は読まないで下さい&hellip;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n</div>\r\n</div>\r\n<p><br /><br /></p>', 4, 5, '0000-00-00', 1),
(99, 1, 14, '【先着1500名限定】怖い話シリーズ～画像編｜少女の呪い～', '【恐怖】画像を見ると心臓が止まりそうになります…。', 'shinrei_04.png', '', '', '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/shinrei04_03.png" alt="alt" width="100%" /></h1>\r\n<h1>【解説】</h1>この写真に写っている少女の霊の顔が、<br />\r\nこの写真が撮られた数日前に<br />\r\n院内で亡くなったMさんにそっくりなのです。<br /><br />そして、この写真を撮った患者さんが、<br />\r\n手術の翌日亡くなりました。<br />\r\n有り得ない事に、カンシを入れたまま<br />\r\n閉じてしまったらしいです…。<br />\r\n相当苦しかった事でしょう。<br /><br />\r\nこの手術のミスに関して、<br />\r\n院内では、色々な憶測が飛びまわっています。。。<br />\r\n<br /></div>\r\n</div><br /><br />', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 2965, '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/shinrei04_03.png" alt="alt" width="100%" /></h1>\r\n<h1>【先着1500名限定】怖い話シリーズ～画像編｜少女の呪い～</h1>\r\n<br /><span style="color: #ff0000;">※閲覧数1,500名を越えると自動で閲覧できなくなります※</span><br /><span style="color: #ff0000;">ご注意下さい&hellip;。</span><br /><span style="color: #ff0000;">勇気のある方はお早めにどうぞ。。。。。</span><br /><br /><br />－－－－－－－－－－－－－－－－－－－－<br /><br />この写真は、ある病院にて<br />手術を控えた患者さんが病院の庭で<br />お見舞いに来てくれた人を写した写真です。<br /><br />この写真の事で、<br />こちら病院では<br />パニックに近い異常な状態にあります&hellip;<br /><br />－－－－－－－－－－－－－－－－－－－－<br /><br /><br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&nbsp;<br /><br />【次へ進む】を押すとモザイクなしの画像がみれますが、<br />怖いのが苦手な人はくれぐれも閲覧しないで下さい&hellip;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n</div>\r\n</div>\r\n<p><br /><br /></p>', 4, 5, '0000-00-00', 0),
(100, 1, 14, '【恐怖­】­怖い話シリーズ～私のせいでみんなを殺した～', '【悲報】バスが落石事故で乗客が全員死亡しました…。', 'horror_fb_600.png', '', '', '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【 解説 】</h1>\r\n<br />降りなければ、事故に合うことはなかった。<br /><br /><br /><br /><br /><br />\r\n<br /></div>\r\n</div><br /><br />', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 22, '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【恐怖&shy;】&shy;怖い話シリーズ｜～私のせいでみんなを殺した～</h1>\r\n<br />とうとう彼女と結婚する事が決まった。<br /><br />俺の実家はめちゃくちゃ山の中にあるんだけど、<br />彼女を両親に会わせる為に、田舎までのバスに乗った。<br /><br />山のふもとあたりまできた時、<br />急に彼女が<br /><br />「おなか減りすぎてご両親の前でお腹がなったら<br />恥ずかしいから、ご飯食べていこうよ！！」<br /><br />とだだをこね始めたため、<br />仕方なく途中のバス停で降り近くの定食屋で食事をした。<br /><br />食事が終わり定食屋にあるテレビを見ると、<br />さっきまで乗っていたバスが落石事故で乗員全員死亡<br />というニュースが流れていた&hellip;<br /><br />そのニュースを見た彼女が、<br />「バスを降りなければよかった&hellip;」と。<br />それを聞いた俺は怒ったが、すぐに<br />「あぁ、なるほど。」と彼女の意図に気づく&hellip;。<br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&nbsp;あなたにはこの意味が分かりますか？<br />意味が分かると、背筋が凍ります&hellip;<br /><br />【次へ進む】を押すと続きが読めますが、<br />怖いのが苦手な人は読まないで下さい&hellip;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n</div>\r\n</div>\r\n<p><br /><br /></p>', 8, 8, '0000-00-00', 1),
(101, 1, 14, '【衝撃】浅田真央の年収がガチでヤバイ…。', '【知識】実際、オリンピック出演でいくらもらえるの？？', 'asadamao_share.jpg', '', '', '<div class="textarea" style="text-align: center;">\r\n<h1><img src="/uploads/asadamao (1).png" alt="alt" width="100%" /></h1>\r\n<span style="color: #c0c0c0;">参照元：woman.infoseek.co.jp/</span></div>\r\n<h1>6億円！！<br />現役続行としても、<br />引退するとしても、<br />彼女には幸せな人生を<br />送って欲しいですね！！</h1>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">&nbsp;</p>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 790, '<div class="textarea">\r\n<h1><img src="/uploads/asada-top.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/asadamao01.png" alt="alt" width="100%" /></h1>\r\n<h1>【知識】実際、オリンピック出場でいくらもらえるの？？</h1>\r\n<br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;">【次へ進む】</span>を金額とその理由が明らかに！！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 2, 3, '0000-00-00', 1),
(102, 1, 14, '【恐怖­】­怖い話シリーズ～少女とお星様～', 'どんな恐ろしい願いでも叶えてしまう事ができたら、あなたはどうしますか？', 'horror_fb_600.png', '', '', '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【 解説 】</h1>\r\n<br />この話には2つの説があります。<br /><br />1つは｢家族を消してちょうだい！｣と言っているため、<br /><br />｢家族を消して(また)頂戴！｣という意味にとられ、<br /><br />結局家族は消えなかったという説。<br /><br /><br />もう1つは、少女は養子であるという説。<br /><br />家族の誰かではなく家族全員が嫌いという事は、<br /><br />少女は家族全員から嫌われている。<br /><br />つまりそういった境遇から、少女は養子なのではないかという考えである。<br /><br /><br />つまり消えたのは少女の本当の家族。<br /><br /><br />さて、あなたが考える結末はどんな結末でしょうか。<br /><br />よろしかったらコメントで教えてくださいね。<br /><br /><br /><br /><br /><br /></div>\r\n</div>\r\n<p><br /><br /></p>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 1268, '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【恐怖&shy;】&shy;怖い話シリーズ～少女とお星様～</h1>\r\n<br />少女のところにお星さまが降り立ちました。<br /><br />「なんでも一つ願いをかなえてあげよう」<br /><br />お星さまはいいました。<br /><br />少女は泣いていました。<br /><br />「家族を消してちょうだい！あんな家族、まっぴらよ！」<br /><br />次の日、少女が目を覚まして一階へおりると、いつものようにおかあさんと<br /><br />おとうさんとおにいちゃんがいました。<br /><br />少女は後悔しました。<br /><br />その夜、再びお星さまは少女の目の前にあらわれました。<br /><br />「気に入ってもらえたかな」<br /><br />少女はいいました。<br /><br />「昨日のおねがいをとりけしてちょうだい」<br /><br />お星さまはいいました。<br /><br />「一度かなえたおねがいはとりけせないよ」<br /><br />少女は泣きました。<br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&nbsp;あなたにはこの意味が分かりますか？<br />意味が分かると、背筋が凍ります&hellip;<br /><br />【次へ進む】を押すと続きが読めますが、<br />怖いのが苦手な人は読まないで下さい&hellip;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n</div>\r\n</div>\r\n<p><br /><br /></p>', 2, 3, '0000-00-00', 1),
(103, 1, 14, '【閲覧注意】サイコパステストします。', '【注意】これはあなたにサイコパスの気質があるかをテストします。', 'horror_fb_600.png', '', '', '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【 解説 】</h1>\r\n<br />サイコパスは迷わずドアの裏と答えます。<br /><br />一般人は迷って他の場所を言います。<br /><br /><br /><br /><br /><br /></div>\r\n</div>\r\n<p><br /><br /></p>', 'publish_actions,read_stream', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 10, '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/psychopass.jpg" alt="alt" width="100%" /></h1>\r\n<h1>【閲覧注意】サイコパステストします。</h1>\r\n<br />あなたの家に強盗がやってきました。<br /><br />あなたは武器も持たず、隠れる事しかできません。<br /><br />武器を持った強盗から隠れるため<br /><br />あなたが身を隠したのは家のどこですか？<br /><br /><br />押入れ？<br /><br />浴槽の中？<br /><br />トイレに立てこもる？<br /><br />ベッドの下？<br /><br />台所？<br /><br />身を隠す場所を考えてください。<br /><br /><br /><br />制限時間はありませんのでゆっくり考えてくださいね&hellip;。<br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&nbsp;身を隠す場所はもう決まりましたか？<br />回答によってはあなたはサイコパス気質です&hellip;<br /><br />【次へ進む】を押すと回答がみれますが、<br />不安な方は次へ進まないでください&hellip;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n</div>\r\n</div>\r\n<p><br /><br /></p>', 5, 6, '0000-00-00', 1);
INSERT INTO `questions` (`id`, `app_type`, `app_id`, `title`, `description`, `image`, `scenario`, `contents`, `anwser_result`, `permissions`, `fb_page_id`, `fb_page_url`, `fb_page_title`, `count`, `intro`, `count_today`, `count_month`, `count_day`, `is_publish`) VALUES
(104, 1, 14, '【まさか！？】福山雅治のゴーストライター疑惑の真相・・・', 'あんちゃん、アンタは違うよね！？！？', 'hukuyama-share_top20140228.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/hukuyama-top_02_20140228.png" alt="alt" width="100%" /></h1>\r\n<h1>【続き】</h1>\r\n<br /><br /> 福山自身もこの疑惑についてはすでに知っているようで、<br /><br />自ら「最近、『福山　（スペース）　ゴーストライター』<br /><br />と検索する人がいる」と告白。<br /><br />4月2日に発売を控えた新作アルバムについては、<br /><br />ギターもほとんど自分で演奏し、<br /><br />現在もギリギリまで細かい修正をしていることを明かし、<br /><br />アルバム作りについて並々ならぬこだわりを持っていることをうかがわせた。<br /><br /><br />今回の佐村河内守氏の騒動を受け、<br /><br />ゴーストライター疑惑が噂されるシンガーソングライターは多い。<br /><br />しかし、佐村河内騒動以降&ldquo;ゴーストライター&rdquo;という存在が<br /><br />続々と表沙汰になると予想されたが、<br /><br />今現在でも、真相は闇の中だ。<br /><br />参照元：japan.techinsight.jp<br />（TechinsightJapan編集部 佐々木直まる）<br /><br /><br /><br /></div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 39, '<div class="textarea">\r\n<h1><img src="/uploads/hukuyama-top20140228.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/hukuyama-top_02_20140228.png" alt="alt" width="100%" /></h1>\r\n<h1>【信じたい】あんちゃん、アンタは違うよね！？！？</h1>\r\n<br /><br />福山雅治が、5年ぶり11枚目となるオリジナルフルアルバム<br /><br />『HUMAN』（2枚組）を4月にリリースすることを発表した。<br /><br />また、すでに配信がスタートしている<br /><br />着うたランキング（2/19～2/25 レコチョク調べ）でも、<br /><br />同アルバムの収録曲2曲が、1位と2位を独占し<br /><br />&ldquo;歌手・福山雅治&rdquo;の注目度の高さがうかがえる。<br /><br /><br />だが福山は、ドラマや映画で俳優としての露出も多く、<br /><br />「多忙の中、作れるのか？」ということなのだろう、<br /><br />インターネット上ではゴーストライター疑惑が囁かれている。<br /><br />加えて8日放送の『桑田佳祐のやさしい夜遊び』（TOKYO FM）では、<br /><br />桑田佳祐がゴーストライターについて<br /><br />「みんな使ってますからね。<br /><br />アミューズ（桑田や福山らが所属する芸能プロダクション）でもある。」<br /><br />と発言。<br /><br /><br />一体事実はどうなっているのだろうか&hellip;。<br /><br />22日放送のラジオでこの事について福山はこう告白した&hellip;。<br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;">【次へ進む】</span>を押すと気になる続きが読めるよ！！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 1, 2, '0000-00-00', 1),
(105, 1, 14, '【先着1500名限定】怖い話シリーズ～都市伝説編｜さっちゃん～', '【恐怖】4番を歌うと呪われるといういわくつきのあれ、ご存知ですか？', 'horror_fb_600.png', '', '', '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【４番以降の歌詞】</h1>\r\n<br />４番<br /><br />さっちゃんがねおべべをおいてったほんとだよ<br /><br />だけどちっちゃいからきっと貰いにこないだろ<br /><br />悲しいなさっちゃん<br /><br /><br />５番<br />サッちゃんはね線路で足をなくしたよ<br /><br />だからお前の足をもらいに行くんだよ<br /><br />今夜だよサッちゃん<br /><br /><br />６番<br /><br />さっちゃんはね、恨んでいるんだホントはね<br /><br />だって押されたからみんなとさよなら、悔しいね<br /><br />あいつらださっちゃん<br /><br /><br />７番<br /><br />さっちゃんはね仲間がほしいのほんとにね<br /><br />だから君も連れて行ってあげる<br /><br />やさしいでしょ？さっちゃん<br /><br /><br />８番<br /><br />さっちゃんもね悔しかったんだ君の事<br /><br />何で君は生きているの？君がほしいよ<br /><br />ほしいなさっちゃん<br /><br /><br />９番<br /><br />さっちゃんはね今日が死んだ日だから<br /><br />誕生日がほしいな♪でもきめたんだ<br /><br />オマエガホシイさっちゃん<br /><br /><br />１０番<br /><br />さっちゃんはねこの歌きーくと落ち着くの<br /><br />あなたもいっしょに歌わない？<br /><br />あの世でさっちゃん。<br /><br />\r\n<h1></h1><br /><br /><br /><br /><br />\r\n<h1>【 都市伝説 】</h1>\r\n<br /><br />＃４番の呪い<br /><br />あまり知られていない４番は、<br /><br />歌うとサッちゃんに殺されてしまう。<br /><br />また、この都市伝説を聞いた人は<br /><br />3時間以内に5人に伝えないとただでは済まないと言われているが、<br /><br />同じく知られていない５番を歌うと助かるという説もある。<br /><br /><br />＃足なし幽霊説<br /><br />電車にはねられたサッちゃんは体が真っ二つになって、<br /><br />テケテケのように上半身だけの状態でさまよっているという<br /><br />話を知った人（もしくは歌の4番を歌った人）の元へ<br /><br />夜中に（寝る前などに）現れ、<br /><br />失った脚の代わりとして脚を切断されてしまう（もしくは殺害される）説が、<br /><br />上記の補正版としてある。<br /><br />サッちゃんから逃れるためには、<br /><br />大好きだったバナナ（絵でも可）を寝床に置いておけば、<br /><br />サッちゃんがそっちに気を取られることで助かる。<br /><br />これは『ポンキッキーズ』で放送されていたアニメ<br /><br />「学校のコワイうわさ・花子さんがきた!!」で<br /><br />類似した話があったためにできたとも考えられる。<br /><br />これと似たチェーンメールのようなものも存在する。<br /><br />「サッちゃんは交通事故ではねられて即死した。<br /><br />「遠くへ行った」のは彼女の顔であり、<br /><br />この文を見た人のもとへサッちゃんが0時に行って、<br /><br />その人は首を鎌で切り取られてしまう。<br /><br />同じ文を9回違うスレに送れば回避できる。」<br /><br />と言った内容のものであり、冒頭はカタカナで書かれている。<br /><br />もっとも実際に歌ってみるとリズムに無理がある。<br /><br /><br />＃病死説<br /><br />１番の歌詞には特に問題になる部分はないが､<br /><br />都市伝説化しているのは2番と3番の歌詞である。<br /><br />2番の｢バナナをはんぶんしかたべられないの｣の部分と、<br /><br />3番の｢サッちゃんがねとおくへいっちゃうってほんとかな｣の部分は、<br /><br />実はサッちゃんは病気などの理由で体が衰弱してしまったために<br /><br />「バナナをはんぶんしかたべられ」ず、<br /><br />「とおくへいっちゃう」=死んでしまうと言う説。<br /><br />また、病死説の場合、｢とおくへいっちゃう｣を漢字変換することで<br /><br />「遠くへ逝っちゃう」となる。<br /><br /><br /><br /><br /><br /></div>\r\n</div>\r\n<p><br /><br /></p>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 1711, '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1>【先着1500名限定】怖い話シリーズ～都市伝説編｜さっちゃん～</h1>\r\n<br /><span style="color: #ff0000;">※閲覧数1,500名を越えると自動で閲覧できなくなります※</span><br /><span style="color: #ff0000;">ご注意下さい&hellip;。</span><br /><span style="color: #ff0000;">勇気のある方はお早めにどうぞ。。。。。</span><br /> <br />１番<br /><br />サッちゃんはね　サチコっていうんだ　ほんとはね<br /><br />だけど　ちっちゃいから　自分のこと　サッちゃんって呼ぶんだよ<br /><br />可笑しいな　サッちゃん<br /><br /><br />２番<br /><br />サッちゃんはね　バナナが大好き　ほんとだよ<br /><br />だけど　ちっちゃいから　バナナを　半分しか　食べられないの<br /><br />可哀相ね　サッちゃん<br /><br /><br />３番<br /><br />サッちゃんがね　遠くへ行っちゃうって　ほんとかな<br /><br />だけど　ちっちゃいから　ぼくのこと　忘れてしまうだろ<br /><br />寂しいな　サッちゃん<br /><br />・<br /><br />・<br /><br />・<br /><br />ここまでは子供の頃からみんな知っている歌詞。<br /><br />歌うと呪われるという噂の４番の歌詞、<br /><br />４番を歌ってしまった人の呪いを解く為の５番の歌詞。<br /><br />あなたは知っていますか？。<br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&nbsp;"さっちゃん"には、様々な都市伝説があります。<br />意味が分かると、背筋が凍ります&hellip;<br /><br />【次へ進む】を押すと続きが読めますが、<br />怖いのが苦手な人は読まないで下さい&hellip;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n</div>\r\n</div>\r\n<p><br /><br /></p>', 1, 2, '0000-00-00', 0),
(106, 1, 14, '【緊急速報】ケンドーコバヤシ逮捕！！', '【悲報】嘘だろ？嘘だと言ってくれ！！', 'kenkoba-share_03_20140228.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/kenkoba-top_03_20140228.png" alt="alt" width="100%" /></h1>\r\n<h1>【真相】</h1>\r\n<br /><br />こちらの画像はケンドーコバヤシさんが<br /><br />芸歴20周年を記念して作られたDVD<br /><br /><br />【緊急特別番組 容疑者ケンドーコバヤシ逮捕 ～事件の真相に迫る・完全版～ 】<br /><br /><br />のジャケットだそうです。<br /><br /><br />いやー、かなりビックリしたので、ネタで安心しました。<br /><br /><br />ケンドーコバヤシさんにはこれからも頑張ってもらいたいですね！！<br /><br /><br /><br /></div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 1510, '<div class="textarea">\r\n<h1><img src="/uploads/kenkoba-top_01_20140228.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/kenkoba-top_02_20140228.png" alt="alt" width="100%" /></h1>\r\n<h1>【悲報】嘘だろ？嘘だと言ってくれ！！</h1>\r\n<br /><br />吉本のお笑い芸人で有名なケンドーコバヤシさんが逮捕との情報が&hellip;。<br /><br />ネット上では<br /><br />・嘘だろ？嘘だと言ってくれ！！<br /><br />・ハイハイ、どうせネタだろ？<br /><br />・釣りだとおもたらマジだった&hellip;<br /><br />など、様々な意見が！<br /><br /><br />どの様な罪で逮捕という話が出ているのか&hellip;。<br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;">【次へ進む】</span>を押すと真相が分かるよ！！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 5, 6, '0000-00-00', 1),
(107, 0, 14, '【診断】2014年、3月のあなたのリア充度診断！', '結果が良ければ、今月の運気は最強！！', '20140301_riaju.png', 'USER,RESULT1,RESULT2,RESULT3', '<div class="answer">\r\n<p>「[USER]の2014年3月のリア充実度」【[RESULT1]\r\n<p>開運色：[RESULT2]</p>\r\n<p>病気運：[RESULT3]</p>\r\n</div>', '[@RESULT1@]\r\n100%！】</p><p>恋愛運：告白するなら今月中に！</p><p>仕事運：何をやってもうまく行きます、自信を持って！</p>\r\n92%！】</p><p>恋愛運：金曜日に告白すると成功率中アップ</p><p>仕事運：自作弁当を作って出勤すると、出世率大アップ</p>\r\n80%！】</p><p>恋愛運：ピアスをつけると、成功率中アップ</p><p>仕事運：朝起きる時間を5分早めると、出世率中アップ</p>\r\n78%！】</p><p>恋愛運：水を飲んで落ち着いてから告白すると成功率小アップ</p><p>仕事運：仕事関係の電話に積極的に出ると、出世率小アップ</p>\r\n61%！】</p><p>恋愛運：告白するなら喫茶店が吉</p><p>仕事運：仕事中にガムや飴を食べると運気が上がるよ！</p>\r\n54%！】</p><p>恋愛運：可も無く不可もなく</p><p>仕事運：特に成功も失敗も無い月です</p>\r\n40%！】</p><p>恋愛運：告白するなら友達と一緒の場が良いかも</p><p>仕事運：行き詰ったときに助けてくれるのは友達の様です。</p>\r\n32%！】</p><p>恋愛運：運気的には微妙かも。特に雨の日の告白は×</p><p>仕事運：運気的には微妙かも。特に大勝負は避けましょう</p>\r\n23%！】</p><p>恋愛運：叶っても、長続きしないかも…</p><p>仕事運：成功しても、ラッキーパンチだと思って謙虚になりましょう。</p>\r\n19%！】</p><p>恋愛運：テレビの話はケンカの元、注意</p><p>仕事運：大きい交渉は来月の方が良いかも。</p>\r\n1%！】</p><p>恋愛運：最悪、告白の予定があるなら来月に変更しよう。。。</p><p>仕事運：遅刻厳禁、信頼を大きく落とす可能性があります。</p>\r\n[/@RESULT1@]\r\n[@RESULT2@]\r\n赤\r\nオレンジ\r\n黄色\r\n緑\r\n青\r\n藍\r\n紫\r\nピンク\r\n白\r\n黒\r\n茶色\r\n[/@RESULT2@]\r\n[@RESULT3@]\r\n風邪に注意\r\n骨折に注意\r\n目の使い過ぎに注意\r\n食べ過ぎ注意\r\n飲みすぎ注意\r\n間食のしすぎ注意\r\n寝不足注意\r\n朝食を抜くと風邪を引きやすいので注意\r\n[/@RESULT3@]', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 56, '<div class="image">\r\n<h1><img src="/uploads/20140301_riaju.png" alt="alt" width="100%" /></h1>\r\n<p>【診断】2014年、3月のあなたのリア充度を診断します。</p>\r\n<p>卒業シーズンの3月のあなたの運気は！？！？</p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #ff0000;">【次へ進む】</span>を押すと結果が見れるよ！</p>\r\n<p>&darr;</p>\r\n<p>&darr;</p>\r\n</div>', 13, 14, '0000-00-00', 1),
(110, 1, 14, '【女性必見！】下着の色で分かる、性格と恋愛傾向。', '【ズバリ当てます】あなたが持っている下着の色で、恋愛の傾向が分かります。', 'shitagi-share_20140307.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/shitagi-top_02_20140307.png" alt="alt" width="100%" /></h1>\r\n<h1>【白やパステルカラーの下着が多いあなた】</h1>\r\n<br /><br />こ最も一般的で、恐らくラブリーなデザインを好むあなたは、<br /><br />普通の女の子らしい性格だと言えます。<br /><br />素直で優しく思いやりがあって、<br /><br />男性には尽くす反面、守ってもらえるタイプでしょう。<br /><br />若いうちはいいのですが、<br /><br />これから歳を重ねていくと、<br /><br />恋愛においては&ldquo;物足りない女&rdquo;になりがちな<br /><br />危険信号が出ています。<br /><br />奥床しさは日本人女性としての鏡ですが、<br /><br />時にはセクシーに、<br /><br />恋愛においても大胆になる勇気が必要です。<br /><br /><br /><br />\r\n<h1>『そんなあなたはこんな男性がおススメ』</h1>\r\n<br /><br />女の子らしく、大抵の男性のストライクゾーンにはまりやすいあなた。<br /><br />相性のいい男性は男らしい強さがあり、<br /><br />2人の関係を常にリードしてくれる人です。<br /><br />下着で言うなら、ボクサーブリーフを好む男性でしょう。<br /><br />頼りがいがあって、甘えさせてくれる男性が好きなあなたは、<br /><br />相手の男性の弱いところを見たくないという気持ちが強いかもしれません。<br /><br />しかし、どんなに強い男でも、<br /><br />その内面には弱さや脆さを抱えているもの。<br /><br />あなたが、そんな彼に対して理解を深めることが、<br /><br />恋愛がうまくいく秘訣です。<br /><br /><br /><br /><br />\r\n<h1>【黒やグレーの下着が多いあなた】</h1>\r\n<br /><br /><br />上品で洗練された大人のイメージの下着を好むあなたは、<br /><br />一見クールに見られがちですが、<br /><br />実は非常に情熱的な女性のはず。<br /><br />愛する人のためには苦労を惜しまない<br /><br />一途な性格の持ち主である反面、<br /><br />関係の終わった男性には非常に冷たくすることもあります。<br /><br />恋愛では自分が主導権を握ったり、<br /><br />堂々とした潔さを見せて&ldquo;カッコイイ女&rdquo;を演じるあなたですが、<br /><br />時に弱さを隠してつよがり過ぎるきらいがあります。<br /><br />たまには素直に弱さをさらけ出すことができれば、<br /><br />自分もラクになれますし、<br /><br />相手の男性の心をしっかりと掴むことができるでしょう。<br /><br /><br /><br />\r\n<h1>『そんなあなたはこんな男性がおススメ』</h1>\r\n<br /><br />一見クールに見えるけれど、<br /><br />実は情熱的なあなた。<br /><br />同じく情熱的に愛してくれる、<br /><br />ラテン系の男性と相性がいいはずです。<br /><br />下着で言えば、堂々とビキニを穿くような男性でしょうか<br /><br />（男性がビキニを穿くことに<br /><br />嫌悪感を抱く女性は多いようですが、<br /><br />あくまでもタイプのお話です）。<br /><br />スマートな恋愛を理想にしているあなたは、<br /><br />自分の嫌なところや相手の嫌なところには目を瞑りがちです。<br /><br />しかし、人間は誰しも完璧ではありませんし、<br /><br />とくに男女間の恋愛感情というのは、<br /><br />嫉妬だ何だと、醜い感情もつきもの。<br /><br />そうした部分をクリアできれば、<br /><br />彼と深い仲になれることでしょう<br /><br /><br /><br /><br /><br />\r\n<h1>【ベージュの下着が多いあなた】</h1>\r\n<br /><br />保守的で、地味な下着を好むあなたは、<br /><br />性格も控えめ。突飛な行動をとることはなく、<br /><br />慎重な性格なのではないでしょうか。<br /><br />浮ついたことが嫌いで、<br /><br />常識を重んじるため、<br /><br />浮気や不倫、<br /><br />二股などは許せません。<br /><br />恋愛に対して潔癖な意識の持ち主が多いようです。<br /><br /><br />恋愛であまりアクティブになることはなく、<br /><br />自然に身を任せている様子。<br /><br />そのため、ドラマチックな出会いや燃え上がるような<br /><br />恋愛には少し縁遠いようです。<br /><br />しかし、「この人！」と思った人とは着実に愛を育むため、<br /><br />いい相手にめぐり合えれば幸せになる力を持っています。<br /><br /><br />\r\n<h1>『そんなあなたはこんな男性がおススメ』</h1>\r\n<br /><br />保守的で控えめ、<br /><br />建設的な性格のあなたにぴったりな男性は、<br /><br />誠実で情に厚い男性。<br /><br />そんな男性がよく穿く下着は、<br /><br /><br />&hellip;&hellip;ふんどし?!　<br /><br />というのは冗談で、<br /><br />無地のトランクスといったところでしょうか。<br /><br />自然体で出会いを待ち、<br /><br />自らはあまり行動を起こさないあなた。<br /><br />恋愛を進行させることは得意でも、<br /><br />恋愛を始めるきっかけを掴むことが苦手なはず。<br /><br />しばらく恋をしていない、という人は、<br /><br />もう少し積極的に出会いを探してみてください。<br /><br /><br /><br /><br /><br />\r\n<h1>【紺色や茶系の下着が多いあなた】</h1>\r\n<br /><br />決して派手ではないけれど地味でもない、<br /><br />紺色や茶系の下着を好むあなたは、<br /><br />じつは密かに自己主張の強い性格です。<br /><br />女らしさで男に媚びることが苦手で、<br /><br />私は私、といった<br /><br />自信も強いのではないでしょうか。<br /><br />恋愛においては、あまり感情に流されることがありません。<br /><br />理論的に考え、<br /><br />恋人との関係が自分のためにならないと思ったら<br /><br />すぐに別れの決断をすることも。<br /><br />自分が惚れるより相手を惚れさせることが多く、<br /><br />どちらかと言えば恋愛上手です。<br /><br />しかし、恋に溺れる醍醐味を知らないという意味では、<br /><br />感情面が未熟だと言えるかもしれません。<br /><br /><br />\r\n<h1>『そんなあなたはこんな男性がおススメ』</h1>\r\n<br /><br />しっかりと自分を持っているあなたは、<br /><br />恋の相手にも同じように、<br /><br />自己確立した尊敬できる男性を望みます。<br /><br />下着はどこどこのブランドの何がいい、<br /><br />というように、<br /><br />こだわりを持った男性と相性がいいでしょう。<br /><br />お互いの時間を尊重し合うあまり、<br /><br />2人の仲が疎遠になりがちなのが<br /><br />こうしたカップルのデメリットです。<br /><br />距離をおいた付き合いの中でも、<br /><br />同じ映画や本を読むなど、<br /><br />お互いの思想や感情を話し合い、<br /><br />理解し合う時間を作ることが大切です。<br /><br /><br /><br /><br /><br />\r\n<h1>【赤や青、緑など原色の下着が多いあなた】</h1>\r\n<br /><br />はっきりとした強い色の下着を好むあなたは、<br /><br />バイタリティー溢れる性格です。<br /><br />積極的で行動的。<br /><br />たとえ失恋をして落ち込むことはあっても、<br /><br />比較的立ち直りも早いのではないでしょうか。<br /><br />前向きで、常に次の恋へとチャレンジするタイプです。<br /><br />しかし、時にその思慮の足りない性格が手痛い失敗を招きます。<br /><br />それほど好みの相手でもないのに簡単に付き合ってしまったり、<br /><br />ちょっとしたことがきっかけで大切な恋人を失ってしまったり。<br /><br />そんな時の立ち直りも早いあなたですが、<br /><br />本当の幸せを掴むためには反省も必要です。<br /><br /><br />\r\n<h1>『そんなあなたはこんな男性がおススメ』</h1>\r\n<br /><br />積極的で行動的なあなたは、一筋縄ではいかない、<br /><br />何を考えているのかわからない、<br /><br />神秘的な男性に弱いようです。<br /><br />そんな男性が穿いている下着は&hellip;&hellip;？　<br /><br />意外にも、キャラクタープリントのトランクスだったりして。<br /><br />派手な柄物を好むことも多いかもしれません。<br /><br /><br />愛されることより愛することに幸せを見出せるあなたは、<br /><br />その行動的な性格から、<br /><br />相手を間違えると大変な苦労をすることもあるでしょう。<br /><br />ご自分の過去の恋愛経験を一過性のものとして忘れるのではなく、<br /><br />糧として経験値を上げることができれば、<br /><br />次の恋愛ではさらなる幸せを掴むことができるはず。<br /><br /><br /><br /><br />いかがでしたか？<br /><br />男性の下着は冗談ですが、<br /><br />恋愛に対する考え方については<br /><br />参考にしてみてくださいね！！！<br /><br /><br /><br /></div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>', 'publish_actions', '173658296169309', 'https://www.facebook.com/cosmehousecom', 'Cosmehouse - コスメハウス', 185, '<div class="textarea">\r\n<h1><img src="/uploads/shitagi-top_01_20140307.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/shitagi-top_02_20140307.png" alt="alt" width="100%" /></h1>\r\n<h1>【ズバリ当てます】あなたが持っている下着の色で、恋愛の傾向が分かります。</h1>\r\n<br /><br /><span style="color: #ff0000; background-color: #ffff00;">あなたの持っている下着でもっとも多い色を答えてください。</span><br /><br /><br /><br />・白、パステルカラー<br /><br />・黒、グレー<br /><br />・ベージュ<br /><br />・紺色、茶系<br /><br />・赤や青、緑など原色<br /><br /><br /><br />あなたの選んだ答えで、<span style="color: #ff0000; background-color: #ffff00;">性格診断</span>と、<br /><br /><span style="color: #ff0000; background-color: #ffff00;">あなたにオススメの男性のタイプ</span>が分かります。<br /><br /><br />答えは、決まりましたか？。<br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;">【次へ進む】</span>を押すと診断結果が分かるよ！！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 1, 1, '0000-00-00', 1),
(113, 1, 14, '【マジか…】日本人の七割がやった事があるという衝撃の行動がイラストに…。', '【ムカツクけど…】私、全部やった事がありました。。', '7wari-share_01_20140310.png', '', '', '<div class="textarea">\r\n<h1><img src="/uploads/7wari-result_01_20140310.png" alt="alt" width="100%" /></h1>\r\n<h1>【マジか&hellip;日本人の七割がやった事があるという衝撃の行動がイラストに&hellip;】</h1>\r\n<br /><br />■日本人の７割がやりそうなこと<br /><br />①とんがりコーンを指にはめる<br /><br />②扇風機の前であーーーーって言う。<br /><br />③ポッキーのチョコの部分だけを舐めとる。<br /><br />④向かってくる歩行者をかわし損ねてフェイントの掛け合いみたいになる。<br /><br />⑤自分の声を録音して聞いて死にたくなる。<br /><br />⑥部屋のひもを使ってボクシング</div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">いかがでしたか？<br /><br />当たってた、悔しい！<br /><br />と思ったらコメントをお願いします！！！！<br /><br /><br /><br /></div>\r\n<div class="textarea">&nbsp;</div>\r\n<div class="textarea">&nbsp;</div>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 273, '<div class="textarea">\r\n<h1><img src="/uploads/7wari-title_01_20140310.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/7wari-title_02_20140310.png" alt="alt" width="100%" /></h1>\r\n<h1>【高確率】あなたもひとつは当てはまります！！</h1>\r\n<br /><br />この画像に書かれている事は、<br /><br /><span style="color: #ff0000; background-color: #ffff00;">日本人の7割がやった事がある日常のあるある</span>を<br /><br />6点集めたイラストです。<br /><br />このイラストを見たインターネットユーザは<br /><br />・ムカツクけど全部やった<br /><br />・６こはやった<br /><br />・むしろやらない日本人が３割もいるのか<br /><br />などと、様々な意見が飛び交っています。<br /><br /><br /><br />さて、あなたはいくつ当てはまるでしょうか。<br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;">【次へ進む】</span>を押すとあるある画像が見れるよ！！</p>\r\n<p style="text-align: center;">&darr;</p>\r\n<p style="text-align: center;">&darr;</p>\r\n</div>', 3, 4, '0000-00-00', 1),
(114, 1, 14, '【先着1500名限定】怖い話シリーズ～画像編｜古民家に写る恐怖～', '【恐怖】画像を見ると心臓が止まりそうになります…。', 'rouka-share_03_20140310.png', '', '', '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/rouka-kao_03_20140310.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/rouka-kao_04_20140310.png" alt="alt" width="100%" /></h1>\r\n<h1>【専門家のコメント】</h1>\r\nこ廊下に写り出た心霊の写真で、<br />悪意に満ちておりません。<br /><br />守護霊のようなものだと思います。<br />古い先祖霊の可能性もあります。<br /><br />家に憑いているのか、<br />撮影した本人に憑いているのか<br />定かではありませんが、<br />目つきが優しいので、<br />あまり、害が無いと思います。<br /><br />なにか、<br />事を起こそうとしているならば、<br />警告だと思います。<br /><br /><br /><br /><br /><span style="color: #ff0000;">あなたは、どう思いますか？</span></div>\r\n</div>\r\n<p><br /><br /></p>', 'publish_actions', '780779295270652', 'https://www.facebook.com/tadaimashindan', 'ただいま！', 9, '<div class="black">\r\n<div class="textarea">\r\n<h1><img src="/uploads/horror_cont.png" alt="alt" width="100%" /></h1>\r\n<h1><img src="/uploads/rouka-kao_01_20140310.png" alt="alt" width="100%" /></h1>\r\n<h1>【先着1500名限定】怖い話シリーズ～画像編｜古民家に写る恐怖～</h1>\r\n<br /><span style="color: #ff0000;">※閲覧数1,500名を越えると自動で閲覧できなくなります※</span><br /><span style="color: #ff0000;">ご注意下さい&hellip;。</span><br /><span style="color: #ff0000;">勇気のある方はお早めにどうぞ。。。。。</span><br /><br /><br />－－－－－－－－－－－－－－－－－－－－<br /><br />この写真は、茨城県に住む１５歳の<br />少年が撮影した写真に写っていたものです。<br /><br />偶然写りこんで見えるものなのか&hellip;<br />しかし、偶然と呼ぶにはあまりにも<br />鮮明に写りすぎて、模様とは思えない<br />ものが写っていたのです&hellip;。<br /><br />－－－－－－－－－－－－－－－－－－－－<br /><br /><br /><br />\r\n<p>&nbsp;</p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&nbsp;<br /><br />【次へ進む】を押すとモザイクなしの画像がみれますが、<br />怖いのが苦手な人はくれぐれも閲覧しないで下さい&hellip;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>&darr;</strong></span></p>\r\n</div>\r\n</div>\r\n<p><br /><br /></p>', 9, 9, '0000-00-00', 0);
